14429=>["Value"=>14429,"TextKey"=>"图鉴描述10501","TextValue"=>"She's a modern princess who has her own career and a lovely kitty. She loves to embark on new journeys and make new friends."],
14430=>["Value"=>14430,"TextKey"=>"图鉴描述10502","TextValue"=>"Arrived in the town with Aurora. Dream of becoming one of the greatest fashion designers of the era."],
14431=>["Value"=>14431,"TextKey"=>"图鉴描述10503","TextValue"=>"The legendary story teller and music composer of the tribe. As he roamed across the lands and seas, no one ever saw him around. With his profound voice and wits, many eulogies have been sung. "],
14432=>["Value"=>14432,"TextKey"=>"图鉴描述10504","TextValue"=>"Pure and peng. Full of curiosity about the ouside world, she likes to play drums whenever she feels expressive."],
14433=>["Value"=>14433,"TextKey"=>"图鉴描述10505","TextValue"=>"The King of all lions, and walks like a human. It once lost its wonderful home land along side its tribal members, but with its exceptional strength, witness and bravery, a true leader will take it back at last."],
14434=>["Value"=>14434,"TextKey"=>"图鉴描述10506","TextValue"=>"Walked out of a heartbreaking past, she becomes stronger and more optimistic. She also learnt a magic that can make visions in match flames come true."],
14435=>["Value"=>14435,"TextKey"=>"图鉴描述10507","TextValue"=>"He's wee stingy and naughty. Was once cursed by the Witch because of his prank. With a pumpkin head, he becomes more kind, often holding a lantern to light passers-by in the dark."],
14436=>["Value"=>14436,"TextKey"=>"图鉴描述10508","TextValue"=>"To this panda, life is all about delicious bamboos and Kung-fu movies. As a day dreamer, he wishes to become a hero one day and fight the strongest Kung-fu master in the world."],
14437=>["Value"=>14437,"TextKey"=>"图鉴描述10509","TextValue"=>"A dutiful toy soldier with great potential to become a real general. He has only one ambition - to safeguard the Kingdom!"],
