15847=>["Value"=>15847,"TextKey"=>"新手引导说明1012","TextValue"=>"<line-height=130%><color=#38aec0>Homeland</color> is unlocked! Go check it out!"],
15848=>["Value"=>15848,"TextKey"=>"新手引导说明2000","TextValue"=>"<line-height=130%>Good-hearted person over there, help me please!"],
15849=>["Value"=>15849,"TextKey"=>"新手引导说明2001","TextValue"=>"<line-height=130%>I'm trapped in these <color=#38c0a5>Totems</color>!"],
15850=>["Value"=>15850,"TextKey"=>"新手引导说明2002","TextValue"=>"Drag any 3 <color=#38c0a5>Totems</color> of the same kind together to trigger a <color=#f58c26>Merge</color>, and the curse will be lifted."],
15851=>["Value"=>15851,"TextKey"=>"新手引导说明2010","TextValue"=>"<line-height=130%>Ah! I don't see any totems here!"],
15852=>["Value"=>15852,"TextKey"=>"新手引导说明2011","TextValue"=>"<line-height=130%>Look! That's the <color=#f58c26>Code of Creation</color>. You'll see it in various levels. Let's see what's written inside."],
15853=>["Value"=>15853,"TextKey"=>"新手引导说明2012","TextValue"=>"<line-height=130%>Tap it to get some helpful tips for the game. Try it out!"],
15854=>["Value"=>15854,"TextKey"=>"新手引导说明2020","TextValue"=>"<line-height=130%>If you want to beat a level, you need to get a <color=#f58c26>Designated Object</color>."],
15855=>["Value"=>15855,"TextKey"=>"新手引导说明2022","TextValue"=>"<line-height=130%>The <color=#f58c26>Level Objective</color> will tell you what you need to get. Start merging and win!"],
15856=>["Value"=>15856,"TextKey"=>"新手引导说明2030","TextValue"=>"<line-height=120%>Wow, a <color=#ef933d>Carving of Young Embla</color>! Their powers have faded too! We need to wake <color=#f58c26>Embla</color> up through merging the carvings."],
15857=>["Value"=>15857,"TextKey"=>"新手引导说明2031","TextValue"=>"If a level has these carvings, you can usually beat the level through merging them."],
15858=>["Value"=>15858,"TextKey"=>"新手引导说明2032","TextValue"=>"<line-height=130%>These lands have lost their connection with the Goddess, so they fell into deep slumber."],
15859=>["Value"=>15859,"TextKey"=>"新手引导说明2033","TextValue"=>"<line-height=130%>You can't move any object on <color=#38aec0>Dormant Lands</color>."],
15860=>["Value"=>15860,"TextKey"=>"新手引导说明2034","TextValue"=>"<line-height=130%>Merge any <color=#38c0a5>Spirit Flowers</color> to wake up land."],
15861=>["Value"=>15861,"TextKey"=>"新手引导说明2035","TextValue"=>"<line-height=130%>When you win, <color=#f58c26>Goddess Embla</color> will wake up all lands!"],
15862=>["Value"=>15862,"TextKey"=>"新手引导说明2040","TextValue"=>"<line-height=130%>Look! It's a <color=#38c0a5>Totem</color>."],
15863=>["Value"=>15863,"TextKey"=>"新手引导说明2041","TextValue"=>"Hurry and merge <color=#38c0a5>Three Totems</color> to save the tribal member trapped inside!"],
15864=>["Value"=>15864,"TextKey"=>"新手引导说明2050","TextValue"=>"As we just said, you can tap a <color=#38c0a5>Wild Rune Orb</color> to wake up land."],
15865=>["Value"=>15865,"TextKey"=>"新手引导说明2051","TextValue"=>"<line-height=130%>Of course, you can also merge them to get more advanced ones!"],
15866=>["Value"=>15866,"TextKey"=>"新手引导说明2060","TextValue"=>"You can merge objects on <color=#38aec0>Dormant Lands</color> with ones on normal lands to wake up the dormant ones automatically."],
15867=>["Value"=>15867,"TextKey"=>"新手引导说明2070","TextValue"=>"Tap a <color=#38c0a5>Totem Group</color> to get a <color=#38c0a5>Totem</color>."],
15868=>["Value"=>15868,"TextKey"=>"新手引导说明2080","TextValue"=>"Some <color=#38aec0>Super Dormant Lands</color> can't be awakened through <color=#f58c26>Healing points</color>, but can only be waked up through merging its objects with the ones on normal lands."],
15869=>["Value"=>15869,"TextKey"=>"新手引导说明2090","TextValue"=>"<line-height=130%>From now on, levels come with <color=#f58c26>Tasks</color>."],
15870=>["Value"=>15870,"TextKey"=>"新手引导说明2091","TextValue"=>"<line-height=130%>You can check the <color=#38c0a5>Task Sun</color> for the tasks and rewards."],
15871=>["Value"=>15871,"TextKey"=>"新手引导说明2093","TextValue"=>"<line-height=130%>This button can lock or unlock the <color=#f58c26>Screen Dragging Function</color>."],
15872=>["Value"=>15872,"TextKey"=>"新手引导说明2100","TextValue"=>"Some objects can't be merged directly. Tap the <color=#ef933d>Pile of Wedge-shaped Rocks</color> to split them into <color=#ef933d>Wedge-shaped Rocks</color>  then merge. "],
15873=>["Value"=>15873,"TextKey"=>"新手引导说明2110","TextValue"=>"<line-height=130%>You need to check the <color=#f58c26>Level Objectives</color>."],
15874=>["Value"=>15874,"TextKey"=>"新手引导说明2130","TextValue"=>"<line-height=130%>We can get <color=#ef933d>Bush Sprouts</color> from <color=#38c0a5>Dragon Bones</color>."],
15875=>["Value"=>15875,"TextKey"=>"新手引导说明2140","TextValue"=>"This is a huge <color=#ef933d>Wake-up Bomb</color>. If you wake up the land next to it, it will automatically wake up, and will wake up the tiles directly surrounding it."],
15876=>["Value"=>15876,"TextKey"=>"新手引导说明2150","TextValue"=>"Tribal members can collect <color=#38c0a5>Wild Ores</color> for you from higher level <color=#38c0a5>Vines</color> ."],
15877=>["Value"=>15877,"TextKey"=>"新手引导说明2160","TextValue"=>"This is a <color=#ef933d>Shattered Tomb</color>. If you neglect or merge them, they will turn into terrifying <color=#df66a8>Zombies</color>. Defeat them to get <color=#38c0a5>Fireflies</color>, which you need to pass the level."],
15878=>["Value"=>15878,"TextKey"=>"新手引导说明2170","TextValue"=>"An <color=#ef933d>Abandoned Wallnest</color> constantly generates zombies even while dormant. Tapping it generates a zombie immediately! Destroying zombies gives you <color=#38c0a5>Wild Ores</color>."],
15879=>["Value"=>15879,"TextKey"=>"新手引导说明2180","TextValue"=>"This is a <color=#38c0a5>Druid's Rune Portal</color>, how lucky we are! Merge them to summon a <color=#38c0a5>Tribal Member</color> from Homeland to help you."],
15880=>["Value"=>15880,"TextKey"=>"新手引导说明2190","TextValue"=>"The remanence of the Holy Tree of Creation. Automatically produces <color=#38c0a5>Wild Rune Orbs</color>. The higher the level, the stronger the healing power is."],
15881=>["Value"=>15881,"TextKey"=>"新手引导说明2200","TextValue"=>" <color=#ef933d>Clouds</color> will keep appearing from here. Tap them to make them rain. <color=#38c0a5>Puddles</color> and <color=#38c0a5>Spirit Flowers</color> will appear on empty lands below them."],
15882=>["Value"=>15882,"TextKey"=>"新手引导说明2210","TextValue"=>"<line-height=130%>Strange…where are the <color=#ef933d>Carvings of Young Embla</color>?"],
15883=>["Value"=>15883,"TextKey"=>"新手引导说明2211","TextValue"=>"<line-height=130%>Oh, yes, if you complete your <color=#f58c26>Tasks</color>, they will appear!"],
15884=>["Value"=>15884,"TextKey"=>"新手引导说明2220","TextValue"=>"This is a <color=#ef933d>Statue of Demon</color>. Hideous piece of work! Order your people to annilate it to get a <color=#ef933d>Carving of Young Embla</color>."],
15885=>["Value"=>15885,"TextKey"=>"新手引导说明2230","TextValue"=>"<line-height=130%>A new Camp has opened! Go check it out in the World Map!"],
15886=>["Value"=>15886,"TextKey"=>"新手引导说明2240","TextValue"=>"<line-height=130%>I'm free again! Thank you so much! "],
15887=>["Value"=>15887,"TextKey"=>"新手引导说明2241","TextValue"=>"<line-height=130%>The people of our tribe are trapped in these <color=#38c0a5>Totems</color>."],
15888=>["Value"=>15888,"TextKey"=>"新手引导说明2242","TextValue"=>"<line-height=130%>The tribe needs your help to find other tribal members here, as well as back home."],
15889=>["Value"=>15889,"TextKey"=>"新手引导说明2243","TextValue"=>"<line-height=130%>Go search for them in the next level!"],
15890=>["Value"=>15890,"TextKey"=>"新手引导说明2250","TextValue"=>"You can <color=#f58c26>double-tap</color> some objects to call someone here to harvest from it."],
15891=>["Value"=>15891,"TextKey"=>"新手引导说明2251","TextValue"=>"<line-height=130%>You can use or merge the objects you've gathered."],
15892=>["Value"=>15892,"TextKey"=>"新手引导说明2252","TextValue"=>"<line-height=130%>Harvest from a <color=#38c0a5>Spirit Flower</color> to get a <color=#38c0a5>Wild Rune Orb</color>."],
15893=>["Value"=>15893,"TextKey"=>"新手引导说明2253","TextValue"=>"<color=#f58c26>Tap the orb</color> to wake up <color=#38aec0>Dormant Lands</color>."],
15894=>["Value"=>15894,"TextKey"=>"新手引导说明2261","TextValue"=>"<line-height=130%>From now on, you can select rewards at the end of each level."],
15895=>["Value"=>15895,"TextKey"=>"新手引导说明2262","TextValue"=>"<line-height=130%>Rewards are usually <color=#38c0a5>Gold</color> or other useful resources. Sometimes even a totem!"],
15896=>["Value"=>15896,"TextKey"=>"新手引导说明2263","TextValue"=>"<line-height=130%>Your rewards will be put into <color=#f58c26>Bubbles</color> and sent back home."],
15897=>["Value"=>15897,"TextKey"=>"新手引导说明3000","TextValue"=>"<line-height=130%>This is our <color=#f58c26>Homeland</color>."],
15898=>["Value"=>15898,"TextKey"=>"新手引导说明3001","TextValue"=>"<line-height=130%>Where it used to be our home, before the <color=#f58c26>Big Flood</color> destroyed our peaceful life, leaving a heavy fog covering the land."],
15899=>["Value"=>15899,"TextKey"=>"新手引导说明3002","TextValue"=>"<line-height=105%>Merge objects with ones on dormant lands to wake up land directly! Try to merge to rescue more tribal members! The bigger your population is, the more fog you can clear up, and the faster you can rebuild our home."],
15900=>["Value"=>15900,"TextKey"=>"新手引导说明3005","TextValue"=>"<line-height=130%>You can only unlock one <color=#38c0a5>Time Treasure Chest</color> at once. Wait for the end of the countdown to get them, or spend Rubies to get any <color=#38c0a5>Time Treasure Chests</color> immediately."],
15901=>["Value"=>15901,"TextKey"=>"新手引导说明3006","TextValue"=>"<line-height=130%>Level rewards have arrived! Open the bubbles and check them out!"],
15902=>["Value"=>15902,"TextKey"=>"新手引导说明3010","TextValue"=>"<line-height=130%><color=#38c0a5>Longhouses</color> are places where workers can get some rest. They'll come out after a certain amount of time."],
15903=>["Value"=>15903,"TextKey"=>"新手引导说明3011","TextValue"=>"<line-height=130%><color=#38c0a5>Longhouses</color> can be merged into higher level ones. The higher the level, the shorter the time it takes for tribal members to rest inside."],
15904=>["Value"=>15904,"TextKey"=>"新手引导说明3016","TextValue"=>"<line-height=130%>Spend <color=#38c0a5>Rubies</color> to wake them up immediately."],
15905=>["Value"=>15905,"TextKey"=>"新手引导说明3030","TextValue"=>"You can complete more tasks at Homeland to get more <color=#38c0a5>Forgotten Heritage</color>. Tap them to get special rewards!"],
15906=>["Value"=>15906,"TextKey"=>"新手引导说明3040","TextValue"=>"<line-height=130%>This is a tiny piece of <color=#38c0a5>Gold</color>."],
15907=>["Value"=>15907,"TextKey"=>"新手引导说明3041","TextValue"=>"<line-height=120%>You can tap them to get some <color=#38c0a5>Gold</color>, or you can merge them into more advanced gold nuggets."],
15908=>["Value"=>15908,"TextKey"=>"新手引导说明3042","TextValue"=>"<line-height=130%>You can spend your <color=#38c0a5>Gold</color> at the <color=#f58c26>Shop</color>."],
15909=>["Value"=>15909,"TextKey"=>"新手引导说明3050","TextValue"=>"<line-height=130%>Too much gold? You can go buy some really good stuff at the shop!"],
15910=>["Value"=>15910,"TextKey"=>"新手引导说明3060","TextValue"=>"<line-height=130%>All <color=#df66a8>Tribal Members</color> are too tired. They need a break to restore their energy."],
15911=>["Value"=>15911,"TextKey"=>"新手引导说明3061","TextValue"=>"<line-height=130%>Time to beat more levels and save more people!"],
15912=>["Value"=>15912,"TextKey"=>"新手引导说明3062","TextValue"=>"<line-height=120%>The more tribal members you have, the more resources they can gather for you before they go to sleep."],
15913=>["Value"=>15913,"TextKey"=>"新手引导说明3063","TextValue"=>"<line-height=130%>Beat levels to rescue more tribal members."],
15914=>["Value"=>15914,"TextKey"=>"新手引导说明3064","TextValue"=>"<line-height=130%>And bring them back home!"],
15915=>["Value"=>15915,"TextKey"=>"新手引导说明3065","TextValue"=>"<line-height=130%>Look! You can go to the Camp through tapping the <color=#f58c26>World Map</color>."],
15916=>["Value"=>15916,"TextKey"=>"新手引导说明3070","TextValue"=>"<line-height=130%>There's no space to put anything anymore: the ground is completely covered!"],
15917=>["Value"=>15917,"TextKey"=>"新手引导说明3071","TextValue"=>"<line-height=130%>Select an object, and select in the information box to sell or discard it. "],
15918=>["Value"=>15918,"TextKey"=>"新手引导说明3080","TextValue"=>"This is an <color=#38c0a5>Alien Heritage</color>, it's extremely rare! Tap it to receive <color=#38c0a5>Rubies</color>! Or you can merge them into more advanced ones!"],
15919=>["Value"=>15919,"TextKey"=>"新手引导说明3090","TextValue"=>"<line-height=130%>This is a piece of <color=#38c0a5>Wild Ore</color>."],
15920=>["Value"=>15920,"TextKey"=>"新手引导说明3091","TextValue"=>"<line-height=130%>You can tap them to collect <color=#38c0a5>Wild Ores</color>, or you can merge them to get more advanced ones!"],
15921=>["Value"=>15921,"TextKey"=>"新手引导说明3092","TextValue"=>"<line-height=130%>You can spend the <color=#38c0a5>Wild Ores</color> you collected at the <color=#f58c26>Shop</color>."],
15922=>["Value"=>15922,"TextKey"=>"新手引导说明3100","TextValue"=>"<line-height=130%>If your <color=#38c0a5>Wild Ore</color> storage is becoming too packed, you can also spend them at the shop."],
15923=>["Value"=>15923,"TextKey"=>"新手引导说明3110","TextValue"=>"This <color=#38c0a5>Roadblock</color> here bothers me a lot! But you can't move it directly. You can order your <color=#df66a8>Tribal Members</color> to attack it to spilt it into smaller roadblocks."],
15924=>["Value"=>15924,"TextKey"=>"新手引导说明3120","TextValue"=>"<color=#38c0a5>Barbettes</color> contaminate lands even while on dormant land. The <color=#f58c26>Progress Bar</color> shows how long between each firing. You can only attack a woke barbette."],
15925=>["Value"=>15925,"TextKey"=>"新手引导说明3130","TextValue"=>"This is a <color=#f58c26>Hero's Altar</color>. Heroes will switch between <color=#f58c26>Idle Mode</color> and <color=#f58c26>Patrolling Mode</color>."],
15926=>["Value"=>15926,"TextKey"=>"新手引导说明3131","TextValue"=>"With a hero around, there will be additional surprises for any <color=#f58c26>merges of 4 objects</color>!"],
15927=>["Value"=>15927,"TextKey"=>"新手引导说明3132","TextValue"=>"If they are idle, you can spend <color=#38c0a5>Rubies</color> to wake them up immediately."],
15928=>["Value"=>15928,"TextKey"=>"新手引导说明3133","TextValue"=>"You can click here to check out some info of the Hero"],
15929=>["Value"=>15929,"TextKey"=>"新手引导说明3142","TextValue"=>"<line-height=130%>Heroes have unique abilities as strong units of the tribe."],
15930=>["Value"=>15930,"TextKey"=>"新手引导说明3144","TextValue"=>"<line-height=130%>You can check the descriptions of a hero's abilities here in the <color=#f58c26>Hero Ability Box</color>."],
15931=>["Value"=>15931,"TextKey"=>"新手引导说明3145","TextValue"=>"<line-height=130%>You can level up heroes by submitting finished <color=#f58c26>Quests</color>."],
15932=>["Value"=>15932,"TextKey"=>"新手引导说明3147","TextValue"=>"Finish all quests to level up your hero!"],
15933=>["Value"=>15933,"TextKey"=>"新手引导说明3150","TextValue"=>"<line-height=130%>Great job! More tribal members broke free from the sorcerer's seal!"],
15934=>["Value"=>15934,"TextKey"=>"新手引导说明3151","TextValue"=>"With more members in your tribe, you can clear more <color=#f58c26>Fog</color>!"],
15935=>["Value"=>15935,"TextKey"=>"新手引导说明3152","TextValue"=>"<line-height=130%>The fog in each area requires certain level of Tribal Power to clear up."],
15936=>["Value"=>15936,"TextKey"=>"新手引导说明3153","TextValue"=>"<line-height=130%>Now we can clear the fog in this area!"],
15937=>["Value"=>15937,"TextKey"=>"新手引导说明3161","TextValue"=>"You can't clear this fog yet."],
15938=>["Value"=>15938,"TextKey"=>"新手引导说明3162","TextValue"=>"<line-height=130%>Your <color=#f58c26>Tribal Power</color> is not high enough. You can purchase more totems in the shop."],
15939=>["Value"=>15939,"TextKey"=>"新手引导说明3165","TextValue"=>"<line-height=130%>Spend gold to buy totems!"],
15940=>["Value"=>15940,"TextKey"=>"新手引导说明3166","TextValue"=>"<line-height=130%>The price of the totems will increase after each purchase. Go get more gold!"],
15941=>["Value"=>15941,"TextKey"=>"新手引导说明2270","TextValue"=>"<line-height=130%>This level has a <color=#f58c26>Time Limit</color>. You must complete the trial in the indicated time limit, or you will lose."],
15942=>["Value"=>15942,"TextKey"=>"新手引导说明2271","TextValue"=>"<line-height=130%>You can check how much time is left here."],
15943=>["Value"=>15943,"TextKey"=>"新手引导说明2273","TextValue"=>"<line-height=130%>As the time left gets less, the color of the numbers will turn from <color=#46bb83>Green</color> to <color=#eca852>Yellow</color> and eventually <color=#e04030>Red</color>."],
15944=>["Value"=>15944,"TextKey"=>"新手引导说明2274","TextValue"=>"<line-height=130%>In order to beat the level faster, you can check out the Shop."],
15945=>["Value"=>15945,"TextKey"=>"新手引导说明2277","TextValue"=>"<line-height=130%>You can spend <color=#38c0a5>Rubies</color> to buy key objects from the shop directly."],
15946=>["Value"=>15946,"TextKey"=>"新手引导说明2281","TextValue"=>"<line-height=130%>This kind of levels gives you a <color=#38c0a5>Tribal Member</color> as a reward. You can spend <color=#38c0a5>Rubies</color> to double your rewards."],
15947=>["Value"=>15947,"TextKey"=>"新手引导说明2290","TextValue"=>"<line-height=130%>Welcome to another God's Trial! You'll also get a reward after you've beat the challenge."],
15948=>["Value"=>15948,"TextKey"=>"新手引导说明2291","TextValue"=>"<line-height=130%>You can complete a trial <color=#f58c26>three times</color>, but the time limit will get shorter each time."],
15949=>["Value"=>15949,"TextKey"=>"新手引导说明3149","TextValue"=>"<line-height=130%>You'll need to wait for the hero's training session for level-up, or you can spend <color=#38c0a5>Rubies</color> to speed up the process."],
15950=>["Value"=>15950,"TextKey"=>"新手引导说明2300","TextValue"=>"<line-height=130%>Look, this is an <color=#46bb83>Inlay Niche</color>, it controls a large area of fog."],
15951=>["Value"=>15951,"TextKey"=>"新手引导说明2301","TextValue"=>"<line-height=130%>Drag the corresponding object into the niche to clear the fog."],
15952=>["Value"=>15952,"TextKey"=>"新手引导说明2302","TextValue"=>"<line-height=130%>If the niche is still dormant, then you'll have to wake it up first."],
15953=>["Value"=>15953,"TextKey"=>"新手引导说明2400","TextValue"=>"<line-height=130%>Welcome to a Event! It will only be open for a limited amount of time!"],
15954=>["Value"=>15954,"TextKey"=>"新手引导说明2401","TextValue"=>"<line-height=130%>Participating in a Event gives you tons of rewards, and they will be sent to your Homeland!"],
15955=>["Value"=>15955,"TextKey"=>"新手引导说明2402","TextValue"=>"<line-height=130%>Here you will see some unique objects, new creatures and new forms of gameplay!"],
15956=>["Value"=>15956,"TextKey"=>"新手引导说明3180","TextValue"=>"<line-height=130%>Torches are necessary for you to venture forward in levels! They refill over time."],
15957=>["Value"=>15957,"TextKey"=>"新手引导说明3181","TextValue"=>"<line-height=130%>Your've got tons of torches now! Go use them to play in levels!"],
15958=>["Value"=>15958,"TextKey"=>"新手引导说明1072","TextValue"=>"<line-height=130%>From now on, you can check your <color=#38c0a5>Camp Rewards</color>!"],
15959=>["Value"=>15959,"TextKey"=>"新手引导说明1073","TextValue"=>"<line-height=130%>When it's time, you can claim your rewards!"],
15960=>["Value"=>15960,"TextKey"=>"新手引导说明1074","TextValue"=>"<line-height=130%>The more stars you get in levels, the more rewards you get!"],
15961=>["Value"=>15961,"TextKey"=>"新手引导说明2235","TextValue"=>"<line-height=130%>Look! It's right over there on the map! Unlock it and check it out!"],
15962=>["Value"=>15962,"TextKey"=>"新手引导说明2310","TextValue"=>"<line-height=130%>Our Scout found a new spot great for a new Camp, go check it out!"],
15963=>["Value"=>15963,"TextKey"=>"新手引导说明2315","TextValue"=>"<line-height=130%>We might meet someone really interesting here!"],
15964=>["Value"=>15964,"TextKey"=>"新手引导说明2320","TextValue"=>"<line-height=130%>Welcome to the <color=#46bb83>Winter Getaway Event</color>, a wonderful world is waiting ahead of you!"],
