15974=>["Value"=>15974,"TextKey"=>"新手引导说明2352","TextValue"=>"<line-height=130%>This page shows you all the rewards you can get by collecting points in the Event. Once you've got enough points, the corresponding <color=#46bb83>Event Points Reward</color> will be sent to your <color=#f58c26>Homeland</color>."],
