15977=>["Value"=>15977,"TextKey"=>"新手引导说明3203","TextValue"=>"<line-height=130%>There are multiple <color=#f58c26>Daily Tasks</color> for you everyday. You'll be rewarded each time you complete one of them."],
15978=>["Value"=>15978,"TextKey"=>"新手引导说明3205","TextValue"=>"<line-height=130%>If you complete all of the <color=#f58c26>Daily Tasks</color>, you'll get an <color=#f58c26>Extra Prize</color>! "],
