16003=>["Value"=>16003,"TextKey"=>"新手引导说明2534","TextValue"=>"Drag <color=#df66a8>Speedy Worker</color> onto buildings or items for construction. It can complete short construction in a blink, or decrease the time of a long construction by 1 hour."],
16004=>["Value"=>16004,"TextKey"=>"新手引导说明2540","TextValue"=>"Welcome to the <color=#f58c26>Home of Heroes</color>. Many fascinating heroes and stories are hidden here, waiting for you to explore!"],
16005=>["Value"=>16005,"TextKey"=>"新手引导说明2541","TextValue"=>"Merge by dragging one <color=#ef933d>Princess Perfume</color> onto the other two, helping us to free <color=#df66a8>Aurora</color> from the evil fog."],
16006=>["Value"=>16006,"TextKey"=>"新手引导说明2542","TextValue"=>"Fantastic! You've freed a beautiful princess -- <color=#df66a8>Aurora</color>!  Look, <color=#df66a8>Aurora</color> has brought you a food order. Tap and check it out!"],
16007=>["Value"=>16007,"TextKey"=>"新手引导说明2543","TextValue"=>"Congrats! You've unlocked <color=#ef933d>Wheat</color>, which is a key ingredient for completing orders. Tap <color=#ef933d>Wheat</color> to collect it!"],
16008=>["Value"=>16008,"TextKey"=>"新手引导说明2544","TextValue"=>"<color=#38c0a5>Spellbooks</color> can help you clear away fog and free more Heroes. You can get <color=#38c0a5>Spellbooks</color> by completing orders."],
16009=>["Value"=>16009,"TextKey"=>"新手引导说明2631","TextValue"=>"I am lost in the evil fog! Can you please <color=#ef933d>Merge</color> 3 Princess Gowns to help me?"],
16010=>["Value"=>16010,"TextKey"=>"新手引导说明2633","TextValue"=>"Hey! I am Aurora! Thanks for waking me up so that I can make my way back to Greenville Town."],
16011=>["Value"=>16011,"TextKey"=>"新手引导说明2636","TextValue"=>"<color=#ef933d>Merge 3 items</color> of the <color=#ef933d>Same Kind</color> together to clear fog and unlock <color=#ef933d>New heroes</color> and other fun things."],
16012=>["Value"=>16012,"TextKey"=>"新手引导说明2637","TextValue"=>"Drag this plant onto the other two. It will be leveled up to a <color=#ef933d>New Plant</color>. Give it a try!"],
16013=>["Value"=>16013,"TextKey"=>"新手引导说明2639","TextValue"=>"Good job! Keep merging by dragging this plant onto the others. You will get an upgraded <color=#ef933d>New Plant</color>."],
16014=>["Value"=>16014,"TextKey"=>"新手引导说明2641","TextValue"=>"Keep merging the plants. You will get a <color=#ef933d>New Plant</color> of the next level."],
16015=>["Value"=>16015,"TextKey"=>"新手引导说明2643","TextValue"=>"Repeat this move and see what is the <color=#ef933d>New Plant</color> looks like."],
16016=>["Value"=>16016,"TextKey"=>"新手引导说明2645","TextValue"=>"Last step! Drag the plant you just got onto the other two same ones and you'll get a <color=#ef933d>New Plant</color> ready for harvest! "],
16017=>["Value"=>16017,"TextKey"=>"新手引导说明2649","TextValue"=>"Ahh! It's bread! It smells soooo good!"],
16018=>["Value"=>16018,"TextKey"=>"新手引导说明2652","TextValue"=>"Turn on the light now to see what's gonna happen!"],
16019=>["Value"=>16019,"TextKey"=>"新手引导说明2663","TextValue"=>"Let's try merge 5 things together and see what's gonna happen!"],
16020=>["Value"=>16020,"TextKey"=>"新手引导说明2665","TextValue"=>"Anytime when you merge 5 items together, you will get <color=#ef933d>2 Items</color> of the next level. Don't forget the rules of <color=#ef933d>3 Merge</color> and <color=#ef933d>5 Merge</color>!"],
16021=>["Value"=>16021,"TextKey"=>"新手引导说明2671","TextValue"=>"Attention! This <color=#ef933d>Crystal</color> looks magical. Let's see what's going to happen if we merge three crystals together!"],
16022=>["Value"=>16022,"TextKey"=>"新手引导说明2673","TextValue"=>"<color=#ef933d>Advanced Magic Crystal</color> can be merged with any other two items. Kind of like the wild card in poker games. Try to merge this Magic Crytal with others."],
16023=>["Value"=>16023,"TextKey"=>"新手引导说明2675","TextValue"=>"Remember the <color=#ef933d>Advanced Magic Crystal</color> can be played as a wild card!"],
16024=>["Value"=>16024,"TextKey"=>"新手引导说明2676","TextValue"=>"Use <color=#ef933d>Speedy Workers</color> to complete construction immediately!"],
16025=>["Value"=>16025,"TextKey"=>"新手引导说明2678","TextValue"=>"<color=#ef933d>Speedy Workers</color> have ultra-high efficiency. <color=#ef933d>Drag</color> one onto a building to be constructed to see what's gonna happen!"],
16026=>["Value"=>16026,"TextKey"=>"新手引导说明2686","TextValue"=>"Complete each <color=#ef933d>Task</color> will gain you <color=#ef933d>Experience Points</color> which will upgrade your levels in the game. Tap on the Task button to learn more about it."],
16027=>["Value"=>16027,"TextKey"=>"新手引导说明2688","TextValue"=>"Do you need more <color=#ef933d>Construction Materials</color>, <color=#ef933d>Chests</color> or <color=#ef933d>Other Items</color> for help? Now the Store is open and go check what's on the shelves! There is a <color=#ef933d>Free Chest</color> for you to collect."],
16028=>["Value"=>16028,"TextKey"=>"新手引导说明2698","TextValue"=>"Get free chests and unlock the Diamond Island!"],
16029=>["Value"=>16029,"TextKey"=>"新手引导说明2701","TextValue"=>"Merge <color=#ef933d>Ice Diamonds</color> to create rare <color=#ef933d>Bubble Points</color>! Use them to clear fog on the island and discover more rewards. The more fog you clear, the richer rewards you'll claim!"],
16030=>["Value"=>16030,"TextKey"=>"新手引导说明2704","TextValue"=>"Complete constructions to win special tokens and magical rewards on the Ocean Island!"],
16031=>["Value"=>16031,"TextKey"=>"新手引导说明2713","TextValue"=>"I wonder what will happen if we <color=#ef933d>merge 5 items</color> at a time? Let's give it a go by merging those 5 Gold Bean Dusts."],
16032=>["Value"=>16032,"TextKey"=>"新手引导说明2714","TextValue"=>"Wow, we just got <color=#ef933d>2 Gold Beans</color> out of 5 Gold Bean Dusts! Remember whenever you merge 5 items together, you will get <color=#ef933d>an extra</color>."],
16033=>["Value"=>16033,"TextKey"=>"新手引导说明2715","TextValue"=>"Complete constructions to win special tokens and magical rewards on the Yummy Island!"],
16034=>["Value"=>16034,"TextKey"=>"新手引导说明2717","TextValue"=>"Complete constructions to win special tokens and magical rewards on the Joy Island!"],
16035=>["Value"=>16035,"TextKey"=>"新手引导说明2719","TextValue"=>"Complete constructions to win special tokens and magical rewards on the Botanical Island!"],
16036=>["Value"=>16036,"TextKey"=>"新手引导说明2723","TextValue"=>"Look, this is an <color=#ef933d>Inlay Niche</color>, it controls a large area of fog."],
16037=>["Value"=>16037,"TextKey"=>"新手引导说明2724","TextValue"=>"Drag the <color=#ef933d>corresponding object</color> into the niche to clear the fog."],
16038=>["Value"=>16038,"TextKey"=>"新手引导说明2726","TextValue"=>"Merge objects with <color=#ef933d>ones on dormant lands</color> to wake up land directly!"],
16039=>["Value"=>16039,"TextKey"=>"新手引导说明2729","TextValue"=>"We just got a more advanced Wild Rune Orb. Tap on the <color=#ef933d>Wild Rune Orb</color> to see what's going to happen."],
16040=>["Value"=>16040,"TextKey"=>"新手引导说明2730","TextValue"=>"<color=#ef933d>Wild Rune Orbs</color> can wake up dormant lands. The higher the level of Wild Rune Orb gets, the wider the dormant lands will be unlocked."],
16041=>["Value"=>16041,"TextKey"=>"新手引导说明2732","TextValue"=>"Here are three peculiar objects. Merge them to see what'll happen next."],
16042=>["Value"=>16042,"TextKey"=>"新手引导说明2733","TextValue"=>"Fairy Creatures are great little helpers for <color=#ef933d>harvesting plants</color>. Keep exploring in the fog to discover more of them."],
16043=>["Value"=>16043,"TextKey"=>"新手引导说明2734","TextValue"=>"<color=#ef933d>Poisonous Apples</color> are the exclusive Event Points Objects. Tap on them to claim Event Points. Higher points, better rewards!"],
16044=>["Value"=>16044,"TextKey"=>"新手引导说明2736","TextValue"=>"Try merge these 3 eggs together!"],
16045=>["Value"=>16045,"TextKey"=>"新手引导说明2748","TextValue"=>"Look! There's a strange tree. Let's get closer!"],
16046=>["Value"=>16046,"TextKey"=>"新手引导说明2762","TextValue"=>"Congrats! You've completed the first merge on the Petting Zoo island."],
16047=>["Value"=>16047,"TextKey"=>"新手引导说明2766","TextValue"=>"These fruits look nice. They should be very delicious!"],
16048=>["Value"=>16048,"TextKey"=>"新手引导说明2737","TextValue"=>"Tap the <color=#ef933d>Pile of Wedge-shaped Rocks</color> to split them into <color=#ef933d>Wedge-shaped Rocks</color>. And then merge them into  <color=#ef933d> Spiritual Flowers</color>."],
16049=>["Value"=>16049,"TextKey"=>"新手引导说明2767","TextValue"=>"By merging your pets into their final stages, you can unlock more habitats to magic creatures and collect more rewards."],
16050=>["Value"=>16050,"TextKey"=>"新手引导说明2775","TextValue"=>"Pet's Storage is now open! Select a pet and move it into storage."],
