16810=>["Value"=>16810,"TextKey"=>"剧情ID1010101","TextValue"=>"<line-height=130%>Howdy my chief, I'm Tristan, your scout! I'm glad we all survived that bumpy journey. We finally reached land, so let's set up a <color=#f58c26>Camp</color>. "],
16811=>["Value"=>16811,"TextKey"=>"剧情ID1010102","TextValue"=>"<line-height=130%>This is quite lush! Don't know what we might run into here? Let's start by propping up our tent to protect ourselves!"],
16812=>["Value"=>16812,"TextKey"=>"剧情ID1010201","TextValue"=>"<line-height=130%>Oh dear lord, look at this ugly dirt… and this ugly tent! I miss home so much…"],
16813=>["Value"=>16813,"TextKey"=>"剧情ID1010202","TextValue"=>"Now, Enda, I know leaving home is hard, but the only way to save it was to leave. All that most bizzare disasters…we must find an answer! That's why we thought to seek for help."],
16814=>["Value"=>16814,"TextKey"=>"剧情ID1010203","TextValue"=>"<line-height=130%> But we'll find a way back, ok? Let's start by building an <color=#f58c26>Altar</color> for you to talk to God, how is that, priest Enda? Chief will help!"],
16815=>["Value"=>16815,"TextKey"=>"剧情ID1020101","TextValue"=>"<line-height=130%>Look at what we found! <color=#ef933d>Heritage of the Wild</color>! That's everything we need for the <color=#f58c26>Altar</color>, and we found a way to break free of those totems! This place is blessed!"],
16816=>["Value"=>16816,"TextKey"=>"剧情ID1020201","TextValue"=>"<line-height=130%>I guess you are not completely useless, Stan or something. Although it's much smaller and underwhelming than what I had at home, it'll suffice for now! Now leave!"],
16817=>["Value"=>16817,"TextKey"=>"剧情ID1020202","TextValue"=>"<line-height=130%>Aww, how sweet, look at how happy she is and her very twisted way of saying thank you!"],
16818=>["Value"=>16818,"TextKey"=>"剧情ID1020203","TextValue"=>"<line-height=130%> (finished a strange dance) Our god told me that we are at the right place and a great figure will be coming to aid us…"],
16819=>["Value"=>16819,"TextKey"=>"剧情ID1020204","TextValue"=>"<line-height=130%>Really? That's great news! When will we meet this great figure?"],
16820=>["Value"=>16820,"TextKey"=>"剧情ID1020301","TextValue"=>"<line-height=130%> Are you the rascals that disturbed my slumber?! "],
16821=>["Value"=>16821,"TextKey"=>"剧情ID1020302","TextValue"=>"<line-height=130%>…...And you are?"],
16822=>["Value"=>16822,"TextKey"=>"剧情ID1020303","TextValue"=>"<line-height=130%>I'm the Archdruid, father of bards, conquer of storm, protector of adverturers, God's terrifying messenger, executor and judge, the chanting Amergin! "],
16823=>["Value"=>16823,"TextKey"=>"剧情ID1020304","TextValue"=>"<line-height=130%>Ah…...Nice to meet you, I guess? We are new to the area and we just heard…"],
16824=>["Value"=>16824,"TextKey"=>"剧情ID1020305","TextValue"=>"<line-height=130%>What?! You are invaders?! You shall have no chance to destroy our home and set families apart! "],
16825=>["Value"=>16825,"TextKey"=>"剧情ID1020401","TextValue"=>"What? No, no! We are not invaders, we are just trying to find a place to rest, and perhaps solve the mystery of our homeland……"],
16826=>["Value"=>16826,"TextKey"=>"剧情ID1020402","TextValue"=>"No! The bridge! Look at what you've done! God'll be mad! Wait…Who did you say you were? Amergin? Amergin the Archdruid? From the Legends?!"],
16827=>["Value"=>16827,"TextKey"=>"剧情ID1020403","TextValue"=>"You're…... not invaders? Who are you? Why are you here? Wait…Why am I here, and what is this place? Where's my people? I don't remember this land…"],
16828=>["Value"=>16828,"TextKey"=>"剧情ID1020404","TextValue"=>"I'm so sorry, but we don't have the answers either. We traveled far, risked our lives to reach here, trying to find helpers that can solve the mystery of our homeland. Firstly a dense fog fell upon us, then…"],
16829=>["Value"=>16829,"TextKey"=>"剧情ID1020405","TextValue"=>"We've had more floods in the past year than the last decade. Yet the most curiously, people have been turning into liveless totems! Can you believe?!"],
16830=>["Value"=>16830,"TextKey"=>"剧情ID1020406","TextValue"=>"Oh…that's…a lot to take in. Sorry about attacking you and destroying your bridge. Maybe I can help with rebuilding it?"],
16831=>["Value"=>16831,"TextKey"=>"剧情ID1020407","TextValue"=>"Amergin?! The mighty Amergin?! Your robe, you power to command storm... You're real! That means those tales in my family's book are real!"],
16832=>["Value"=>16832,"TextKey"=>"剧情ID1020408","TextValue"=>"<line-height=130%>Workers! Pull yourself together and rebuild that bridge!"],
16833=>["Value"=>16833,"TextKey"=>"剧情ID1020409","TextValue"=>"<line-height=130%>But we are injured! We can't start building now! "],
16834=>["Value"=>16834,"TextKey"=>"剧情ID1020410","TextValue"=>"I know just the thing. I've learned about herbal medicine through years of traveling. Let's gather some herbs and grow a <color=#f58c26>Herb Garden</color> here, as my way of saying sorry."],
16835=>["Value"=>16835,"TextKey"=>"剧情ID1020411","TextValue"=>"Thank you! That's very kind of you. We'll also go back home later to release the ones trapped in totems now that we've learned how! Great, let's go!"],
16836=>["Value"=>16836,"TextKey"=>"剧情ID1030101","TextValue"=>"<line-height=130%>We're back, and we brought helpers from home! Let's build the garden then!"],
16837=>["Value"=>16837,"TextKey"=>"剧情ID1030201","TextValue"=>"<line-height=130%>Wow, can't say I'm not impressed, you're really good at this. This little garden is beautiful. "],
16838=>["Value"=>16838,"TextKey"=>"剧情ID1030202","TextValue"=>"<line-height=130%>And very useful too. The workers are now treated and will soon be ready to rebuild the bridge!"],
16839=>["Value"=>16839,"TextKey"=>"剧情ID1030203","TextValue"=>"<line-height=130%>Glad I could help."],
16840=>["Value"=>16840,"TextKey"=>"剧情ID1030204","TextValue"=>"Speaking of which, in fact, Priest here was just talking about how virtuous and knowledgable you are. What I'm trying to say is……"],
16841=>["Value"=>16841,"TextKey"=>"剧情ID1030205","TextValue"=>"It would be an honor if an experienced adventurer, and a great figure such as you could join us. But you're a legend! No way you'll join some weird strangers! Will you? Please? Please come with us!!!"],
16842=>["Value"=>16842,"TextKey"=>"剧情ID1030206","TextValue"=>"<line-height=130%>Sure. Perhaps that's exactly why I'm sent here."],
16843=>["Value"=>16843,"TextKey"=>"剧情ID1030207","TextValue"=>"<line-height=130%>I knew it. You won't……WHAT?! You're coming with us?! Oh I can't believe……Best day of my LIFE! "],
16844=>["Value"=>16844,"TextKey"=>"剧情ID1030208","TextValue"=>"Sorry about that, she can get too excited sometimes. So now that you've joined us, how about we host a welcome party for you?"],
16845=>["Value"=>16845,"TextKey"=>"剧情ID1030209","TextValue"=>"No, I'm alright without a party, I have more pressing matters to tend to. I'm going to search for some wood to rebuild that bridge that I broke."],
16846=>["Value"=>16846,"TextKey"=>"剧情ID1030210","TextValue"=>"<line-height=130%>What an honorable man! Oh! Just to meet him…...Best day of my LIFE!"],
16847=>["Value"=>16847,"TextKey"=>"剧情ID1040101","TextValue"=>"<line-height=130%>You're the Chief…right? Thanks for your help back there. Now we are ready to rebuild that bridge."],
16848=>["Value"=>16848,"TextKey"=>"剧情ID1040201","TextValue"=>"<line-height=130%>Good as new! Now, are you excited to go talk to God again, Priest Enda?"],
16849=>["Value"=>16849,"TextKey"=>"剧情ID1040202","TextValue"=>"<line-height=130%>Readier than ever! "],
16850=>["Value"=>16850,"TextKey"=>"剧情ID1040301","TextValue"=>"<line-height=130%>Ok, Chief, as the priest enjoys his reunion with his beloved altar, we can get some work…"],
16851=>["Value"=>16851,"TextKey"=>"剧情ID1040401","TextValue"=>"Ouch, what tripped me? Huh, I see, a piece of <color=#38c0a5>Wild Ore</color> from the <color=#f58c26>Altar</color>. You people are awfully careless when you work."],
16852=>["Value"=>16852,"TextKey"=>"剧情ID1040402","TextValue"=>"<line-height=130%>Ah ha, I know! We need to build a <color=#f58c26>Warehouse</color> to store resources, so that people won't be tripping over materials lying all over the place."],
16853=>["Value"=>16853,"TextKey"=>"剧情ID1050101","TextValue"=>"<line-height=130%>Got everything we need? Then let's get the party started! Sorry, I mean the <color=#f58c26>Warehouse</color>."],
16854=>["Value"=>16854,"TextKey"=>"剧情ID1050201","TextValue"=>"<line-height=130%>Firm wall, nice and big space…Great construction skills, Chief!"],
16855=>["Value"=>16855,"TextKey"=>"剧情ID1050202","TextValue"=>"<line-height=130%>Ah……Sir? There's an eight legged thingy right behind you."],
16856=>["Value"=>16856,"TextKey"=>"剧情ID1050301","TextValue"=>"What?! How?! What is this?! It looks like the body of some kind of water dwelling creature…hmm, and the skin is slimy and stretchy!"],
16857=>["Value"=>16857,"TextKey"=>"剧情ID1050302","TextValue"=>"<line-height=130%><color=#f58c26>Kraken</color>! It's a <color=#f58c26>Kraken</color>! I've read about them in my books! It must be a baby of that monster! Why is there a <color=#f58c26>Kraken</color>?!"],
16858=>["Value"=>16858,"TextKey"=>"剧情ID1050303","TextValue"=>"There's no need to panic. For one it's positively dead, and for two this is just a stranded common <color=#f58c26>Octopus</color>."],
16859=>["Value"=>16859,"TextKey"=>"剧情ID1050304","TextValue"=>"<line-height=130%>Octopus? Never heard of them…"],
16860=>["Value"=>16860,"TextKey"=>"剧情ID1050305","TextValue"=>"That means you people must be from inlands, huh. My people are nomadic. We depend on the sea. Octopuses to us are as common as stars in the night sky."],
16861=>["Value"=>16861,"TextKey"=>"剧情ID1050306","TextValue"=>"Actually, come with me, let's find some ropes and branches. I'll show you how to build a tent with the skin of an octopus."],
16862=>["Value"=>16862,"TextKey"=>"剧情ID1060101","TextValue"=>"<line-height=130%>……and that's…done. It looked much better in my imagination."],
16863=>["Value"=>16863,"TextKey"=>"剧情ID1060102","TextValue"=>"<line-height=130%>It's…uh…...uh…...adorable!"],
16864=>["Value"=>16864,"TextKey"=>"剧情ID1060103","TextValue"=>"Sorry. I'm more of a theory person than a practice one. Construction is not my strong suit. Now…...I might need to lay down……"],
16865=>["Value"=>16865,"TextKey"=>"剧情ID1060104","TextValue"=>"Oh great Amergin! Why don't you go rest in the main tent, and I will be your company! You've imparted your wisdom upon me, and I shall be forever at your service."],
16866=>["Value"=>16866,"TextKey"=>"剧情ID1060201","TextValue"=>"This must be a childhood dream come true for priest. I'm glad to see those two getting along. However, everything seems a little odd, don't you think, chief?"],
16867=>["Value"=>16867,"TextKey"=>"剧情ID1060202","TextValue"=>"The elders said that those who journeyed to the sea had never come back, except for that one who came back as a mad man, talking about a giant barrier made of water at the edge of the world."],
16868=>["Value"=>16868,"TextKey"=>"剧情ID1060203","TextValue"=>"<line-height=130%>Yet that Amergin said they are people of the sea! No people live on the sea!"],
16869=>["Value"=>16869,"TextKey"=>"剧情ID1060204","TextValue"=>"<line-height=130%>That's why this is curious. But anyhow, he's done no harm to us. Let's stick to our jobs at hand for now. "],
16870=>["Value"=>16870,"TextKey"=>"剧情ID1060205","TextValue"=>"<line-height=130%>Now you've explored around, the amount of trophies we found is overwhelming. Some livestock can help carry them home. And for their comfort, we should build them a <color=#f58c26>Livestock Shed</color>."],
16871=>["Value"=>16871,"TextKey"=>"剧情ID1070101","TextValue"=>"<line-height=130%>Looking good, Chief! It looks like these little guys will come in handy right away, fantastic!"],
16872=>["Value"=>16872,"TextKey"=>"剧情ID1070102","TextValue"=>"<line-height=130%>We are almost done with the constructions, though there's one last thing that I need your help with."],
16873=>["Value"=>16873,"TextKey"=>"剧情ID1070103","TextValue"=>"<line-height=130%>In case some ill-intentioned ones come ruin our camp once we've left, we need a professional scouts team to patrol the area and protect our work here."],
16874=>["Value"=>16874,"TextKey"=>"剧情ID1070104","TextValue"=>"<line-height=130%>We'll need a <color=#f58c26>Training Ring</color>!"],
16875=>["Value"=>16875,"TextKey"=>"剧情ID1070105","TextValue"=>"<line-height=130%>That's right Kevin, a <color=#f58c26>Training Ring</color>. Let's go find some materials!"],
16876=>["Value"=>16876,"TextKey"=>"剧情ID1080101","TextValue"=>"<line-height=130%>Are you ready?"],
16877=>["Value"=>16877,"TextKey"=>"剧情ID1080102","TextValue"=>"<line-height=130%>Yes sir!"],
16878=>["Value"=>16878,"TextKey"=>"剧情ID1080103","TextValue"=>"<line-height=130%>Chief has finished preparing the materials, then let's get started!"],
16879=>["Value"=>16879,"TextKey"=>"剧情ID1080104","TextValue"=>"<line-height=130%>Yes sir! No problem sir!"],
16880=>["Value"=>16880,"TextKey"=>"剧情ID1080201","TextValue"=>"<line-height=130%>Great Job! And now we……Priest? What's wrong?"],
16881=>["Value"=>16881,"TextKey"=>"剧情ID1080301","TextValue"=>"I was talking with his Archdruid Amergin, then both of us fell asleep because of exhaustion, and both had this weird dream in which a goddess said to us "Save the <color=#f58c26>Heart of the Sea</color>…...""],
16882=>["Value"=>16882,"TextKey"=>"剧情ID1080302","TextValue"=>"<line-height=130%><color=#f58c26>Heart of the Sea</color>? What's that?"],
16883=>["Value"=>16883,"TextKey"=>"剧情ID1080303","TextValue"=>"We have an old tale about a giant bubble in the sea, protected by the youngest of the Godesses. In it not only ancient animals survived, but giants and fairies still live. But it's simply a bed time story."],
16884=>["Value"=>16884,"TextKey"=>"剧情ID1080304","TextValue"=>"<line-height=130%>I must get to the bottom of this. In order to get a clearer message from the Goddess, I'll need a <color=#f58c26>Powerful Rune Base</color>."],
16885=>["Value"=>16885,"TextKey"=>"剧情ID1080305","TextValue"=>"<line-height=130%>Roger that. Okay, Chief, let's go get some wild ores and build that base for Enda."],
16886=>["Value"=>16886,"TextKey"=>"剧情ID1090101","TextValue"=>"<line-height=130%>We're almost done! We must celebrate!"],
16887=>["Value"=>16887,"TextKey"=>"剧情ID1090102","TextValue"=>"<line-height=130%>Hooray!"],
16888=>["Value"=>16888,"TextKey"=>"剧情ID1090201","TextValue"=>"<line-height=130%>Don't celebrate yet! I can't concentrate when you are this clamorous!"],
16889=>["Value"=>16889,"TextKey"=>"剧情ID1090202","TextValue"=>"<line-height=130%>I was trying to reconnect with god and was ruined by you noisy idiots!"],
16890=>["Value"=>16890,"TextKey"=>"剧情ID1090203","TextValue"=>"<line-height=130%>Shut your mouths and leave me be!"],
16891=>["Value"=>16891,"TextKey"=>"剧情ID1090204","TextValue"=>"<line-height=130%>Ouch, looks like someone is not having a great day."],
16892=>["Value"=>16892,"TextKey"=>"剧情ID1090205","TextValue"=>"<line-height=130%>Wait! Shush! I think I can hear her. This is very important."],
16893=>["Value"=>16893,"TextKey"=>"剧情ID1090206","TextValue"=>"Hmm...I can't hear very clearly…but what I'm guessing is… we should head north, where nothing can grow, and nothing can live. There we'll find a friend."],
16894=>["Value"=>16894,"TextKey"=>"剧情ID1090207","TextValue"=>"<line-height=130%>Okay, sounds…...doable? I mean, what can happen! North it is! "],
16895=>["Value"=>16895,"TextKey"=>"剧情ID1090208","TextValue"=>"But before that, it's finally time to celebrate for our new Camp! Gather around, cauze we are going to have a great party!"],
16896=>["Value"=>16896,"TextKey"=>"剧情ID1090209","TextValue"=>"<line-height=130%>Hooray!"],
16897=>["Value"=>16897,"TextKey"=>"剧情ID1090301","TextValue"=>"We left home thinking that we may never return again, yet we found this incredible island, met new friends, and even found ways to revive tribal members who we thought were forever lost to us."],
16898=>["Value"=>16898,"TextKey"=>"剧情ID1090302","TextValue"=>"For all of this, we have to thank our goddess, who has been looking after us and giving guidance to us, our new friend, dear Amergin, who has been selflessly lending his incredible knowledge to us."],
16899=>["Value"=>16899,"TextKey"=>"剧情ID1090303","TextValue"=>"But most importantly, Chief, we couldn't have accomplished any of this if you didn't stay strong and kind. So thank you Chief, for all you've done for us, and……uh……Priest, are you crying?"],
16900=>["Value"=>16900,"TextKey"=>"剧情ID1090304","TextValue"=>"I'm…I'm not…*sniff* crying……it's just……*sniff* Ok I am! I am crying! Now are you all satisfied?! I love you Chief! You're the best Chief!! "],
16901=>["Value"=>16901,"TextKey"=>"剧情ID1090305","TextValue"=>"Haha, I believe that says it all, Chief. I can't wait to see how our journey forward will be like, and one day, we will definitely resolve the mystery of our home, and rebuild our home."],
16902=>["Value"=>16902,"TextKey"=>"剧情ID2010101","TextValue"=>"<line-height=130%>Don't rush boys, we are almost there……"],
16903=>["Value"=>16903,"TextKey"=>"剧情ID2010102","TextValue"=>"<line-height=130%>God bless! We've been walking in the desert for days, or maybe you can give me some water? "],
16904=>["Value"=>16904,"TextKey"=>"剧情ID2010103","TextValue"=>"<line-height=130%>Have some patience! When I was your age…….Hey, what is this?"],
16905=>["Value"=>16905,"TextKey"=>"剧情ID2010201","TextValue"=>"<line-height=130%>WOAAAAAAH!"],
16906=>["Value"=>16906,"TextKey"=>"剧情ID2010202","TextValue"=>"<line-height=130%>Priest?!"],
16907=>["Value"=>16907,"TextKey"=>"剧情ID2010203","TextValue"=>"<line-height=130%>Oh no, are you down there my priest? Are you ok?"],
16908=>["Value"=>16908,"TextKey"=>"剧情ID2010204","TextValue"=>"<line-height=130%>Well……I'm still alive……Hmm, I think I was dragged down by this…..magical mine?"],
16909=>["Value"=>16909,"TextKey"=>"剧情ID2010205","TextValue"=>"<line-height=130%>Oh thank God you are fine, don't worry, we will do everything we can to get you out of there as soon as possible."],
16910=>["Value"=>16910,"TextKey"=>"剧情ID2010301","TextValue"=>"<line-height=130%>Chief, I found an abandoned building on a hill-top nearby. I could see a big straw rope machine inside, but it's surrounded in a hideous mess."],
16911=>["Value"=>16911,"TextKey"=>"剧情ID2010302","TextValue"=>"<line-height=130%>I'm guessing it's an <color=#f58c26>Old Workshop</color> of some sort."],
16912=>["Value"=>16912,"TextKey"=>"剧情ID2010303","TextValue"=>"<line-height=130%>We can try to open its door and clean it up so that we can make a rope pulley and pull the priest out."],
16913=>["Value"=>16913,"TextKey"=>"剧情ID2010304","TextValue"=>"<line-height=130%>Well stop chitchating and go make that pulley thing!"],
16914=>["Value"=>16914,"TextKey"=>"剧情ID2010305","TextValue"=>"Calm down priest! The sky is turning dark, soon it'll be freezing out here! So we need to find materials to build a <color=#f58c26>Tent</color> first, and try to figure this out after everyone's got some rest."],
16915=>["Value"=>16915,"TextKey"=>"剧情ID2010306","TextValue"=>"<line-height=130%>But what about me?! I might freeze to death!"],
16916=>["Value"=>16916,"TextKey"=>"剧情ID2010307","TextValue"=>"<line-height=130%>Don't worry, although the temperature difference above the ground between day and night is huge, the temprature underground is always steady and pleasant. You hang in there priest! "],
16917=>["Value"=>16917,"TextKey"=>"剧情ID2020101","TextValue"=>"The next day……"],
16918=>["Value"=>16918,"TextKey"=>"剧情ID2020201","TextValue"=>"<line-height=130%>That was a good night sleep! How are you doing down there, my priest?"],
16919=>["Value"=>16919,"TextKey"=>"剧情ID2020202","TextValue"=>"<line-height=130%>I would apprecite it if you spend your energy on getting me out of here instead of asking how I'm doing!"],
16920=>["Value"=>16920,"TextKey"=>"剧情ID2020203","TextValue"=>"<line-height=130%>We're working on it, I just need some necessary tools to break open that door before proceeding. Please stay calm. *Smiles*"],
16921=>["Value"=>16921,"TextKey"=>"剧情ID2020204","TextValue"=>"<line-height=130%>You wait for me to get back up…You irrespectful ungrateful little brat…"],
16922=>["Value"=>16922,"TextKey"=>"剧情ID2020205","TextValue"=>"<line-height=130%>Ouch, my feelings are very hurt! How come you misinterpreted my good heart like that! But I forgive you. Chief and I will be back right away!"],
16923=>["Value"=>16923,"TextKey"=>"剧情ID2030201","TextValue"=>"Ok, we are in! Now we just need to……"],
16924=>["Value"=>16924,"TextKey"=>"剧情ID2030202","TextValue"=>"Sir, watch out! Behind you!"],
16925=>["Value"=>16925,"TextKey"=>"剧情ID2030203","TextValue"=>"Ouch! Where did this arrow come from?!"],
16926=>["Value"=>16926,"TextKey"=>"剧情ID2030204","TextValue"=>"Step out of the building!"],
16927=>["Value"=>16927,"TextKey"=>"剧情ID2030205","TextValue"=>"Who's there?"],
16928=>["Value"=>16928,"TextKey"=>"剧情ID2030206","TextValue"=>"Get out! You kidnapper!"],
16929=>["Value"=>16929,"TextKey"=>"剧情ID2030207","TextValue"=>"Kidnapper? I think you've got the wrong people, voice lady…Ouch, ouch, ouch!"],
16930=>["Value"=>16930,"TextKey"=>"剧情ID2030301","TextValue"=>"Voice lady, we are out of the building, now will you explain to me what's happening?"],
16931=>["Value"=>16931,"TextKey"=>"剧情ID2030302","TextValue"=>"Firstly, my name's not Voice Lady, I'm Tlachtga, hunter of lightening, daughter of Mug Ruith, mother to all land, heroine for……"],
16932=>["Value"=>16932,"TextKey"=>"剧情ID2030303","TextValue"=>"<size=100%>Great Tlachtga!!!!!!!!!!!"],
16933=>["Value"=>16933,"TextKey"=>"剧情ID2030304","TextValue"=>"Wha……Where did this voice……from the foot of the hill? Someone fell into that mine?"],
16934=>["Value"=>16934,"TextKey"=>"剧情ID2030305","TextValue"=>"You three, stay perfectly still until I come back. If I find out you've moved a single inch, you know what's gonna happen."],
16935=>["Value"=>16935,"TextKey"=>"剧情ID2030306","TextValue"=>"Yes, Ma'am, not an inch!"],
16936=>["Value"=>16936,"TextKey"=>"剧情ID2030401","TextValue"=>"There you are. A priest? What are you doing down there? I broke open the entrance to this mine while I was searching for someone, how come you are in it?"],
16937=>["Value"=>16937,"TextKey"=>"剧情ID2030402","TextValue"=>"Long story short, I was with the three boys that you'd caught over there, but I fell into this mine. But that's not important. You are here! I foretold that we will meet a friend who can help us on this barren land, I can't believe it's you!"],
16938=>["Value"=>16938,"TextKey"=>"剧情ID2030403","TextValue"=>"<line-height=130%>Friend? Help you? For what? You are…not kidnappers?"],
16939=>["Value"=>16939,"TextKey"=>"剧情ID2030404","TextValue"=>"<line-height=130%>Kidnappers? No no no, we're just passers by, on a quest to find helpers to save our home! *Explains*"],
16940=>["Value"=>16940,"TextKey"=>"剧情ID2030405","TextValue"=>"Huh. Now that you've said it, Mom did say about meeting a group of people like you…but then she disappeared…So that means I did get the wrong people."],
16941=>["Value"=>16941,"TextKey"=>"剧情ID2030406","TextValue"=>"<line-height=130%>Mom?"],
16942=>["Value"=>16942,"TextKey"=>"剧情ID2030407","TextValue"=>"Forget about that, not a big deal. I'm guessing your boys got into that trap of mine trying to get that rope machine going, so that they can fish you out?"],
16943=>["Value"=>16943,"TextKey"=>"剧情ID2030408","TextValue"=>"<line-height=130%>Yes wise ma'am, that's exactly why, and how I ended up looking like this, single-footed."],
16944=>["Value"=>16944,"TextKey"=>"剧情ID2030409","TextValue"=>"Oh dear, my fault, I'll help you with your wound later. Right now let me remove my traps and fix that rope machine for you…"],
16945=>["Value"=>16945,"TextKey"=>"剧情ID2030501","TextValue"=>"<line-height=130%>The straw rope machine is up and running, great job, ma'am!"],
16946=>["Value"=>16946,"TextKey"=>"剧情ID2030592","TextValue"=>"<line-height=130%>Not great at all! Pull me up! Right now, immediately!"],
16947=>["Value"=>16947,"TextKey"=>"剧情ID2030683","TextValue"=>"<line-height=130%>There's only one step left. We only need to prepare the straw rope and the pulley before we can fish you out."],
16948=>["Value"=>16948,"TextKey"=>"剧情ID2030774","TextValue"=>"<line-height=130%>I feel you are targeting me……*Tears Up*"],
16949=>["Value"=>16949,"TextKey"=>"剧情ID2040101","TextValue"=>"<line-height=130%>My chief, you've already finished collecting the materials? It's okay to take your time, 'cauze since Enda is not here, we can finally have some peace here……"],
16950=>["Value"=>16950,"TextKey"=>"剧情ID2040102","TextValue"=>"<line-height=130%>I can still hear you! It's not okay!"],
16951=>["Value"=>16951,"TextKey"=>"剧情ID2040103","TextValue"=>"<line-height=130%>Woops! Didn't know she could hear……Aha, the pulley's ready!"],
16952=>["Value"=>16952,"TextKey"=>"剧情ID2040201","TextValue"=>"<line-height=130%>Dear priest, the rescue team is down, please make yourself visible so that you won't be stepped on……"],
16953=>["Value"=>16953,"TextKey"=>"剧情ID2040202","TextValue"=>"<line-height=130%>You are standing on top of me! Get off me! "],
16954=>["Value"=>16954,"TextKey"=>"剧情ID2040203","TextValue"=>"<line-height=130%>It looks like the priest will be up soon, thank you very much, ma'am."],
16955=>["Value"=>16955,"TextKey"=>"剧情ID2040204","TextValue"=>"<line-height=130%>Don't ma'am me, name's Tlachtga. Now, let me see, where did I get you just now?"],
16956=>["Value"=>16956,"TextKey"=>"剧情ID2040205","TextValue"=>"<line-height=130%>You got me on the shin, ma'am, no, Tlachtga."],
16957=>["Value"=>16957,"TextKey"=>"剧情ID2040206","TextValue"=>"<line-height=130%>Gotcha. Hunters like me are professionals at tending wounds. I've got a bag of Succulent Leaves down there in the mine. I used it as a storage. Let's grow some of them and rub that juice on your cute little leg!"],
16958=>["Value"=>16958,"TextKey"=>"剧情ID2040207","TextValue"=>"<line-height=130%>Uh…little leg…okay. So we should head down there now? "],
16959=>["Value"=>16959,"TextKey"=>"剧情ID2040208","TextValue"=>"No no no, you little weaklings will need torches to see down there. It's much deeper than you think. Go find some torches and excavation tools!"],
16960=>["Value"=>16960,"TextKey"=>"剧情ID2050101","TextValue"=>"<line-height=130%>Hold this, if the fire goes out, stop and turn back, ok?"],
16961=>["Value"=>16961,"TextKey"=>"剧情ID2050102","TextValue"=>"<line-height=130%>Ready? Let's go! Watch your steps!"],
16962=>["Value"=>16962,"TextKey"=>"剧情ID2050103","TextValue"=>"<line-height=130%>Yes Ma'am!"],
16963=>["Value"=>16963,"TextKey"=>"剧情ID2050104","TextValue"=>"Chief, thank you for staying up here with Priest and I. I'm quite sad I don't get to go, but Tlachtga said I'd better stay up here if I don't want to lose my leg. can't wait what they can bring to us though!"],
16964=>["Value"=>16964,"TextKey"=>"剧情ID2050105","TextValue"=>"<line-height=130%>I can't believe the Great Tlachtga just let you call her by name. What an honor! And you do not show a bit of gratitude…"],
16965=>["Value"=>16965,"TextKey"=>"剧情ID2050201","TextValue"=>"<line-height=130%>Oh my lord what is that?"],
16966=>["Value"=>16966,"TextKey"=>"剧情ID2050202","TextValue"=>"<line-height=130%>It's an underground river! I can't believe our team found an <color=#f58c26>Underground River</color>! Now we have water!"],
16967=>["Value"=>16967,"TextKey"=>"剧情ID2050203","TextValue"=>"<line-height=130%>And soaked."],
16968=>["Value"=>16968,"TextKey"=>"剧情ID2050204","TextValue"=>"<line-height=130%>Well toughen up you wimp! It's just a bit of water! "],
16969=>["Value"=>16969,"TextKey"=>"剧情ID2050205","TextValue"=>"Hey you, Chief, now you've got water, we can grow some succulents! A succulent's leaf plus some chanting and proper care, you'll get a plump succulent in no time!"],
16970=>["Value"=>16970,"TextKey"=>"剧情ID2050206","TextValue"=>"<line-height=130%>These ladies are all yours, go have them look for some buckets, shovels and fertilizer. I'm gonna wait right here."],
16971=>["Value"=>16971,"TextKey"=>"剧情ID2060101","TextValue"=>"<line-height=130%>Alright! Done, look how cute it is! Take a piece, a big one."],
16972=>["Value"=>16972,"TextKey"=>"剧情ID2060102","TextValue"=>"<line-height=130%>I've never seen this type of plant before……What? Take a piece you say?"],
16973=>["Value"=>16973,"TextKey"=>"剧情ID2060103","TextValue"=>"<line-height=130%>Yes take a leaf, squeeze its juice out, rub it on your wounded skin."],
16974=>["Value"=>16974,"TextKey"=>"剧情ID2060104","TextValue"=>"<line-height=130%>Okay……Take a piece……Rub……Wow, it actually worked! I've never heard about any herbs that can heal wounds this fast!"],
16975=>["Value"=>16975,"TextKey"=>"剧情ID2060105","TextValue"=>"People call me mother to all land, just saying. I assume the name comes from my extremely impressive Green Thumb. These are not regular succulents. I bred them my self."],
16976=>["Value"=>16976,"TextKey"=>"剧情ID2060106","TextValue"=>"<line-height=130%>Miracle worker! Ah! Now I feel that we can solve the mystery of our home in no time! "],
16977=>["Value"=>16977,"TextKey"=>"剧情ID2060107","TextValue"=>"Actually, about that, I really need to take a nap now that my energy's drained. Mind if I go take a nap at that "Home" of yours? Is it a Base Camp? You've got a bed?"],
16978=>["Value"=>16978,"TextKey"=>"剧情ID2060108","TextValue"=>"Yes, it is like a Base Camp of sorts, and here's the map we've made to go back. But…...are you planning on just having a sleepover or are you joining us?"],
16979=>["Value"=>16979,"TextKey"=>"剧情ID2060109","TextValue"=>"<line-height=130%>Of course is joining you! Are you stupid?! You need help, I'm not doing anything, why not? We are probably after the same person anyway. So! I'll take that map, see ya!"],
16980=>["Value"=>16980,"TextKey"=>"剧情ID2060201","TextValue"=>"And off she goes. I have a feeling she'll be a great friend to our people. Let's finish building our Camp then. Just like our former Camp, we need a <color=#f58c26>Warehouse</color> to store the materials."],
16981=>["Value"=>16981,"TextKey"=>"剧情ID2060202","TextValue"=>"<line-height=130%>Let's go gather some materials for the <color=#f58c26>Warehouse</color>!"],
16982=>["Value"=>16982,"TextKey"=>"剧情ID2070101","TextValue"=>"<line-height=130%>Great job! "],
16983=>["Value"=>16983,"TextKey"=>"剧情ID2070102","TextValue"=>"<line-height=130%>You haven't thanked me for leading you to water yet! Told you I was right about this place!"],
16984=>["Value"=>16984,"TextKey"=>"剧情ID2070103","TextValue"=>"<line-height=130%>Alright, alright. I'll fully respect your divination in the future and satisfy every single one of your unreasonable requests. Now what do you need next?"],
16985=>["Value"=>16985,"TextKey"=>"剧情ID2070104","TextValue"=>"<line-height=130%>You…! Nevermind. I need to talk to God again to know where we should go next. This time I need a <color=#f58c26>Watchtower</color> to try out Astrology. "],
16986=>["Value"=>16986,"TextKey"=>"剧情ID2070105","TextValue"=>"<line-height=130%>Why Astrology? We are not even sure what those stars are, I mean, they are just shining spots on the sky!"],
16987=>["Value"=>16987,"TextKey"=>"剧情ID2070106","TextValue"=>"<line-height=130%>We have no time left! We have tons of work to do! Stop with your stupid nonsense!"],
16988=>["Value"=>16988,"TextKey"=>"剧情ID2070107","TextValue"=>"<line-height=130%>Go gather the stuff we need and be back as soon as possible!"],
16989=>["Value"=>16989,"TextKey"=>"剧情ID2070108","TextValue"=>"<line-height=130%>Alright then…"],
16990=>["Value"=>16990,"TextKey"=>"剧情ID2070201","TextValue"=>"<line-height=130%>Adults told me not to mess with the elders, why did I never listen……"],
16991=>["Value"=>16991,"TextKey"=>"剧情ID2080101","TextValue"=>"<line-height=130%>Ok my chief, you have finished your work, and the only thing left is the <color=#f58c26>Watchtower</color> that the priest asked me to build……"],
16992=>["Value"=>16992,"TextKey"=>"剧情ID2080102","TextValue"=>"<line-height=130%>I can hear you you punk! Stop complaining and do your job!"],
16993=>["Value"=>16993,"TextKey"=>"剧情ID2080103","TextValue"=>"<line-height=130%>Ok~ok~*Sighs*"],
16994=>["Value"=>16994,"TextKey"=>"剧情ID2080201","TextValue"=>"<line-height=130%>Ok my chief, I'm gonna go talk to the gods."],
16995=>["Value"=>16995,"TextKey"=>"剧情ID2080202","TextValue"=>"<line-height=130%>You can chill for a sec, see you in a bit."],
16996=>["Value"=>16996,"TextKey"=>"剧情ID2080203","TextValue"=>"<line-height=130%>*Whispers* Over here, chief, over here……"],
16997=>["Value"=>16997,"TextKey"=>"剧情ID2080204","TextValue"=>"<line-height=130%>Enda can finally stop for a moment."],
16998=>["Value"=>16998,"TextKey"=>"剧情ID2080205","TextValue"=>"<line-height=130%>Our team found a pile of gold and wile ores down there in the mine."],
16999=>["Value"=>16999,"TextKey"=>"剧情ID2080206","TextValue"=>"<line-height=130%>We are thinking of making a chest to transport them up here, so we are here seeking for your help."],
17000=>["Value"=>17000,"TextKey"=>"剧情ID2080207","TextValue"=>"<line-height=130%>Do you mind collecting some materials for making that chest?"],
17001=>["Value"=>17001,"TextKey"=>"剧情ID2090101","TextValue"=>"<line-height=130%>Woof, that was a lot of gold. "],
17002=>["Value"=>17002,"TextKey"=>"剧情ID2090102","TextValue"=>"<line-height=130%>What is this? It's glowing…"],
17003=>["Value"=>17003,"TextKey"=>"剧情ID2090201","TextValue"=>"<line-height=130%>It's a little package…it says "eat me." And inside of it, a <color=#f58c26>Glowing Seed</color>? Does it mean, like, eat the seed?"],
17004=>["Value"=>17004,"TextKey"=>"剧情ID2090202","TextValue"=>"<line-height=130%>Leave that to me!"],
17005=>["Value"=>17005,"TextKey"=>"剧情ID2090203","TextValue"=>"<line-height=130%>What?! Priest, what are you doing?!"],
17006=>["Value"=>17006,"TextKey"=>"剧情ID2090301","TextValue"=>"<line-height=130%>Did you just eat it?! We haven't figured out what it is yet!"],
17007=>["Value"=>17007,"TextKey"=>"剧情ID2090302","TextValue"=>"The pattern of stars aligned to point at the <color=#f58c26>Great Canyan</color> to the <color=#f58c26>Southeast</color>, and the <color=#f58c26>sedative seed</color> will help me meet the Great…*snores*"],
17008=>["Value"=>17008,"TextKey"=>"剧情ID2090303","TextValue"=>"<line-height=130%>Priest? Priest? Are you still there?"],
17009=>["Value"=>17009,"TextKey"=>"剧情ID2090304","TextValue"=>"<line-height=130%>*Snores*"],
17010=>["Value"=>17010,"TextKey"=>"剧情ID2090305","TextValue"=>"<line-height=130%>And she fell asleep. I can't quite get these people with mysterious powers. They seem so odd at times. "],
17011=>["Value"=>17011,"TextKey"=>"剧情ID2090306","TextValue"=>"<line-height=130%>Urrrh, where should we go next then now that priest has passed out?"],
17012=>["Value"=>17012,"TextKey"=>"剧情ID2090307","TextValue"=>"<line-height=130%>She said the <color=#f58c26>Great Canyon</color> right? To the <color=#f58c26>Southest</color>?"],
17013=>["Value"=>17013,"TextKey"=>"剧情ID2090308","TextValue"=>"<line-height=130%>Should we trust her? She seems a little…not herself at the moment?"],
17014=>["Value"=>17014,"TextKey"=>"剧情ID2090309","TextValue"=>"Yes, I promised I'll trust her in the future. Besides, where can we go next anyway? Let's rest for today, and head Southeast tomorrow."],
17015=>["Value"=>17015,"TextKey"=>"剧情ID3010101","TextValue"=>"<line-height=130%>Hey you!"],
17016=>["Value"=>17016,"TextKey"=>"剧情ID3010102","TextValue"=>"Me?"],
17017=>["Value"=>17017,"TextKey"=>"剧情ID3010103","TextValue"=>"Yes! You. Do you mind lending an old lady a hand?"],
17018=>["Value"=>17018,"TextKey"=>"剧情ID3010104","TextValue"=>"Err…I'm not really here."],
17019=>["Value"=>17019,"TextKey"=>"剧情ID3010105","TextValue"=>"Huh, and why is that?"],
17020=>["Value"=>17020,"TextKey"=>"剧情ID3010106","TextValue"=>"I'm with the people of my tribe right now. We are on a journey in search for heroes who can help us solve the mystery of our home."],
17021=>["Value"=>17021,"TextKey"=>"剧情ID3010107","TextValue"=>"I see. I'm actually talking to your soul, through that little glowing block in your hand?"],
17022=>["Value"=>17022,"TextKey"=>"剧情ID3010108","TextValue"=>"My……<color=#f58c26>phone</color>?"],
17023=>["Value"=>17023,"TextKey"=>"剧情ID3010109","TextValue"=>"Yes exactly. The <color=#f58c26>"my phone"</color>. Would you help me?"],
17024=>["Value"=>17024,"TextKey"=>"剧情ID3010110","TextValue"=>"Wait……Why can you *smell* me?"],
17025=>["Value"=>17025,"TextKey"=>"剧情ID3010111","TextValue"=>"Oh sweetie although I have one blind eye, I can still sense everything. You'll understand later. Now, would you help me?"],
17026=>["Value"=>17026,"TextKey"=>"剧情ID3010112","TextValue"=>"Ok. What do you need?"],
17027=>["Value"=>17027,"TextKey"=>"剧情ID3010113","TextValue"=>"Your tribe is gonna pass by right? I pretend I'm in desperate need of food, and prop up a <color=#f58c26>Tiny Booth</color> to sell my trash? OMG, marvelous plan!"],
17028=>["Value"=>17028,"TextKey"=>"剧情ID3010114","TextValue"=>"I don't get it……"],
17029=>["Value"=>17029,"TextKey"=>"剧情ID3010115","TextValue"=>"I don't wanna help some random rude people, right? You gotta be nice to get my help."],
17030=>["Value"=>17030,"TextKey"=>"剧情ID3010116","TextValue"=>"So?"],
17031=>["Value"=>17031,"TextKey"=>"剧情ID3010117","TextValue"=>"If they buy my stuff and give me food, they are OK. Or give me food directly, even better!"],
17032=>["Value"=>17032,"TextKey"=>"剧情ID3010118","TextValue"=>"Otherwise? A finger snap and your tribe will be no more. Got it? So go gather some materials for me!"],
17033=>["Value"=>17033,"TextKey"=>"剧情ID3020101","TextValue"=>"Amazing! Thank y'all so much! "],
17034=>["Value"=>17034,"TextKey"=>"剧情ID3020102","TextValue"=>"I hope my daughter is as reliable and efficient as you. "],
17035=>["Value"=>17035,"TextKey"=>"剧情ID3020103","TextValue"=>"We got separated earlier in the desert, and I got lost…...My sense of direction is not that great. "],
17036=>["Value"=>17036,"TextKey"=>"剧情ID3020104","TextValue"=>"Do you know where she is now?"],
17037=>["Value"=>17037,"TextKey"=>"剧情ID3020105","TextValue"=>"Of course I know where she is! But she can't just…not look for me! "],
17038=>["Value"=>17038,"TextKey"=>"剧情ID3020201","TextValue"=>"This feels nice. You know? Just you and me, chilling, having a little chat, spilling some tea…"],
17039=>["Value"=>17039,"TextKey"=>"剧情ID3020301","TextValue"=>"They are coming. We just need to wait."],
17040=>["Value"=>17040,"TextKey"=>"剧情ID3020302","TextValue"=>"……"],
17041=>["Value"=>17041,"TextKey"=>"剧情ID3020303","TextValue"=>"A long time has passed."],
17042=>["Value"=>17042,"TextKey"=>"剧情ID3020304","TextValue"=>"I'm gonna go climb on those bones and check where they are."],
17043=>["Value"=>17043,"TextKey"=>"剧情ID3020401","TextValue"=>"Ha! They are totally there! That little priests of yours is unresistably cute!"],
17044=>["Value"=>17044,"TextKey"=>"剧情ID3020402","TextValue"=>"Alright they will be here in no time. I can't wait to meet your people! I just need to come down carefully……"],
17045=>["Value"=>17045,"TextKey"=>"剧情ID3020501","TextValue"=>"Are you alright?"],
17046=>["Value"=>17046,"TextKey"=>"剧情ID3020502","TextValue"=>"Hello?"],
17047=>["Value"=>17047,"TextKey"=>"剧情ID3020601","TextValue"=>"A moment later"],
17048=>["Value"=>17048,"TextKey"=>"剧情ID3020701","TextValue"=>""Starving, please buy things, give food please." Huh. Looks like someone started a little business here."],
17049=>["Value"=>17049,"TextKey"=>"剧情ID3020702","TextValue"=>"Ah Chief, here you are. Priest Enda said someone from her dream is waiting here for us. "],
17050=>["Value"=>17050,"TextKey"=>"剧情ID3020703","TextValue"=>"I see some traces of human activity here, but this campfire went out, this tiny booth is about to break down, and I see no one around…We got stood up?"],
17051=>["Value"=>17051,"TextKey"=>"剧情ID3020704","TextValue"=>"Anyway, let's build a Camp and spend the night here, and wait for that "dream person" to show up."],
17052=>["Value"=>17052,"TextKey"=>"剧情ID3020801","TextValue"=>"I'm so burnt out…finally…this cloak is an oven! I'm getting roasted! Take it off!!"],
17053=>["Value"=>17053,"TextKey"=>"剧情ID3020802","TextValue"=>"Dear priest, you were sleeping tightly on a camel's back just now. You don't get to say "burnt out.""],
17054=>["Value"=>17054,"TextKey"=>"剧情ID3020803","TextValue"=>"By the way, you can't take your cloak off either. Even it's as hot as hades right now, it's still freezing at night."],
17055=>["Value"=>17055,"TextKey"=>"剧情ID3020804","TextValue"=>"Dear God…why ask me to come to this desolate place…and having to put up with this arrogant young guy too…"],
17056=>["Value"=>17056,"TextKey"=>"剧情ID3020805","TextValue"=>"Please be a little more patient. Chief will gather the materials we need to build a <color=#f58c26>Tent</color> here."],
17057=>["Value"=>17057,"TextKey"=>"剧情ID3030101","TextValue"=>"Well done Chief! Let's get started!"],
17058=>["Value"=>17058,"TextKey"=>"剧情ID3030201","TextValue"=>"Great! I believe people are all hungry by now. Let's make full use of this campfire and cook something. Eat well work well!"],
17059=>["Value"=>17059,"TextKey"=>"剧情ID3030202","TextValue"=>"Hooray! Food! Bacon!"],
17060=>["Value"=>17060,"TextKey"=>"剧情ID3030203","TextValue"=>"Lamb chop for me please…"],
17061=>["Value"=>17061,"TextKey"=>"剧情ID3030204","TextValue"=>"You savage carnivores!"],
17062=>["Value"=>17062,"TextKey"=>"剧情ID3030205","TextValue"=>"So what do you want?"],
17063=>["Value"=>17063,"TextKey"=>"剧情ID3030206","TextValue"=>"Steak, medium with horseradish sauce please."],
17064=>["Value"=>17064,"TextKey"=>"剧情ID3030207","TextValue"=>"Priest, that's also…"],
17065=>["Value"=>17065,"TextKey"=>"剧情ID3030208","TextValue"=>"I know! Shush!"],
17066=>["Value"=>17066,"TextKey"=>"剧情ID3030209","TextValue"=>"Haha, protein is very important to a traveling body. It's been a tough ride, so let's feast! What do you say, Chief?"],
17067=>["Value"=>17067,"TextKey"=>"剧情ID3030210","TextValue"=>"We don't have that much materials to cook with…"],
17068=>["Value"=>17068,"TextKey"=>"剧情ID3030211","TextValue"=>"We have mutton, dried beef and apples, Chief!"],
17069=>["Value"=>17069,"TextKey"=>"剧情ID3030212","TextValue"=>"But Chief is right, we still want to save some of them for tougher nights later. So we need to find some alternative proteins."],
17070=>["Value"=>17070,"TextKey"=>"剧情ID3030213","TextValue"=>"I caught sight on some desert lizards. Lizard eggs and themselves would be great sources of proteins!"],
17071=>["Value"=>17071,"TextKey"=>"剧情ID3030214","TextValue"=>"What did you say?! Lizards?! How can we eat lizards?!"],
17072=>["Value"=>17072,"TextKey"=>"剧情ID3030215","TextValue"=>"There are all kinds of delicacy we can create if we open our minds! For example, "lizard stew" sounds particularly appealing!"],
17073=>["Value"=>17073,"TextKey"=>"剧情ID3030216","TextValue"=>"I can't wait!"],
17074=>["Value"=>17074,"TextKey"=>"剧情ID3030217","TextValue"=>"Oh…...lizard hunting…..."],
17075=>["Value"=>17075,"TextKey"=>"剧情ID3040101","TextValue"=>"Amazing! You've collected all the materials! Let's get moving!"],
17076=>["Value"=>17076,"TextKey"=>"剧情ID3040102","TextValue"=>"Coming! Light up the campfire!"],
17077=>["Value"=>17077,"TextKey"=>"剧情ID3040201","TextValue"=>"Finally…Food…I can't move any more…Sunny side-up…Steak…Baked Apple…"],
17078=>["Value"=>17078,"TextKey"=>"剧情ID3040202","TextValue"=>"Mutton chop for Arlan, sunny-side up for Kevin…And Priest Enda will be sharing this bowl of delicious lizard stew with me…"],
17079=>["Value"=>17079,"TextKey"=>"剧情ID3040301","TextValue"=>"No one is sharing lizard stew!"],
17080=>["Value"=>17080,"TextKey"=>"剧情ID3040302","TextValue"=>"In that case, I will give this bowl of warm, steaming, yummy stew to our new friends."],
17081=>["Value"=>17081,"TextKey"=>"剧情ID3040303","TextValue"=>"New friends? What new friends?"],
17082=>["Value"=>17082,"TextKey"=>"剧情ID3040401","TextValue"=>"Ah!!! Noooo!!!! Get these rats off me!!!!"],
17083=>["Value"=>17083,"TextKey"=>"剧情ID3040402","TextValue"=>"They are too big to be rats. According to my observation, these are Maubbits, a kind of rodents unique to arid regions."],
17084=>["Value"=>17084,"TextKey"=>"剧情ID3040403","TextValue"=>"They are usually surprisingly timid considering their impressive size, making them completely harmless towards human beings."],
17085=>["Value"=>17085,"TextKey"=>"剧情ID3040404","TextValue"=>"Ok ok I know!!! I don't care what they are! Get them off of me!!"],
17086=>["Value"=>17086,"TextKey"=>"剧情ID3040405","TextValue"=>"Now that you've mentioned it, it's quite strange that they are not afraid of you at all……"],
17087=>["Value"=>17087,"TextKey"=>"剧情ID3040406","TextValue"=>"Dear workers, would you be so kind and remove these lovely creatures from our priest?"],
17088=>["Value"=>17088,"TextKey"=>"剧情ID3040407","TextValue"=>"Aye!"],
17089=>["Value"=>17089,"TextKey"=>"剧情ID3040501","TextValue"=>"Hey! Give it back!"],
17090=>["Value"=>17090,"TextKey"=>"剧情ID3040502","TextValue"=>"Hmm, and off they go. It seems they are still afraid of everyone but the priest."],
17091=>["Value"=>17091,"TextKey"=>"剧情ID3040503","TextValue"=>"They took my ring! My beloved ring…"],
17092=>["Value"=>17092,"TextKey"=>"剧情ID3040504","TextValue"=>"Poor priest, I guess we can follow their steps into the dragon remains? I'm quite curious about those little guys anyway. "],
17093=>["Value"=>17093,"TextKey"=>"剧情ID3040505","TextValue"=>"And to do that, we need a <color=#f58c26>Windmill</color> to help us transport people up and down considering how steep that mountain is."],
17094=>["Value"=>17094,"TextKey"=>"剧情ID3050101","TextValue"=>"Are we all set with the materials of the <color=#f58c26>Windmill</color> already?! Impressive!"],
17095=>["Value"=>17095,"TextKey"=>"剧情ID3050102","TextValue"=>"Fresh Windmill coming right up!"],
17096=>["Value"=>17096,"TextKey"=>"剧情ID3050201","TextValue"=>"Sweet! Now it's much safer and convenient going up and down the slope!"],
17097=>["Value"=>17097,"TextKey"=>"剧情ID3050202","TextValue"=>"Great! Hurry and bring my ring back! That thing is sacred!"],
17098=>["Value"=>17098,"TextKey"=>"剧情ID3050203","TextValue"=>"Ok ok we are going! Kevin, Arlan, are you ready?"],
17099=>["Value"=>17099,"TextKey"=>"剧情ID3050204","TextValue"=>"As always!"],
17100=>["Value"=>17100,"TextKey"=>"剧情ID3050205","TextValue"=>"Uh……sir……not that I'm a coward, but I think we still need ropes just in case we fall from the cliff……"],
17101=>["Value"=>17101,"TextKey"=>"剧情ID3050206","TextValue"=>"Aha, you're absolutely right! Work safety is important! So Chief, go get some safety equipment!"],
17102=>["Value"=>17102,"TextKey"=>"剧情ID3060101","TextValue"=>"Are we ready now?"],
17103=>["Value"=>17103,"TextKey"=>"剧情ID3060102","TextValue"=>"Yes!"],
17104=>["Value"=>17104,"TextKey"=>"剧情ID3060103","TextValue"=>"Beautiful! Let's go solve the mystery of Maubbits right now! How exciting!"],
17105=>["Value"=>17105,"TextKey"=>"剧情ID3060104","TextValue"=>"And get my ring back!"],
17106=>["Value"=>17106,"TextKey"=>"剧情ID3060201","TextValue"=>"Wow, this is a really deep bone pile! Wait…there's a sparkling thing at the bottom…Hmm…Can it be Enda's ring?"],
17107=>["Value"=>17107,"TextKey"=>"剧情ID3060202","TextValue"=>"Chief! Look what we found! An old woman covered in dirt!"],
17108=>["Value"=>17108,"TextKey"=>"剧情ID3060203","TextValue"=>"And Priest's ring."],
17109=>["Value"=>17109,"TextKey"=>"剧情ID3060301","TextValue"=>"*Tears Up* Thank you, Arlan, the most sensible of us all…...Wait……what?"],
17110=>["Value"=>17110,"TextKey"=>"剧情ID3060401","TextValue"=>"*Exciting Noises*"],
17111=>["Value"=>17111,"TextKey"=>"剧情ID3060402","TextValue"=>"I guess……thank you?"],
17112=>["Value"=>17112,"TextKey"=>"剧情ID3060403","TextValue"=>"*Happy Noises*"],
17113=>["Value"=>17113,"TextKey"=>"剧情ID3060501","TextValue"=>"*Exciting Noises*"],
17114=>["Value"=>17114,"TextKey"=>"剧情ID3060502","TextValue"=>"Oh, hi! Hello! You are so welcoming! Do I know you? Your fur feels rather familiar…"],
17115=>["Value"=>17115,"TextKey"=>"剧情ID3060503","TextValue"=>"Oh! And you must be that little priest in my dream! You are even cuter in real life!"],
17116=>["Value"=>17116,"TextKey"=>"剧情ID3060504","TextValue"=>"Little? How dare you call me little?! I'm the noble messenger of God…"],
17117=>["Value"=>17117,"TextKey"=>"剧情ID3060505","TextValue"=>"Sorry, you said you dreamed of our priest?"],
17118=>["Value"=>17118,"TextKey"=>"剧情ID3060506","TextValue"=>"Oh~ Young man! Yes! I dreamed of telling your little priest: "I'll be waiting for you." But I don't know what that means at all!"],
17119=>["Value"=>17119,"TextKey"=>"剧情ID3060507","TextValue"=>"What do you mean by you don't know what that means?!"],
17120=>["Value"=>17120,"TextKey"=>"剧情ID3060508","TextValue"=>"Actually, this is funny. I don't remember my name at all, so I don't know what that strange dream means. "],
17121=>["Value"=>17121,"TextKey"=>"剧情ID3060509","TextValue"=>"I must have knocked my head pretty hard while I fell into the pit. I'm still a little wobbly when I walk. "],
17122=>["Value"=>17122,"TextKey"=>"剧情ID3060510","TextValue"=>"Is this little booth over here yours? It says "Starving, please buy my stuff, give food please?""],
17123=>["Value"=>17123,"TextKey"=>"剧情ID3060511","TextValue"=>"Given that what's written on this booth accurately describes me, and that we are in the middle of a desert, yes, I guess it's mine."],
17124=>["Value"=>17124,"TextKey"=>"剧情ID3060512","TextValue"=>"Oh! No worries! We've got food. Please enjoy them in our tent."],
17125=>["Value"=>17125,"TextKey"=>"剧情ID3060513","TextValue"=>"That would be amazing!"],
17126=>["Value"=>17126,"TextKey"=>"剧情ID3060514","TextValue"=>"Oh, one thing though, I do smell bacon, baked apple, and……<color=#f58c26>an imminent storm</color> in the air. You'd better be prepared. "],
17127=>["Value"=>17127,"TextKey"=>"剧情ID3060601","TextValue"=>"And……off she goes. Alright then, Chief, I'm sure you've heard, the wind is strong and crazy here, let me see……"],
17128=>["Value"=>17128,"TextKey"=>"剧情ID3060602","TextValue"=>"Our tent needs some reinforcement on the top to weigh it down."],
17129=>["Value"=>17129,"TextKey"=>"剧情ID3060603","TextValue"=>"Why do we have to listen to her? We don't know where she's from, and you believe what she says! "],
17130=>["Value"=>17130,"TextKey"=>"剧情ID3060604","TextValue"=>"My predictions……you always pick at one error and mock me relentlessly! I'm gonna reveal that woman's true colors, you just wait and see!"],
17131=>["Value"=>17131,"TextKey"=>"剧情ID3060605","TextValue"=>"Ooooh, somebody's getting competitive. Anyways, Chief, I've made the list of the materials needed for <color=#f58c26>reinforcing the tent</color>, please have a look."],
17132=>["Value"=>17132,"TextKey"=>"剧情ID3070101","TextValue"=>"Emm, nice tea."],
17133=>["Value"=>17133,"TextKey"=>"剧情ID3070102","TextValue"=>"And this biscuit is quite nice too, melts in the mouth. Although it's a little burnt on the outside. "],
17134=>["Value"=>17134,"TextKey"=>"剧情ID3070103","TextValue"=>"You can lower the temperature next time and bake it for a longer time."],
17135=>["Value"=>17135,"TextKey"=>"剧情ID3070104","TextValue"=>"Why is she having afternoon tea?!"],
17136=>["Value"=>17136,"TextKey"=>"剧情ID3070105","TextValue"=>"What's the matter?"],
17137=>["Value"=>17137,"TextKey"=>"剧情ID3070106","TextValue"=>"And what's with that strange British accent! We are not even in the right era!"],
17138=>["Value"=>17138,"TextKey"=>"剧情ID3070107","TextValue"=>"Relax, little priest. Everything's gonna be fine. You'll understand."],
17139=>["Value"=>17139,"TextKey"=>"剧情ID3070108","TextValue"=>"No! Nothing's gonna be fine! And I'm not gonna understand anything! Dear God…Where the heck did this woman come from……"],
17140=>["Value"=>17140,"TextKey"=>"剧情ID3070109","TextValue"=>"Since you've asked with your utmost sincerity, in fact, thanks to the afternoon tea I quite enjoyed just now……"],
17141=>["Value"=>17141,"TextKey"=>"剧情ID3070110","TextValue"=>"I think I've recovered some of my memories. Actually, I mean, honestly speaking, fairly speaking, the fact is……"],
17142=>["Value"=>17142,"TextKey"=>"剧情ID3070111","TextValue"=>"Can't you just spit it?!"],
17143=>["Value"=>17143,"TextKey"=>"剧情ID3070112","TextValue"=>"Can you also reinforce that <color=#f58c26>Tiny Booth</color> outside for me?"],
17144=>["Value"=>17144,"TextKey"=>"剧情ID3070113","TextValue"=>"What?!"],
17145=>["Value"=>17145,"TextKey"=>"剧情ID3070114","TextValue"=>"Lanky old me who has walked for days alone, building this booth while starving……Oh, such a poor woman!"],
17146=>["Value"=>17146,"TextKey"=>"剧情ID3070115","TextValue"=>"It will be devastating to me if the booth breaks down. My fate is on your shoulders! I'm immensely grateful!"],
17147=>["Value"=>17147,"TextKey"=>"剧情ID3070116","TextValue"=>"What an interesting lady."],
17148=>["Value"=>17148,"TextKey"=>"剧情ID3070117","TextValue"=>"Sorry what did you say?!"],
17149=>["Value"=>17149,"TextKey"=>"剧情ID3070118","TextValue"=>"Chief, I've made the list of materials for you, please go check."],
17150=>["Value"=>17150,"TextKey"=>"剧情ID3070119","TextValue"=>"Don't ignore me!!!!! Gee I can't stand this anymore!"],
17151=>["Value"=>17151,"TextKey"=>"剧情ID3080101","TextValue"=>"Beautiful! Y'all are amazing!"],
17152=>["Value"=>17152,"TextKey"=>"剧情ID3080102","TextValue"=>"Mom! I knew it! I knew it was you!"],
17153=>["Value"=>17153,"TextKey"=>"剧情ID3080201","TextValue"=>"Great Tlachtga, how come you are here?!"],
17154=>["Value"=>17154,"TextKey"=>"剧情ID3080202","TextValue"=>"And this young lady is?"],
17155=>["Value"=>17155,"TextKey"=>"剧情ID3080203","TextValue"=>"Tlachtga! Your daughter! Stop playing dumb! "],
17156=>["Value"=>17156,"TextKey"=>"剧情ID3080204","TextValue"=>"The messenger told me they dug up a blind old woman from a bone pile, sounded a lot like you, so I might as well come check."],
17157=>["Value"=>17157,"TextKey"=>"剧情ID3080205","TextValue"=>"I'm not surprised to see you here at all."],
17158=>["Value"=>17158,"TextKey"=>"剧情ID3080206","TextValue"=>"The mother of Tlachtga…I've never heard that Tlachtga has a mother…"],
17159=>["Value"=>17159,"TextKey"=>"剧情ID3080207","TextValue"=>"Of course I have a mother you dumb ass!"],
17160=>["Value"=>17160,"TextKey"=>"剧情ID3080208","TextValue"=>"Language."],
17161=>["Value"=>17161,"TextKey"=>"剧情ID3080209","TextValue"=>"Whatever, this crazy lady over here is Mug Ruith, standing right in front of you."],
17162=>["Value"=>17162,"TextKey"=>"剧情ID3080210","TextValue"=>"Call me Meg."],
17163=>["Value"=>17163,"TextKey"=>"剧情ID3080211","TextValue"=>"But I thought Mug Ruith was a man…"],
17164=>["Value"=>17164,"TextKey"=>"剧情ID3080212","TextValue"=>"Well my mother can be a lot of things in tales. She hid her true identity from people when I was little."],
17165=>["Value"=>17165,"TextKey"=>"剧情ID3080213","TextValue"=>"'Cause you know, who's more likely to be taken advantage of than a blind woman and a three-year-old?"],
17166=>["Value"=>17166,"TextKey"=>"剧情ID3080214","TextValue"=>"I guess that's how the story started to spread… an omnipotent druid that knows it all, a blind warrior, a mighty knight…"],
17167=>["Value"=>17167,"TextKey"=>"剧情ID3080215","TextValue"=>"While in fact she's just a blind old woman with a strange sense of humor."],
17168=>["Value"=>17168,"TextKey"=>"剧情ID3080216","TextValue"=>"Mug Ruith is a woman…and I was rude to Mug Ruith…Oh…I will be doomed…I'm a disgrace to the title of priest…"],
17169=>["Value"=>17169,"TextKey"=>"剧情ID3080217","TextValue"=>"Little priest, don't be so gloomy. You'll get better at being nice~ I forgive you this time since you are so cute!~"],
17170=>["Value"=>17170,"TextKey"=>"剧情ID3080218","TextValue"=>"So you tricked us? You didn't lose your memory?"],
17171=>["Value"=>17171,"TextKey"=>"剧情ID3080219","TextValue"=>"Yeah…sorry about that. Long journeys can be boring, you know? Just having some fun~ "],
17172=>["Value"=>17172,"TextKey"=>"剧情ID3080220","TextValue"=>"But hey, look at that beautiful tent and that beautiful booth! Now this is beginning to look like a Camp! Although, it still feels lacking……"],
17173=>["Value"=>17173,"TextKey"=>"剧情ID3080221","TextValue"=>"What's lacking?"],
17174=>["Value"=>17174,"TextKey"=>"剧情ID3080222","TextValue"=>"Let me see…"],
17175=>["Value"=>17175,"TextKey"=>"剧情ID3080301","TextValue"=>"A gate! You need a gate to mark the entrance of the Camp, and with some lights, it'll look as fabulous as ever!"],
17176=>["Value"=>17176,"TextKey"=>"剧情ID3080302","TextValue"=>"We'll be your most humble servants and go build that gate, ma'am! Chief, get yourself together!"],
17177=>["Value"=>17177,"TextKey"=>"剧情ID3090101","TextValue"=>"Got everything? Great! Get moving get moving!"],
17178=>["Value"=>17178,"TextKey"=>"剧情ID3090201","TextValue"=>"Oh! How rejuvenating! This is the first construction project I've ever directed……"],
17179=>["Value"=>17179,"TextKey"=>"剧情ID3090202","TextValue"=>"Congratulations, Priest, you've grown so much. But don't know if Meg is satisfied with how our Camp looks now?"],
17180=>["Value"=>17180,"TextKey"=>"剧情ID3090203","TextValue"=>"Everything else is fine, but the empty sky looks rather dull……"],
17181=>["Value"=>17181,"TextKey"=>"剧情ID3090204","TextValue"=>"I know! I know! We have some signal balloons that can float in the sky!"],
17182=>["Value"=>17182,"TextKey"=>"剧情ID3090205","TextValue"=>"That's a wonderful idea! Just that we need some little tweaking to spice it up. "],
17183=>["Value"=>17183,"TextKey"=>"剧情ID3090206","TextValue"=>"Do you still have those glowing yellow and pink rocks left?"],
17184=>["Value"=>17184,"TextKey"=>"剧情ID3090207","TextValue"=>"Yes we do!"],
17185=>["Value"=>17185,"TextKey"=>"剧情ID3090208","TextValue"=>"Amazing. Give me a moment. Kevin, come."],
17186=>["Value"=>17186,"TextKey"=>"剧情ID3090301","TextValue"=>"Oof, that was some exercise. But look at these, aren't they just beautiful?"],
17187=>["Value"=>17187,"TextKey"=>"剧情ID3090302","TextValue"=>"Yes, they sure are."],
17188=>["Value"=>17188,"TextKey"=>"剧情ID3090303","TextValue"=>"Glad you like it. It's rare when mom makes something normal. Anyway, it's getting late, I'm gonna head back now. "],
17189=>["Value"=>17189,"TextKey"=>"剧情ID3090304","TextValue"=>"Leaving already?"],
17190=>["Value"=>17190,"TextKey"=>"剧情ID3090305","TextValue"=>"Yah, or what? I'm not gonna cuddle with you smelly men in that tiny tent of yours! Mom, are you coming with me?"],
17191=>["Value"=>17191,"TextKey"=>"剧情ID3090306","TextValue"=>"I'll catch up later. Your new friends seems lovely, especially this cute little priest~! I want to spend a moment with them~"],
17192=>["Value"=>17192,"TextKey"=>"剧情ID3090307","TextValue"=>"Mom, control yourself."],
17193=>["Value"=>17193,"TextKey"=>"剧情ID3090308","TextValue"=>"I know I know, I'm now well controlled. After all, we still have a long journey together ahead of us."],
17194=>["Value"=>17194,"TextKey"=>"剧情ID3090309","TextValue"=>"Alright then. See you."],
17195=>["Value"=>17195,"TextKey"=>"剧情ID3090401","TextValue"=>"Were you suggesting you will be joining us just now?"],
17196=>["Value"=>17196,"TextKey"=>"剧情ID3090402","TextValue"=>"Of course, why not! Your adventure will be increasingly dangerous. "],
17197=>["Value"=>17197,"TextKey"=>"剧情ID3090403","TextValue"=>"There's not much that I can do, but at least I can shed some light on what is yet to come."],
17198=>["Value"=>17198,"TextKey"=>"剧情ID3090404","TextValue"=>"But I do need you to show me the way to your Homeland. My sense of direction is……unimaginably terrible."],
17199=>["Value"=>17199,"TextKey"=>"剧情ID4010101","TextValue"=>"Ouch…Why does such a place exist on the earth?! My feet feel like stepping on flames nonstop…"],
17200=>["Value"=>17200,"TextKey"=>"剧情ID4010102","TextValue"=>"Impressive, Enda! Sigh…You haven't spoken more than five words since four hours ago."],
17201=>["Value"=>17201,"TextKey"=>"剧情ID4010103","TextValue"=>"I'm…too tired…too hot…"],
17202=>["Value"=>17202,"TextKey"=>"剧情ID4010104","TextValue"=>"You bunch of fragile baby dolls! It is merely a volcano. Look at your postures like you are gonna lie down on the ground!"],
17203=>["Value"=>17203,"TextKey"=>"剧情ID4010105","TextValue"=>"Ma'am… You've also been sweating like a running stream. Are you alright?"],
17204=>["Value"=>17204,"TextKey"=>"剧情ID4010106","TextValue"=>"Call me Tlachtga!... I'm not tired, but it is indeed very hot here… which is far more dangerous than at sea."],
17205=>["Value"=>17205,"TextKey"=>"剧情ID4010107","TextValue"=>"It seems we've arrived."],
17206=>["Value"=>17206,"TextKey"=>"剧情ID4010108","TextValue"=>"Let me see! According to the Goddess's instructions, there's a sea on flames with islands in it…"],
17207=>["Value"=>17207,"TextKey"=>"剧情ID4010109","TextValue"=>"Yes, it must be here!"],
17208=>["Value"=>17208,"TextKey"=>"剧情ID4010110","TextValue"=>"But where is Amergin? Amergin should have been arrived and waiting for us here. But he can't be seen anywhere."],
17209=>["Value"=>17209,"TextKey"=>"剧情ID4010111","TextValue"=>"I should build an altar to sense Amergin's traces. But…"],
17210=>["Value"=>17210,"TextKey"=>"剧情ID4010201","TextValue"=>"Ow… Chief, I…"],
17211=>["Value"=>17211,"TextKey"=>"剧情ID4010202","TextValue"=>"Enda!"],
17212=>["Value"=>17212,"TextKey"=>"剧情ID4010203","TextValue"=>"Enda!"],
17213=>["Value"=>17213,"TextKey"=>"剧情ID4010204","TextValue"=>"She must have a heat stroke! Hurry up! Build a shade for her to rest!"],
17214=>["Value"=>17214,"TextKey"=>"剧情ID4020101","TextValue"=>"Sir, the construction is completed!"],
17215=>["Value"=>17215,"TextKey"=>"剧情ID4020102","TextValue"=>"Goddess, I seem to be able to live a little longer…"],
17216=>["Value"=>17216,"TextKey"=>"剧情ID4020103","TextValue"=>"It's indeed too hot! I miss the smell of the sea so much…"],
17217=>["Value"=>17217,"TextKey"=>"剧情ID4020104","TextValue"=>"Phew, our priest looks much better."],
17218=>["Value"=>17218,"TextKey"=>"剧情ID4020105","TextValue"=>"It's a little bit better to have a tent shielding us from overwhelming hot air…"],
17219=>["Value"=>17219,"TextKey"=>"剧情ID4020106","TextValue"=>"But just a little bit."],
17220=>["Value"=>17220,"TextKey"=>"剧情ID4020107","TextValue"=>"Your holy Goddess! Please turn me over, so I can be barbecued evenly…"],
17221=>["Value"=>17221,"TextKey"=>"剧情ID4020108","TextValue"=>"I have to say it sure feels like a big stove here."],
17222=>["Value"=>17222,"TextKey"=>"剧情ID4020109","TextValue"=>"Look! The lowlands over there!"],
17223=>["Value"=>17223,"TextKey"=>"剧情ID4020110","TextValue"=>"Behold you guys! My mother literally gave birth to a genius."],
17224=>["Value"=>17224,"TextKey"=>"剧情ID4030101","TextValue"=>"Awesome Tlachtga! That's water! WATER!!"],
17225=>["Value"=>17225,"TextKey"=>"剧情ID4030102","TextValue"=>"Hah, I thought our pious priest saw the Goddess."],
17226=>["Value"=>17226,"TextKey"=>"剧情ID4030103","TextValue"=>"I've come back to life, and I'm feeling pretty well!"],
17227=>["Value"=>17227,"TextKey"=>"剧情ID4030104","TextValue"=>"I can see you guys are indeed more energetic!"],
17228=>["Value"=>17228,"TextKey"=>"剧情ID4030105","TextValue"=>"In this case... you, you and you, hurry up and go build a Training Ring!"],
17229=>["Value"=>17229,"TextKey"=>"剧情ID4030106","TextValue"=>"Training Ring?"],
17230=>["Value"=>17230,"TextKey"=>"剧情ID4030107","TextValue"=>"Yup, correct!"],
17231=>["Value"=>17231,"TextKey"=>"剧情ID4030108","TextValue"=>"Shouldn't we be looking for Amergin?"],
17232=>["Value"=>17232,"TextKey"=>"剧情ID4030109","TextValue"=>"Amergin… that old man. I know he can control the forces of nature like a piece of cake."],
17233=>["Value"=>17233,"TextKey"=>"剧情ID4030110","TextValue"=>"Back at you guys, walking here literally took half of your lives. How can we leave physical training behind?"],
17234=>["Value"=>17234,"TextKey"=>"剧情ID4030111","TextValue"=>"Well, Enda does need more exercise."],
17235=>["Value"=>17235,"TextKey"=>"剧情ID4030112","TextValue"=>"Shut up!"],
17236=>["Value"=>17236,"TextKey"=>"剧情ID4030113","TextValue"=>"According to my mother's prophecy, there will be only stronger storms awaiting us…"],
17237=>["Value"=>17237,"TextKey"=>"剧情ID4030114","TextValue"=>"Mug Ruith's prophecy…"],
17238=>["Value"=>17238,"TextKey"=>"剧情ID4030115","TextValue"=>"Young men!"],
17239=>["Value"=>17239,"TextKey"=>"剧情ID4030116","TextValue"=>"Understood!"],
17240=>["Value"=>17240,"TextKey"=>"剧情ID4040101","TextValue"=>"Look at the highland in the north! There is actually a natural ladder."],
17241=>["Value"=>17241,"TextKey"=>"剧情ID4040102","TextValue"=>"Yes, sir!"],
17242=>["Value"=>17242,"TextKey"=>"剧情ID4040103","TextValue"=>"Have you noticed the column in the middle? That can't be natural. "],
17243=>["Value"=>17243,"TextKey"=>"剧情ID4040104","TextValue"=>"With such a height and shape... I bet on my priest family's reputation that it must be an altar in old days!"],
17244=>["Value"=>17244,"TextKey"=>"剧情ID4040105","TextValue"=>"This altar looks desolate."],
17245=>["Value"=>17245,"TextKey"=>"剧情ID4040106","TextValue"=>"Right, it must be very old."],
17246=>["Value"=>17246,"TextKey"=>"剧情ID4040107","TextValue"=>"Such an altar, incapable of resonating with the power of the Archdruid, could not help us to find Amergin."],
17247=>["Value"=>17247,"TextKey"=>"剧情ID4040108","TextValue"=>"Chief, we need a device that can condense energy…"],
17248=>["Value"=>17248,"TextKey"=>"剧情ID4040109","TextValue"=>"The materials must be able to resist the high temperature here, and the shape must be inward."],
17249=>["Value"=>17249,"TextKey"=>"剧情ID4040110","TextValue"=>"How about those weird fangs near the lava?"],
17250=>["Value"=>17250,"TextKey"=>"剧情ID4040111","TextValue"=>"Not bad, Arlan! No wonder the Goddess's parting prompt said that "always stay close to the important partners"!"],
17251=>["Value"=>17251,"TextKey"=>"剧情ID4040112","TextValue"=>"Certainly! Thank the Goddess!"],
17252=>["Value"=>17252,"TextKey"=>"剧情ID4040113","TextValue"=>"Shut up! You are not included!"],
17253=>["Value"=>17253,"TextKey"=>"剧情ID4040114","TextValue"=>"Let's leave all the materials to our marvelous chief!"],
17254=>["Value"=>17254,"TextKey"=>"剧情ID4050101","TextValue"=>"Chief, we are making so much progress."],
17255=>["Value"=>17255,"TextKey"=>"剧情ID4050102","TextValue"=>"The altar should be fine to use!"],
17256=>["Value"=>17256,"TextKey"=>"剧情ID4050103","TextValue"=>"But look at the gloomy sky! Enda has been struggling going up and down the altar stairs. What if she falls?"],
17257=>["Value"=>17257,"TextKey"=>"剧情ID4050104","TextValue"=>"Not bad, something…stan. Turns out you are not that annoying sometimes."],
17258=>["Value"=>17258,"TextKey"=>"剧情ID4050105","TextValue"=>"After all, Enda is old… Ummm… I mean not young anymore."],
17259=>["Value"=>17259,"TextKey"=>"剧情ID4050106","TextValue"=>"What's in it for you to piss me off?"],
17260=>["Value"=>17260,"TextKey"=>"剧情ID4050107","TextValue"=>"Let's build torches on both sides of the stairs. It's very simple!"],
17261=>["Value"=>17261,"TextKey"=>"剧情ID4060101","TextValue"=>"I feel this altar… still lacks of something, cause it can't sense the Goddess at all…"],
17262=>["Value"=>17262,"TextKey"=>"剧情ID4060102","TextValue"=>"But it should be enough to sense Amergin!"],
17263=>["Value"=>17263,"TextKey"=>"剧情ID4060103","TextValue"=>"It's cold…argh…Who's there?"],
17264=>["Value"=>17264,"TextKey"=>"剧情ID4060104","TextValue"=>"Amergin! Where are you?"],
17265=>["Value"=>17265,"TextKey"=>"剧情ID4060105","TextValue"=>"Are… are you Enda? I have no idea where I am… But it's so cold here…"],
17266=>["Value"=>17266,"TextKey"=>"剧情ID4060106","TextValue"=>"Cold?"],
17267=>["Value"=>17267,"TextKey"=>"剧情ID4060107","TextValue"=>"It seems that he is not here."],
17268=>["Value"=>17268,"TextKey"=>"剧情ID4060108","TextValue"=>"I can't move… Help, $#^*,!@%&:?""],
17269=>["Value"=>17269,"TextKey"=>"剧情ID4060109","TextValue"=>"What did you say?"],
17270=>["Value"=>17270,"TextKey"=>"剧情ID4060110","TextValue"=>"Hey, Enda. I think…"],
17271=>["Value"=>17271,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$"…"],
17272=>["Value"=>17272,"TextKey"=>"剧情ID4060112","TextValue"=>"Amergin! Hang in there! I have to talk to another person now, it might help you."],
17273=>["Value"=>17273,"TextKey"=>"剧情ID4060113","TextValue"=>"Tlachtga, have you seen this situation before?"],
17274=>["Value"=>17274,"TextKey"=>"剧情ID4060114","TextValue"=>"Hey…"],
17275=>["Value"=>17275,"TextKey"=>"剧情ID4060115","TextValue"=>"Spiritual communication isn't really my expertise. But my mother has encountered the same situation. The problem should still be the altar."],
17276=>["Value"=>17276,"TextKey"=>"剧情ID4060116","TextValue"=>"The power of the altar is still too weak. The most important thing is missing."],
17277=>["Value"=>17277,"TextKey"=>"剧情ID4060117","TextValue"=>"The power of the Goddess… @#$>:%^Essence"],
17278=>["Value"=>17278,"TextKey"=>"剧情ID4060118","TextValue"=>"Chief, I think I got it. Look at the vacancy on top of the column of the altar!"],
17279=>["Value"=>17279,"TextKey"=>"剧情ID4060119","TextValue"=>"We need to fill up the Spirit Essence and enhance the power of the altar. Do we have it?"],
17280=>["Value"=>17280,"TextKey"=>"剧情ID4060120","TextValue"=>"What do you say? Arlan, I'll hand it to you right away."],
17281=>["Value"=>17281,"TextKey"=>"剧情ID4060121","TextValue"=>"I got this!"],
17282=>["Value"=>17282,"TextKey"=>"剧情ID4070101","TextValue"=>"Amergin, say something!"],
17283=>["Value"=>17283,"TextKey"=>"剧情ID4070102","TextValue"=>"You need to come and find me…"],
17284=>["Value"=>17284,"TextKey"=>"剧情ID4070103","TextValue"=>"It should be fine this time. Your voice finally doesn't sound ambiguous as fake-coughing Meg."],
17285=>["Value"=>17285,"TextKey"=>"剧情ID4070104","TextValue"=>"Meg is just an old lady."],
17286=>["Value"=>17286,"TextKey"=>"剧情ID4070105","TextValue"=>"As you said…"],
17287=>["Value"=>17287,"TextKey"=>"剧情ID4070106","TextValue"=>"I had made it to the volcano once, but I had no idea what happened after. When I woke up, I have already ended up here, whatever this hellhole is."],
17288=>["Value"=>17288,"TextKey"=>"剧情ID4070107","TextValue"=>"Although your altar can reach out to me, I guess it couldn't lead you to where I am…"],
17289=>["Value"=>17289,"TextKey"=>"剧情ID4070108","TextValue"=>"Cause despite I can sense and respond to Enda, but this place... definitely will not, and it will manage to hide itself."],
17290=>["Value"=>17290,"TextKey"=>"剧情ID4070109","TextValue"=>"Any ideas?"],
17291=>["Value"=>17291,"TextKey"=>"剧情ID4070110","TextValue"=>"Coexist with the environment…endlessly…and form a circulation."],
17292=>["Value"=>17292,"TextKey"=>"剧情ID4070111","TextValue"=>"What do you mean? Let the flames here flow to the ice cellar you are in?"],
17293=>["Value"=>17293,"TextKey"=>"剧情ID4070112","TextValue"=>"You fat-headed student! Of course not."],
17294=>["Value"=>17294,"TextKey"=>"剧情ID4070113","TextValue"=>"Circulation… Let the lava flow to create ashes, let the ashes rise and solidify to rocks, and finally let the rocks erupt to lava again."],
17295=>["Value"=>17295,"TextKey"=>"剧情ID4070114","TextValue"=>"You are indeed a top student."],
17296=>["Value"=>17296,"TextKey"=>"剧情ID4070115","TextValue"=>"Wait!"],
17297=>["Value"=>17297,"TextKey"=>"剧情ID4080101","TextValue"=>"Is this… a pig's head?"],
17298=>["Value"=>17298,"TextKey"=>"剧情ID4080102","TextValue"=>"Uh-huh."],
17299=>["Value"=>17299,"TextKey"=>"剧情ID4080103","TextValue"=>"With all due respect, why is it shaped like a pig's head?"],
17300=>["Value"=>17300,"TextKey"=>"剧情ID4080104","TextValue"=>"Wait, I shouldn't be asking this question."],
17301=>["Value"=>17301,"TextKey"=>"剧情ID4080105","TextValue"=>"Goddess! Dearest partners are needed on the road to success. Why don't we leave my partner, something-stan's figure here!"],
17302=>["Value"=>17302,"TextKey"=>"剧情ID4080106","TextValue"=>"Look how cute our priest is! Look at such a subtle way of being nice. "],
17303=>["Value"=>17303,"TextKey"=>"剧情ID4080107","TextValue"=>"You!"],
17304=>["Value"=>17304,"TextKey"=>"剧情ID4080108","TextValue"=>"Get out of the way, the chief and I are about to start the altar."],
17305=>["Value"=>17305,"TextKey"=>"剧情ID4090101","TextValue"=>"Sigh... Enda, showtime."],
17306=>["Value"=>17306,"TextKey"=>"剧情ID4090102","TextValue"=>"Amergin is in…"],
17307=>["Value"=>17307,"TextKey"=>"剧情ID4090103","TextValue"=>"The Far East… A place where is frosty and forbidden."],
17308=>["Value"=>17308,"TextKey"=>"剧情ID4090104","TextValue"=>"Although it is steaming hot here, I think we should start to prepare winter clothes."],
17309=>["Value"=>17309,"TextKey"=>"剧情ID99990101","TextValue"=>"The fog here looks so suspicious! I grew up here in Greenville Town. Can't believe I came back here after all these years, it will be enveloped in the thick evil fog."],
17310=>["Value"=>17310,"TextKey"=>"剧情ID99990102","TextValue"=>"Not long after I left my hometown, I heard about the eruption of Iaso Volcano not far away. Over the years, these volcanic ash fog are still shadowing this little town."],
17311=>["Value"=>17311,"TextKey"=>"剧情ID99990103","TextValue"=>"The fog contains all kinds of toxic inspirable particles. I must find a way to get rid of it to rebuild Greenville!"],
17312=>["Value"=>17312,"TextKey"=>"剧情ID47990201","TextValue"=>"Hey! Well done! The wheat is growing well in such harsh environment!"],
17313=>["Value"=>17313,"TextKey"=>"剧情ID99990202","TextValue"=>"Let's harvest some first and then see what we can do with them!"],
17314=>["Value"=>17314,"TextKey"=>"剧情ID99990301","TextValue"=>"After completed the order for bread, something just showed up out of blue——"],
17315=>["Value"=>17315,"TextKey"=>"剧情ID99990302","TextValue"=>"— A mini lamp! The fog seems thinned a bit because of the light beam it directs… Maybe we can use it to clear the fog away!"],
17316=>["Value"=>17316,"TextKey"=>"剧情ID34990101","TextValue"=>"Great! Now let's make a plan: merge ingredients, cook foods, get lamps, and last but most important — CLEAR EVIL FOG!"],
17317=>["Value"=>17317,"TextKey"=>"剧情ID99990601","TextValue"=>"Ha! What's that? It seems like there is a chest buried underground."],
17318=>["Value"=>17318,"TextKey"=>"剧情ID99990602","TextValue"=>"Let's open it at once and see what's inside!"],
17319=>["Value"=>17319,"TextKey"=>"剧情ID99990701","TextValue"=>"We should make good use of these kitchenwares and open a home bakery!"],
17320=>["Value"=>17320,"TextKey"=>"剧情ID99990702","TextValue"=>"We did it! And sure enough, these bright lamps certainly worked!"],
17321=>["Value"=>17321,"TextKey"=>"剧情ID99991001","TextValue"=>"I'm curious that what'll happen if we merge 5 items of the same kind at once."],
17322=>["Value"=>17322,"TextKey"=>"剧情ID99991002","TextValue"=>"Let's try to merge them all together. I think something good might happen. Trust my sixth sense!"],
17323=>["Value"=>17323,"TextKey"=>"剧情ID99990801","TextValue"=>"What's this?"],
17324=>["Value"=>17324,"TextKey"=>"剧情ID99990802","TextValue"=>"These kitchenware look great! With a little more time, we can build a pretty nice restaurant out of these appliances."],
17325=>["Value"=>17325,"TextKey"=>"剧情ID99990803","TextValue"=>"Ha! Who are you? You scared me!"],
17326=>["Value"=>17326,"TextKey"=>"剧情ID99990804","TextValue"=>"Hah-hah, sorry young girl. My name is Watt. As you can see, I'm a construction worker and I'm in charge of many rebuilding projects in Greenville now."],
17327=>["Value"=>17327,"TextKey"=>"剧情ID99990805","TextValue"=>"Except some working staff, I haven't met anyone in a long time. So, tell me, what are you doing here, young girl?"],
17328=>["Value"=>17328,"TextKey"=>"剧情ID99990806","TextValue"=>"Hi, call me Aurora. I'm from Greenville, but I haven't come back for years. I came back this time just to do something to help bring back my beautiful hometown in memory."],
17329=>["Value"=>17329,"TextKey"=>"剧情ID99990807","TextValue"=>"How's your cooking skill?"],
17330=>["Value"=>17330,"TextKey"=>"剧情ID99990808","TextValue"=>"I think… pretty good. "],
17331=>["Value"=>17331,"TextKey"=>"剧情ID99990809","TextValue"=>"Wow, nice to hear. Guess my twin brother Wally and I are gonna count on you!"],
17332=>["Value"=>17332,"TextKey"=>"剧情ID99990810","TextValue"=>"Indeed! Chef Aurora!"],
17333=>["Value"=>17333,"TextKey"=>"剧情ID99990811","TextValue"=>"No problem, I won't disappoint you guys. All the kitchenware are ready, I'm about to make you guys my secret recipe!"],
17334=>["Value"=>17334,"TextKey"=>"剧情ID99990812","TextValue"=>"That's awesome! If you can open a restaurant here in Greenville, we don't have to eat cold sandwiches for lunch every day."],
17335=>["Value"=>17335,"TextKey"=>"剧情ID99990501","TextValue"=>"This has looks old… but the design says it's high end."],
17336=>["Value"=>17336,"TextKey"=>"剧情ID99990502","TextValue"=>"Keep merging! I think this is a clue that leads us to the right man to help us!"],
17337=>["Value"=>17337,"TextKey"=>"剧情ID99990901","TextValue"=>"What is this magical base with four slots on top? Looks like we need something to activate it!"],
17338=>["Value"=>17338,"TextKey"=>"剧情ID99990902","TextValue"=>"This is a base for a large restaurant. As long as we build the qualified diners and place them on top of it, your dream restaurant will be easily constructed!"],
17339=>["Value"=>17339,"TextKey"=>"剧情ID99990903","TextValue"=>"We will remind you to place those diners on top after we finished construction."],
17340=>["Value"=>17340,"TextKey"=>"剧情ID99991101","TextValue"=>"I can't wait to find out what kind of mysterious treasure is hidden inside."],
17341=>["Value"=>17341,"TextKey"=>"剧情ID99991102","TextValue"=>"We can merge them into kitchen resources. In this way, we will have unlimited kitchenwares!"],
17342=>["Value"=>17342,"TextKey"=>"剧情ID99991201","TextValue"=>"Very helpful magic crystal! It can be played as anything you want!"],
17343=>["Value"=>17343,"TextKey"=>"剧情ID99991202","TextValue"=>"With the crystal, you only need 2, instead of 3, items of the same kind to merge! Try to make the most of it!"],
17344=>["Value"=>17344,"TextKey"=>"剧情ID99991203","TextValue"=>"Remember the Magic Crystal can substitute any item you need in-game!"],
17345=>["Value"=>17345,"TextKey"=>"剧情ID99992001","TextValue"=>"Welcome to the time-limited event -- Ocean Island! Here you'll unravel many secrets beneath the seas! Ready to feel the ocean breeze?"],
17346=>["Value"=>17346,"TextKey"=>"剧情ID99993001","TextValue"=>"Many delicacies are ready for serve on the Yummy Island! Come bring them to the Meow-meow Cats when the island is open!"],
17347=>["Value"=>17347,"TextKey"=>"剧情ID99993101","TextValue"=>"A large area of fog's cleared away! Look, there's something on the ground!"],
17348=>["Value"=>17348,"TextKey"=>"剧情ID99994001","TextValue"=>"Toys and laughters are the basic needs on the Joy Island! Come explore the fun before it closes!"],
17349=>["Value"=>17349,"TextKey"=>"剧情ID99995001","TextValue"=>"The most beautiful flowers and exotic plants are all thriving on the Botanical Island! Come get more closer to the mother nature!"],
17350=>["Value"=>17350,"TextKey"=>"剧情ID39990201","TextValue"=>"Wow, so many beautiful outfits! It looks like some fashion influencer's closet just got robbed!"],
17351=>["Value"=>17351,"TextKey"=>"剧情ID39990202","TextValue"=>"Guess we don't have to worry about the materials for the tailor store."],
17352=>["Value"=>17352,"TextKey"=>"剧情ID34990201","TextValue"=>"Oh no! Our kitchenwares are almost out of stock! "],
17353=>["Value"=>17353,"TextKey"=>"剧情ID39990301","TextValue"=>"Bring it on! Gimme more Irons!"],
17354=>["Value"=>17354,"TextKey"=>"剧情ID39990401","TextValue"=>"We need more materials for a luxurious cruise ship!"],
17355=>["Value"=>17355,"TextKey"=>"剧情ID39990501","TextValue"=>"Chop chop! The more boat resources the better!"],
17356=>["Value"=>17356,"TextKey"=>"剧情ID39990601","TextValue"=>"That's far too many wagon materials… Are we standing on top of an abandoned wagon factory?"],
17357=>["Value"=>17357,"TextKey"=>"剧情ID39990701","TextValue"=>"My castle requires more materials!"],
17358=>["Value"=>17358,"TextKey"=>"剧情ID39990801","TextValue"=>"Wow… so many matches!"],
17359=>["Value"=>17359,"TextKey"=>"剧情ID39990802","TextValue"=>"Little Match Girl, wait for you castle with the brightest lighting! Hohoho!"],
17360=>["Value"=>17360,"TextKey"=>"剧情ID39990901","TextValue"=>"I need no houses. Straw pile is comfy enough for my organic body!"],
17361=>["Value"=>17361,"TextKey"=>"剧情ID39990902","TextValue"=>"That we are not concerned at all. We just need to keep you in our sights… in case of your silly pranks."],
17362=>["Value"=>17362,"TextKey"=>"剧情ID39991001","TextValue"=>"Oh. Watt, let me put your mind at ease. I'm sure I'll find you enough toy blocks. "],
17363=>["Value"=>17363,"TextKey"=>"剧情ID39991101","TextValue"=>"More toy blocks here, please! The castle will be completed soon!"],
17364=>["Value"=>17364,"TextKey"=>"剧情ID98880201","TextValue"=>"Whoa, look at all these pearls we just harvested out of the mine!"],
17365=>["Value"=>17365,"TextKey"=>"剧情ID98880301","TextValue"=>"We can't make a silk purse out of a sow's ear. We've gotta get Watt more construction materials!"],
17366=>["Value"=>17366,"TextKey"=>"剧情ID30400301","TextValue"=>"Take a look. What say you?"],
17367=>["Value"=>17367,"TextKey"=>"剧情ID30400302","TextValue"=>"All we need is put stuff in, set timer, and BAM -- yummy order's ready!"],
17368=>["Value"=>17368,"TextKey"=>"剧情ID30400303","TextValue"=>"Awesome! I was just thinking about to buy some kitchenware that's convinient!"],
17369=>["Value"=>17369,"TextKey"=>"剧情ID30410304","TextValue"=>"In my designs, I want to highlight different people's uniqueness and share it with the world through clothes."],
17370=>["Value"=>17370,"TextKey"=>"剧情ID30400401","TextValue"=>"This is gonna be an event savior to a restaurant."],
17371=>["Value"=>17371,"TextKey"=>"剧情ID30400402","TextValue"=>"Correct! All I need to take care of is temperature and timing… then be ready to say "hello" to freshly baked bread! Hooray!"],
17372=>["Value"=>17372,"TextKey"=>"剧情ID30400403","TextValue"=>"Awesome! I can finally say "bye-bye" to cold convinient-store-sandwiches!"],
17373=>["Value"=>17373,"TextKey"=>"剧情ID30400501","TextValue"=>"It is a bit cramped in there at times. But at least it's ready to open."],
17374=>["Value"=>17374,"TextKey"=>"剧情ID30400502","TextValue"=>"Things will get better for sure! I can bake some breads and pan-fry some bacons for breakfast. Perfect way to start off the morning!"],
17375=>["Value"=>17375,"TextKey"=>"剧情ID30400503","TextValue"=>"But wait for a second, I don't have the handy tools and kitchenwares for lunch…"],
17376=>["Value"=>17376,"TextKey"=>"剧情ID30400504","TextValue"=>"Alrighty! Let us march torwards the direction of yummy lunches！"],
17377=>["Value"=>17377,"TextKey"=>"剧情ID30400601","TextValue"=>"Whoa! Look at the golden tempura shrimps I just made! Umm yummm, the batter gives the food a crunchy, textured crust while the shrimps inside tastes so tender and fresh."],
17378=>["Value"=>17378,"TextKey"=>"剧情ID30400602","TextValue"=>"I believe in your skills, big chef! The roast pork you made definitely worth a michelin star!"],
17379=>["Value"=>17379,"TextKey"=>"剧情ID30400603","TextValue"=>"Agreed! Guys, any ideas for dinner? I suggest that we come up with a ready-to-go menu. How's that sound?"],
17380=>["Value"=>17380,"TextKey"=>"剧情ID30400604","TextValue"=>"By doing so, the townpeople can order take-aways from us when they're busy at work or just don't feel come out."],
17381=>["Value"=>17381,"TextKey"=>"剧情ID30400701","TextValue"=>"I've got an idea! We can do corndog and hotdog delivery. You know, it's tasty and convinient… with some ketchup and yellow mustard… ummm genius!"],
17382=>["Value"=>17382,"TextKey"=>"剧情ID30400702","TextValue"=>"I've got a great news!!! Our Hotdog Diner was nominated as the newest Influencer's Choice! "],
17383=>["Value"=>17383,"TextKey"=>"剧情ID30400703","TextValue"=>"Wait and see, Watt. Our restaurant will become something even more significant than this."],
17384=>["Value"=>17384,"TextKey"=>"剧情ID30400704","TextValue"=>"I'm a great chef! My dream is to prepare all foodies various selection of tasty breakfasts, lunches and dinners!"],
17385=>["Value"=>17385,"TextKey"=>"剧情ID30400705","TextValue"=>"Some diners suggested that we could serve all three meals in one restaurant. I think that's a great idea for our regulars. Y'all know, let's make a business integration!"],
17386=>["Value"=>17386,"TextKey"=>"剧情ID30400801","TextValue"=>"Ta-ta! Now you are looking at the largest, fastest and tastiest restaurant in town!"],
17387=>["Value"=>17387,"TextKey"=>"剧情ID30400802","TextValue"=>"What's up with that weird anchor voice? I think we've got no plans for interviews in the near future."],
17388=>["Value"=>17388,"TextKey"=>"剧情ID30400803","TextValue"=>"Haha, drop it, Wally! You'll find Aurora's somehow weirdly cute when you get used to it."],
17389=>["Value"=>17389,"TextKey"=>"剧情ID30400804","TextValue"=>"Aurora and Wally, diner's on me today! Sorry, meals for three!"],
17390=>["Value"=>17390,"TextKey"=>"剧情ID30400805","TextValue"=>"Now the restaurant is completed! We can collect useful tools from it everyday to keep expanding the town."],
17391=>["Value"=>17391,"TextKey"=>"剧情ID30400806","TextValue"=>"No way! There are so many handy tools in the restaurant!"],
17392=>["Value"=>17392,"TextKey"=>"剧情ID31610301","TextValue"=>"The shape of the hat is changed! We should find its owner for one must be a world-famous designer!"],
17393=>["Value"=>17393,"TextKey"=>"剧情ID31610401","TextValue"=>"Humpf! It's you!!!"],
17394=>["Value"=>17394,"TextKey"=>"剧情ID31610402","TextValue"=>"Hah-hah-hah, what's up Aurora! It has been 18 days since you broke up with me and left without even saying goodbye. I flew all the way here and found you in the fog. What a journey!"],
17395=>["Value"=>17395,"TextKey"=>"剧情ID31610403","TextValue"=>"I know I should've supported you when you made the decision to rebuild Greenville Town. That's why now I am here. Hope you can forgive me…."],
17396=>["Value"=>17396,"TextKey"=>"剧情ID31610404","TextValue"=>"There's no fashion industry in this little town, which means you can't pursue your dream here. You should live you life and leave..."],
17397=>["Value"=>17397,"TextKey"=>"剧情ID31610405","TextValue"=>"Don't you worry, I can open a local tailor shop. That'll be a good start. I'll stay and help you."],
17398=>["Value"=>17398,"TextKey"=>"剧情ID30410301","TextValue"=>"Speaking of why I want to start a fashion business…"],
17399=>["Value"=>17399,"TextKey"=>"剧情ID30410302","TextValue"=>"I believe fine feathers make fine birds. And by the way, I worship diversities, no matter it is in culture or appearance. That's what makes the world colorful."],
17400=>["Value"=>17400,"TextKey"=>"剧情ID30410303","TextValue"=>"Every person in this world is unique. But sometimes people are afraid of being judged. So they choose to close themselves and hide their differences."],
17401=>["Value"=>17401,"TextKey"=>"剧情ID30410304","TextValue"=>"In my designs, I want to highlight different people's uniqueness and share it with the world through clothes."],
17402=>["Value"=>17402,"TextKey"=>"剧情ID30410305","TextValue"=>"For there's nothing more than what you wear leaves more obvious first impression."],
17403=>["Value"=>17403,"TextKey"=>"剧情ID30410306","TextValue"=>"Well, now I have all the basic tools. Let me show you guys what I'm capable of!"],
17404=>["Value"=>17404,"TextKey"=>"剧情ID30410401","TextValue"=>"Woww, such a lovely top!"],
17405=>["Value"=>17405,"TextKey"=>"剧情ID30410402","TextValue"=>"……"],
17406=>["Value"=>17406,"TextKey"=>"剧情ID30410403","TextValue"=>"Oh, this cute t-shirt is actually inspire by Aurora's style."],
17407=>["Value"=>17407,"TextKey"=>"剧情ID30410404","TextValue"=>"That's quite flattering. Well, it does reminds me of a t-shirt I bought at a carnival… Ohh, I remembered I was with you that day."],
17408=>["Value"=>17408,"TextKey"=>"剧情ID30410405","TextValue"=>"It's very casual tho. Why do you want to design something like this?"],
17409=>["Value"=>17409,"TextKey"=>"剧情ID30410406","TextValue"=>"Cause I was very very happy that day. "],
17410=>["Value"=>17410,"TextKey"=>"剧情ID30410501","TextValue"=>"Wow, the slim cut? Very a la mode."],
17411=>["Value"=>17411,"TextKey"=>"剧情ID30410502","TextValue"=>"Uh-huh."],
17412=>["Value"=>17412,"TextKey"=>"剧情ID30410503","TextValue"=>"And a full set of accessories from hat, purse to even belt!"],
17413=>["Value"=>17413,"TextKey"=>"剧情ID30410504","TextValue"=>"Uh-huh!"],
17414=>["Value"=>17414,"TextKey"=>"剧情ID30410505","TextValue"=>"Roll up your sleeves and tailor some more. Your shop will be open in a blink!"],
17415=>["Value"=>17415,"TextKey"=>"剧情ID30410601","TextValue"=>"What do you think? Wally and I spent all afternoon selecting the right materials."],
17416=>["Value"=>17416,"TextKey"=>"剧情ID30410602","TextValue"=>"I figure the design with scissors will speak right to your heart."],
17417=>["Value"=>17417,"TextKey"=>"剧情ID30410603","TextValue"=>"Indeed! I absolutely love this showcase! I suggest that we put on some nice looks on mannequins and display them in the window."],
17418=>["Value"=>17418,"TextKey"=>"剧情ID30410604","TextValue"=>"The looks are ready but I feel something is missing here… Oh hat! Don't you think so, Ben?"],
17419=>["Value"=>17419,"TextKey"=>"剧情ID30410701","TextValue"=>"Great idea! Hats are very important in a whole outfit.That'll also help me polishing my skills."],
17420=>["Value"=>17420,"TextKey"=>"剧情ID30410702","TextValue"=>"Check this out! A fancy banquet hat. The town people are gonna adore it!"],
17421=>["Value"=>17421,"TextKey"=>"剧情ID30410703","TextValue"=>"Such an exquisite bowknot!"],
17422=>["Value"=>17422,"TextKey"=>"剧情ID30410704","TextValue"=>"I'll keep expanding my business. Stay tunned!"],
17423=>["Value"=>17423,"TextKey"=>"剧情ID30410801","TextValue"=>"Wow, you kept that bowknot design on the shoes!"],
17424=>["Value"=>17424,"TextKey"=>"剧情ID30410802","TextValue"=>"An outstanding designer never keep the ears closed. "],
17425=>["Value"=>17425,"TextKey"=>"剧情ID30410803","TextValue"=>"Even if sometimes the taste of the guests is too mediocre…"],
17426=>["Value"=>17426,"TextKey"=>"剧情ID30410804","TextValue"=>"What did you say?"],
17427=>["Value"=>17427,"TextKey"=>"剧情ID30410805","TextValue"=>"Ahem, I said guests' taste is very meteoric..."],
17428=>["Value"=>17428,"TextKey"=>"剧情ID30410901","TextValue"=>"What a wonderful Department Store! To be honest, I've never imagined that Benjamin's tailor business would grow so fast!"],
17429=>["Value"=>17429,"TextKey"=>"剧情ID30410902","TextValue"=>"I love this town. Everyone here has a pretty nice taste."],
17430=>["Value"=>17430,"TextKey"=>"剧情ID30410903","TextValue"=>"Thanks to Wally for the architectural design. As a fellow designer, I have to say that your level of excellence is catching up with me."],
17431=>["Value"=>17431,"TextKey"=>"剧情ID30410904","TextValue"=>"Sara just called me to go shopping! Hey, big designer! Gimme some percent off for friends' sake, please?"],
17432=>["Value"=>17432,"TextKey"=>"剧情ID31620301","TextValue"=>"Benjamin, who would need these many harps?"],
17433=>["Value"=>17433,"TextKey"=>"剧情ID31620302","TextValue"=>"Ummm, I can't think of anyone. But this person should be a musician!"],
17434=>["Value"=>17434,"TextKey"=>"剧情ID31620401","TextValue"=>"I feel the power within these harps continues to grow."],
17435=>["Value"=>17435,"TextKey"=>"剧情ID31620501","TextValue"=>"These harps could mean the world to a musician. So, can they continue upgrading?"],
17436=>["Value"=>17436,"TextKey"=>"剧情ID31620601","TextValue"=>"I can almost see the grand view when this harp is being played in a luxurious music hall of the Royal Family."],
17437=>["Value"=>17437,"TextKey"=>"剧情ID31620602","TextValue"=>"I believe the owner of this harp shall be given such a chance."],
17438=>["Value"=>17438,"TextKey"=>"剧情ID31620701","TextValue"=>"Your Grace! I'm Ramble, your humble servant. As a Celtic bard, now I have one more thing to hymn about!"],
17439=>["Value"=>17439,"TextKey"=>"剧情ID31620702","TextValue"=>"Umm, can someone please make me an Icecream Muffin first? I'm sure your beautiful music will be a perfect combo to it, even better than cinnamon powder!"],
17440=>["Value"=>17440,"TextKey"=>"剧情ID31620703","TextValue"=>"*In the arc music hall, in the breezy spring fields, in the presence of the man, whom this hymn is gifted towards*"],
17441=>["Value"=>17441,"TextKey"=>"剧情ID30420401","TextValue"=>"I quite like this exquisite door. Besides, just a thought… perhaps a wind vane is needed over the sea?"],
17442=>["Value"=>17442,"TextKey"=>"剧情ID30420501","TextValue"=>"Ohh, it reminds me of those old adventure days so much. Listen, we need to increase the height of the base. Y'all know waves crashing is no kidding."],
17443=>["Value"=>17443,"TextKey"=>"剧情ID30420601","TextValue"=>"Pretty good! Wally, you are no doubt a genius!"],
17444=>["Value"=>17444,"TextKey"=>"剧情ID30420602","TextValue"=>"Haha, Wally never fails you! And... since I've known him for my life, it's far from the time to celebrate."],
17445=>["Value"=>17445,"TextKey"=>"剧情ID30420701","TextValue"=>"Praise be to the brilliant craftsmanship! And what else do we need… *bright lights dancing in the dark night, becoming the only beacon to the travelers*"],
17446=>["Value"=>17446,"TextKey"=>"剧情ID30420801","TextValue"=>"What a wonderful boathouse! With only a couple more houses like this, our cruise ship will be ready to set sail!"],
17447=>["Value"=>17447,"TextKey"=>"剧情ID30420901","TextValue"=>"I can hear the waves beating and I can smell the storm coming! How exciting!"],
17448=>["Value"=>17448,"TextKey"=>"剧情ID30420902","TextValue"=>"Hah-hah, check out Ramble! He's been dreaming about adventures already! Watt and Wally, you two are indeed the best craftsmen ever!"],
17449=>["Value"=>17449,"TextKey"=>"剧情ID30420903","TextValue"=>"Thanks for your appreciation, beautiful princess! Our experience and skills are greatly enhanced by designing this boat castle! "],
17450=>["Value"=>17450,"TextKey"=>"剧情ID31630301","TextValue"=>"That drum grew taller, looking like it's for an adult now! Ha, I want to jam with it now!"],
17451=>["Value"=>17451,"TextKey"=>"剧情ID31630401","TextValue"=>"In my opinion, a belt is needed for the drum. That'll be protective to the drumhead."],
17452=>["Value"=>17452,"TextKey"=>"剧情ID31630501","TextValue"=>"How about a fixation on the drum frame? Ramble knows musicians like him can get so carried away during the performance. It'll be a shame if the drum goes broken."],
17453=>["Value"=>17453,"TextKey"=>"剧情ID31630502","TextValue"=>"Correct! I have already broken 1, 2, 3, 4… Ummm... so many harps in my life."],
17454=>["Value"=>17454,"TextKey"=>"剧情ID31630601","TextValue"=>"The feather decoration looks very cute and unique. What do you think, Ramble?"],
17455=>["Value"=>17455,"TextKey"=>"剧情ID31630602","TextValue"=>"Yeah… but it might get in the way while playing. It's better to change the décor's location."],
17456=>["Value"=>17456,"TextKey"=>"剧情ID31630701","TextValue"=>"Now, it won't bother beating the drum. "],
17457=>["Value"=>17457,"TextKey"=>"剧情ID31630702","TextValue"=>"But the original simplicity and delicacy are weakened. Ramble, do you think you can improve that?"],
17458=>["Value"=>17458,"TextKey"=>"剧情ID31630801","TextValue"=>"Are you the guys who find my drum? Thank you so much!"],
17459=>["Value"=>17459,"TextKey"=>"剧情ID31630802","TextValue"=>"What a lovely wee lass!"],
17460=>["Value"=>17460,"TextKey"=>"剧情ID31630803","TextValue"=>"*Giggles* Thank you. I'm Melody, feel free to call me Mel! I have no idea why I woke up here in the fog."],
17461=>["Value"=>17461,"TextKey"=>"剧情ID31630804","TextValue"=>"That happened to everybody. Mel, we are so glad you joined us on this journey!"],
17462=>["Value"=>17462,"TextKey"=>"剧情ID30430301","TextValue"=>"Beautiful pearl! I always want one, even though it doesn't have any function."],
17463=>["Value"=>17463,"TextKey"=>"剧情ID30430302","TextValue"=>"I know you'll like it, Mel! Wally and I can build a FUNCTIONAL pearl house for you."],
17464=>["Value"=>17464,"TextKey"=>"剧情ID30430401","TextValue"=>"Wally is so creative! A pearl rooftop. That's beautiful, but wouldn't it be too fragile?"],
17465=>["Value"=>17465,"TextKey"=>"剧情ID30430501","TextValue"=>"Dearest Watt and Wally, can you build it more spacious? I need more space to stock my pearls and shells."],
17466=>["Value"=>17466,"TextKey"=>"剧情ID30430502","TextValue"=>"One sec."],
17467=>["Value"=>17467,"TextKey"=>"剧情ID30430601","TextValue"=>"How about adding some seaweeds as décor?"],
17468=>["Value"=>17468,"TextKey"=>"剧情ID30430701","TextValue"=>"Stunning! Hah-hah, I'm so happy. Can't stop smiling whenever I see the pearl house."],
17469=>["Value"=>17469,"TextKey"=>"剧情ID30430702","TextValue"=>"Aww, Mel, wait a sec. I stole — I mean, borrowed the design sketch from Wally."],
17470=>["Value"=>17470,"TextKey"=>"剧情ID30430801","TextValue"=>"Wow! There are two more spires! This landscape is so glorious that I have never seen it even in my most unstrained dream!"],
17471=>["Value"=>17471,"TextKey"=>"剧情ID30430802","TextValue"=>"It only takes four mansions like this to build a top-notch pearl castle."],
17472=>["Value"=>17472,"TextKey"=>"剧情ID30430901","TextValue"=>"What do you think? Not bad, right? I knew Mel would love those spires."],
17473=>["Value"=>17473,"TextKey"=>"剧情ID30430902","TextValue"=>"Can I look around? Alrighty! I'm coming in! Aha, where's my drum? I want to drop some beats."],
17474=>["Value"=>17474,"TextKey"=>"剧情ID30430903","TextValue"=>"Let me be your accompany, Mel."],
17475=>["Value"=>17475,"TextKey"=>"剧情ID31640301","TextValue"=>"This crown should belong to someone important. Does that ring any bells to you, Aurora?"],
17476=>["Value"=>17476,"TextKey"=>"剧情ID31640302","TextValue"=>"I'm not sure. It doesn't have the Label of my Royal Family. So, I really can't think of anyone to whom it belongs."],
17477=>["Value"=>17477,"TextKey"=>"剧情ID31640401","TextValue"=>"Magnificent gold, workmanship glowed, used as a symbol in poems, represents power the most."],
17478=>["Value"=>17478,"TextKey"=>"剧情ID31640501","TextValue"=>"Inlaid with emerald? Nice work, very much in line with my aesthetic!"],
17479=>["Value"=>17479,"TextKey"=>"剧情ID31640601","TextValue"=>"What? Benjamin just told me such a luxurious crown is not even superior!"],
17480=>["Value"=>17480,"TextKey"=>"剧情ID31640602","TextValue"=>"Yup. I can feel the magic power hidden in the crown is far from the upper limit."],
17481=>["Value"=>17481,"TextKey"=>"剧情ID31640701","TextValue"=>"When the crown's owner came, I wonder if I could borrow to try it on? It is sooo pretty!"],
17482=>["Value"=>17482,"TextKey"=>"剧情ID31640801","TextValue"=>"My! I can feel the magic is vibrating intensely. Its owner will soon arrive!"],
17483=>["Value"=>17483,"TextKey"=>"剧情ID31640901","TextValue"=>"Oh my goodness! Princess Aurora, nice to see you again!"],
17484=>["Value"=>17484,"TextKey"=>"剧情ID31640902","TextValue"=>"No way! I can't believe you are stuck here too! Oi oi, everyone! Let me introduce the King of Lion, Simba."],
17485=>["Value"=>17485,"TextKey"=>"剧情ID31640903","TextValue"=>"I have made a preliminary judgment about the surroundings here. There's no time to delay. Keep constructing castles and expanding our territories."],
17486=>["Value"=>17486,"TextKey"=>"剧情ID30440301","TextValue"=>"This shabby wagon can barely shelter me from the wind and rain."],
17487=>["Value"=>17487,"TextKey"=>"剧情ID30440302","TextValue"=>"Lion King, you are right. We still need more time."],
17488=>["Value"=>17488,"TextKey"=>"剧情ID30440401","TextValue"=>"It is basic. However, that's a great model for further processing."],
17489=>["Value"=>17489,"TextKey"=>"剧情ID30440402","TextValue"=>"Please improve the driver's seat. The long journey shall not be easy."],
17490=>["Value"=>17490,"TextKey"=>"剧情ID30440501","TextValue"=>"Nice! Guest seats also need to be improved. Watt and Wally, can you two please do us one more favor?"],
17491=>["Value"=>17491,"TextKey"=>"剧情ID30440601","TextValue"=>"Woohoo! Comfort level considerably increased. Well, I say we build it more confined. Privacy is no lesser than safety."],
17492=>["Value"=>17492,"TextKey"=>"剧情ID30440701","TextValue"=>"Indeed excellent! I've heard about your craftmanship, Watt and Wally. Too bad my lions only have fluffy paws, and this kind of delicate work is no match for lions."],
17493=>["Value"=>17493,"TextKey"=>"剧情ID30440702","TextValue"=>"Thanks for your appreciation, Lion King! There's still room for improvement. Wait and see what happens!"],
17494=>["Value"=>17494,"TextKey"=>"剧情ID30440801","TextValue"=>"Wally, can you add another story to it? The magic circulation requires height."],
17495=>["Value"=>17495,"TextKey"=>"剧情ID30440802","TextValue"=>"Gotcha! High-ceiling design is my expertise."],
17496=>["Value"=>17496,"TextKey"=>"剧情ID30440901","TextValue"=>"Watt and Wally, do you want to follow me to my Kingdom after all this is finished? I guarantee that you will be treated much better than the Kingdom of Human."],
17497=>["Value"=>17497,"TextKey"=>"剧情ID30440902","TextValue"=>"Simba, I'm right here! I thought you would at least try to avoid me when poaching my staff!"],
17498=>["Value"=>17498,"TextKey"=>"剧情ID30441001","TextValue"=>"This castle means a lot to me. It allows me to live the spontaneous life I love and takes me to wherever I want."],
17499=>["Value"=>17499,"TextKey"=>"剧情ID30441002","TextValue"=>"Simba has been running freely over the fields. No wonder he wants a mobile castle to live in."],
17500=>["Value"=>17500,"TextKey"=>"剧情ID30441003","TextValue"=>"Watt and Wally, please take serious consideration into the advice I gave earlier."],
17501=>["Value"=>17501,"TextKey"=>"剧情ID31650301","TextValue"=>"Wow! It's getting better! But the portion is too small for me."],
17502=>["Value"=>17502,"TextKey"=>"剧情ID31650401","TextValue"=>"The magic around the foods and the table are filling up. "],
17503=>["Value"=>17503,"TextKey"=>"剧情ID31650501","TextValue"=>"I'm a carnivore. But I know Aurora's a sweet tooth. Sweetheart, if you stay out of mine, I'll stay out of yours."],
17504=>["Value"=>17504,"TextKey"=>"剧情ID31650601","TextValue"=>"This reminds me of the old times when I host banquets. Though we are a little short of number, we can still prepare a big meal for dinner tonight!"],
17505=>["Value"=>17505,"TextKey"=>"剧情ID31650701","TextValue"=>"This symbolizes a fairy evening."],
17506=>["Value"=>17506,"TextKey"=>"剧情ID31650801","TextValue"=>"The magic is reaching the pinnacle. We can soon meet the owner of these yummy visions. "],
17507=>["Value"=>17507,"TextKey"=>"剧情ID31650901","TextValue"=>"…"],
17508=>["Value"=>17508,"TextKey"=>"剧情ID31650902","TextValue"=>"Hiya, lovely girl! What's your name?"],
17509=>["Value"=>17509,"TextKey"=>"剧情ID31650903","TextValue"=>"I… ummmm... I don't have a name. They call me "Little Match Girl". Perhaps… maybe... you can call me "Match"?"],
17510=>["Value"=>17510,"TextKey"=>"剧情ID31650904","TextValue"=>"Okay. Don't be afraid, Match. Come in and warm yourself up in our castle."],
17511=>["Value"=>17511,"TextKey"=>"剧情ID30450301","TextValue"=>"What's up, Match. Is this matchbox something you are thinking of?"],
17512=>["Value"=>17512,"TextKey"=>"剧情ID30450302","TextValue"=>"Yes, yes! If I curl up, I can squeeze myself in it, protecting myself against the wind."],
17513=>["Value"=>17513,"TextKey"=>"剧情ID30450401","TextValue"=>"Thank you, Watt! I can't imagine I can own a hut with beams one day. So happy!"],
17514=>["Value"=>17514,"TextKey"=>"剧情ID30450501","TextValue"=>"I can finallyf stand up inside the house. No more curling up. Hooray!"],
17515=>["Value"=>17515,"TextKey"=>"剧情ID30450601","TextValue"=>"Match, I think you'll like this windproof curtain."],
17516=>["Value"=>17516,"TextKey"=>"剧情ID30450602","TextValue"=>"Totally! I can save some matches to warm up now."],
17517=>["Value"=>17517,"TextKey"=>"剧情ID30450701","TextValue"=>"Ta-da~ The high-ceiling design I'm best at!"],
17518=>["Value"=>17518,"TextKey"=>"剧情ID30450702","TextValue"=>"Thank you so much! This is the prettiest house I've ever seen in my life… even better than those rich people's houses on the streets in the past…"],
17519=>["Value"=>17519,"TextKey"=>"剧情ID30450801","TextValue"=>"If you can come up with one request for the house, what would it be?"],
17520=>["Value"=>17520,"TextKey"=>"剧情ID30450802","TextValue"=>"Ahhh… Owning a house is already beyond my expectation. I don't have any requests."],
17521=>["Value"=>17521,"TextKey"=>"剧情ID30450803","TextValue"=>"Not with that attitude, Match! C'mon, think harder! What do you really really really want?"],
17522=>["Value"=>17522,"TextKey"=>"剧情ID30450804","TextValue"=>"Umm… I think… that will be warmth. Yeah! I want it to be super warm!"],
17523=>["Value"=>17523,"TextKey"=>"剧情ID30450901","TextValue"=>"As long as we build four mansions like this, the Little Match Girl will have her private castle!"],
17524=>["Value"=>17524,"TextKey"=>"剧情ID30451001","TextValue"=>"Are you guys serious? … This beautiful castle… is MINE?"],
17525=>["Value"=>17525,"TextKey"=>"剧情ID30451002","TextValue"=>"Of course, my beloved friend! This land is full of dangers. That's why we should value our residences more. "],
17526=>["Value"=>17526,"TextKey"=>"剧情ID30451003","TextValue"=>"Waaahhhh… Thank you! Thank you all!"],
17527=>["Value"=>17527,"TextKey"=>"剧情ID30451004","TextValue"=>"Don't cry. Go take some proper rest and be ready for the upcoming challenges!"],
17528=>["Value"=>17528,"TextKey"=>"剧情ID31660301","TextValue"=>"Fixation was a great idea. However, can we change its frame to a modern design? It doesn't look transparent enough."],
17529=>["Value"=>17529,"TextKey"=>"剧情ID31660401","TextValue"=>"Who would be the lamp holder?"],
17530=>["Value"=>17530,"TextKey"=>"剧情ID31660501","TextValue"=>"The fire is getting so much brighter! Benjamin, do you agree?"],
17531=>["Value"=>17531,"TextKey"=>"剧情ID31660502","TextValue"=>"Indeed, Your Grace. This is a sign of enhanced magic."],
17532=>["Value"=>17532,"TextKey"=>"剧情ID31660601","TextValue"=>"Is this… a pumpkin? *Sweet'o'pumpkin, spooky'o'night* It's a perfect plant for my serenade!"],
17533=>["Value"=>17533,"TextKey"=>"剧情ID31660701","TextValue"=>"A lovely pumpkin lamp. It can be a decorative ornament too."],
17534=>["Value"=>17534,"TextKey"=>"剧情ID31660702","TextValue"=>"It's hard to tell but the magic power it possessed is quite remarkable."],
17535=>["Value"=>17535,"TextKey"=>"剧情ID31660801","TextValue"=>"Did you guys notice that the impression of the pumpkin lamp just changed! It looks more and more like a human… Spooky..."],
17536=>["Value"=>17536,"TextKey"=>"剧情ID31660802","TextValue"=>"I have a hunch that this pumpkin friend will be meeting us soon."],
17537=>["Value"=>17537,"TextKey"=>"剧情ID31660901","TextValue"=>"Greetings, y'all! Ready for the spooky midnight party?"],
17538=>["Value"=>17538,"TextKey"=>"剧情ID31660902","TextValue"=>"Oi, pumpkinhead! Don't scare young kids. By the way, is your head ripe and sweet? I have an idea…"],
17539=>["Value"=>17539,"TextKey"=>"剧情ID31660903","TextValue"=>"Ummm… pumpkins are not edible actually, for they contain a toxic chemical called "pumpkin acid". And please don't call me pumpkinhead, my name is Jack!"],
17540=>["Value"=>17540,"TextKey"=>"剧情ID31660904","TextValue"=>"Alright, Jack. That is a lie. Are you afraid I'm going to eat you?"],
17541=>["Value"=>17541,"TextKey"=>"剧情ID31660905","TextValue"=>"… See you, Aurora!"],
17542=>["Value"=>17542,"TextKey"=>"剧情ID30460301","TextValue"=>"For me, a stack of straws is the best winter jacket against cold."],
17543=>["Value"=>17543,"TextKey"=>"剧情ID30460401","TextValue"=>"Help me think… what are the things people might be startled at first glance? Oh right! Skeleton! I want to put a skeleton on my front gate. "],
17544=>["Value"=>17544,"TextKey"=>"剧情ID30460501","TextValue"=>"Why don't you add a pumpkin to your façade? Just like what I did to mine with carrots."],
17545=>["Value"=>17545,"TextKey"=>"剧情ID30460601","TextValue"=>"Do you want to open a skylight, Mr. Jack? To do that, we have to take off that spooky skeleton."],
17546=>["Value"=>17546,"TextKey"=>"剧情ID30460701","TextValue"=>"I really like it! But I feel that pumpkin can be bigger. Can you help me out?"],
17547=>["Value"=>17547,"TextKey"=>"剧情ID30460702","TextValue"=>"Sure thing. You can always trust Watt with carving."],
17548=>["Value"=>17548,"TextKey"=>"剧情ID30460801","TextValue"=>"Wow, soooooo beautiful! Hem hem, no, I mean… I still need a lantern on it! Yup, a lantern!"],
17549=>["Value"=>17549,"TextKey"=>"剧情ID30460901","TextValue"=>"This mansion looks like a large Jack'o'lantern! Hah-hah-hah, a small J living in a big J!"],
17550=>["Value"=>17550,"TextKey"=>"剧情ID30461001","TextValue"=>"Wow, my pumpkin, my straws, my lantern! Watt and Wally, you two are simply geniuses! I want to announce that you two are officially on top of my... PRANKING LIST!"],
17551=>["Value"=>17551,"TextKey"=>"剧情ID30461002","TextValue"=>"Oh geez, cut me some slacks. But please do not let Watt escape!"],
17552=>["Value"=>17552,"TextKey"=>"剧情ID31670301","TextValue"=>"Look! It's a beautiful round fan full of oriental essence."],
17553=>["Value"=>17553,"TextKey"=>"剧情ID31670302","TextValue"=>"It may become the new inspiration for my music! I can't wait to know who the fan will summon in the end."],
17554=>["Value"=>17554,"TextKey"=>"剧情ID31670401","TextValue"=>"Main ribs are added to the folding fan. The materials are green and feel a bit cold… I like it."],
17555=>["Value"=>17555,"TextKey"=>"剧情ID31670402","TextValue"=>"Is it made of bamboos? They are definitely not native plants which means someone brought it here on purpose."],
17556=>["Value"=>17556,"TextKey"=>"剧情ID31670403","TextValue"=>"Our new friend is getting me more curious. Hurry up and keep merging!"],
17557=>["Value"=>17557,"TextKey"=>"剧情ID31670501","TextValue"=>"Oh see? Now we can fold it!"],
17558=>["Value"=>17558,"TextKey"=>"剧情ID31670502","TextValue"=>"I've seen its benefits. With such a fan in a steaming hot summer, I never have to worry about sweating too much and ruining my hairstyle."],
17559=>["Value"=>17559,"TextKey"=>"剧情ID31670601","TextValue"=>"I spy with my little eye… a stone stunningly green! It's kind of like emerald, but I can tell the difference."],
17560=>["Value"=>17560,"TextKey"=>"剧情ID31670602","TextValue"=>"This is Jade from the East."],
17561=>["Value"=>17561,"TextKey"=>"剧情ID31670603","TextValue"=>"I'm stunned by its beauty. Can it get any prettier?"],
17562=>["Value"=>17562,"TextKey"=>"剧情ID31670701","TextValue"=>"Amazing! The fan just grew bigger, and its new shape reminds of bird's wings."],
17563=>["Value"=>17563,"TextKey"=>"剧情ID31670801","TextValue"=>"Benjamin, come take a closer look! Very powerful magic waves are surging!"],
17564=>["Value"=>17564,"TextKey"=>"剧情ID31670802","TextValue"=>"The formula of the magic in the fan is very distinctive from mine and everybody else's."],
17565=>["Value"=>17565,"TextKey"=>"剧情ID31670803","TextValue"=>"I hope this new friend will brighten my day after its revealation."],
17566=>["Value"=>17566,"TextKey"=>"剧情ID31670901","TextValue"=>"Heh heh heh! Where am I? Nevermind, any foods first please?"],
17567=>["Value"=>17567,"TextKey"=>"剧情ID31670902","TextValue"=>"You must be the new friend we've been expecting to join our team! Welcome, I'm Aurora. "],
17568=>["Value"=>17568,"TextKey"=>"剧情ID31670903","TextValue"=>"Hi, Aurora. I'm Panda. Are you a master? To be honest, as long as your Kung-fu is better than mine, I am willing to follow your lead. C'mon, let's duel!"],
17569=>["Value"=>17569,"TextKey"=>"剧情ID31670904","TextValue"=>"Ka.. Kang-fur? I've never heard of that. Anyways. As long as one of us win the duel, you'll join us right? Huh, easy peasy. Go! Simba, teach him a lesson!"],
17570=>["Value"=>17570,"TextKey"=>"剧情ID31670905","TextValue"=>"I thought you are going to volunteer… Whoa, whoa, they've started the fight!"],
17571=>["Value"=>17571,"TextKey"=>"剧情ID31670906","TextValue"=>"khoff khak khak, I like your style. I am willing to join your crew."],
17572=>["Value"=>17572,"TextKey"=>"剧情ID30470301","TextValue"=>"Wow, fondent bamboos! Yum yum yum!"],
17573=>["Value"=>17573,"TextKey"=>"剧情ID30470302","TextValue"=>"NOOOO, Mr. Pan! They are not for dinner but construction."],
17574=>["Value"=>17574,"TextKey"=>"剧情ID30470401","TextValue"=>"Now the bamboos are nicely prepared! It's ready to go."],
17575=>["Value"=>17575,"TextKey"=>"剧情ID30470402","TextValue"=>"Bamboos are very unique as construction materials. Per their specialty... Wally! Surely we can design an unprecedented new castle, right? "],
17576=>["Value"=>17576,"TextKey"=>"剧情ID30470403","TextValue"=>"Indeed! It's rare for you to offer such a constructive advice here."],
17577=>["Value"=>17577,"TextKey"=>"剧情ID30470501","TextValue"=>"Wow, I can already see the room! I can roll over on the floor!"],
17578=>["Value"=>17578,"TextKey"=>"剧情ID30470502","TextValue"=>"Rolling over is fine. But must restrain yourself from eating the floor!"],
17579=>["Value"=>17579,"TextKey"=>"剧情ID30470601","TextValue"=>"It's just like a candy house to a five-year-old. This is a bamboo house belongs to a panda…"],
17580=>["Value"=>17580,"TextKey"=>"剧情ID30470602","TextValue"=>"That makes sense… Now, I am picturing Watt gnawing on a toffee window."],
17581=>["Value"=>17581,"TextKey"=>"剧情ID30470701","TextValue"=>"Hey, Pan Pan! Come have a look on the new lantern! The blueprint is generously provided by Benjamin. Isn't it joyous?"],
17582=>["Value"=>17582,"TextKey"=>"剧情ID30470702","TextValue"=>"I found the blueprint with the lantern model from your hometown. I hope you'll like it."],
17583=>["Value"=>17583,"TextKey"=>"剧情ID30470703","TextValue"=>"Wow! I love it! Thank you so much! Can I ask for a couple more of these?"],
17584=>["Value"=>17584,"TextKey"=>"剧情ID30470704","TextValue"=>"Coming up!"],
17585=>["Value"=>17585,"TextKey"=>"剧情ID30470801","TextValue"=>"Only Watt and Wally can build an exquisite two-storey architecture with bamboo materials. Real masters you two!"],
17586=>["Value"=>17586,"TextKey"=>"剧情ID30470802","TextValue"=>"You two made more lanterns for me! Thanks! The light will be brighter at night when I practise Kung-fu."],
17587=>["Value"=>17587,"TextKey"=>"剧情ID30470803","TextValue"=>"Can I bother Master Watt and Master Wally to heighten the building for me? I really want to practice somersaults indoor."],
17588=>["Value"=>17588,"TextKey"=>"剧情ID30470901","TextValue"=>"Wow, what a sight! It's both beautiful and practical, and that window design is truly genius."],
17589=>["Value"=>17589,"TextKey"=>"剧情ID30470902","TextValue"=>"Oh my panda god! I never thought bamboo, besides foods, could be used as materials to build such a magnificent mansion."],
17590=>["Value"=>17590,"TextKey"=>"剧情ID30470903","TextValue"=>"With only four bamboo mansions like this, we can witness a magical completion of a wonderful caslte!"],
17591=>["Value"=>17591,"TextKey"=>"剧情ID30470904","TextValue"=>"Pan, you should look forward to it!"],
17592=>["Value"=>17592,"TextKey"=>"剧情ID30471001","TextValue"=>"…Are my eyes okay? I mean the bamboo castle really tears me up!"],
17593=>["Value"=>17593,"TextKey"=>"剧情ID30471002","TextValue"=>"I thought that was certainly great, but I didn't expect you two will surprise me with an even better architecture! Am I in a dream?"],
17594=>["Value"=>17594,"TextKey"=>"剧情ID30471003","TextValue"=>"No big deal, Mr. Panda. Your sweet words are our biggest motivation."],
17595=>["Value"=>17595,"TextKey"=>"剧情ID31680301","TextValue"=>"A service cap!"],
17596=>["Value"=>17596,"TextKey"=>"剧情ID31680302","TextValue"=>"The owner can't be my soldier. Lion warriors do not need caps that limit their moves."],
17597=>["Value"=>17597,"TextKey"=>"剧情ID31680303","TextValue"=>"Guess who is this one will be?"],
17598=>["Value"=>17598,"TextKey"=>"剧情ID31680401","TextValue"=>"The military rank of the cap just got promoted!"],
17599=>["Value"=>17599,"TextKey"=>"剧情ID31680402","TextValue"=>"Umm… it's also a proof of magic power."],
17600=>["Value"=>17600,"TextKey"=>"剧情ID31680501","TextValue"=>"The decoration has been replaced with a golden star. It seems that the power of the cap is getting stronger."],
17601=>["Value"=>17601,"TextKey"=>"剧情ID31680601","TextValue"=>"I can't see which army will it belongs to. But look at this delicate gem, does Melody has any idea?"],
17602=>["Value"=>17602,"TextKey"=>"剧情ID31680602","TextValue"=>"Why Mel would know? By the way, she just left with Rambo for some musical things."],
17603=>["Value"=>17603,"TextKey"=>"剧情ID31680603","TextValue"=>"That's because armys usually hire drummers to boost morale in battles. She might have those kind of experience in the past."],
17604=>["Value"=>17604,"TextKey"=>"剧情ID31680701","TextValue"=>"Wow, what a glorious cap!"],
17605=>["Value"=>17605,"TextKey"=>"剧情ID31680702","TextValue"=>"I feel the cap's owner is… not a human. That's because the vibration of the magic waves doesn't sound like any drum from any human army.  "],
17606=>["Value"=>17606,"TextKey"=>"剧情ID31680801","TextValue"=>"Magic is enhancing! I foresee the soldier is gonna arrive here anytime!"],
17607=>["Value"=>17607,"TextKey"=>"剧情ID31680901","TextValue"=>"Good day, fellas!"],
17608=>["Value"=>17608,"TextKey"=>"剧情ID31680902","TextValue"=>"No way! It's a nutcracker! Good day, Mister! Can I have your name please?"],
17609=>["Value"=>17609,"TextKey"=>"剧情ID31680903","TextValue"=>"Sorry, I don't have one. Name doesn't matter to me at all. My only aspiration is to protect my people and safeguard my country."],
17610=>["Value"=>17610,"TextKey"=>"剧情ID31680904","TextValue"=>"Alrighty, honorary man. Let me introduce you to my friends!"],
17611=>["Value"=>17611,"TextKey"=>"剧情ID30480301","TextValue"=>"I have to admit that toy blocks are the most handy materials in my entire life as a builder. Groovy!"],
17612=>["Value"=>17612,"TextKey"=>"剧情ID30480302","TextValue"=>"Thank y'all! These building bricks makes me feel super homey, just like the little toy castle I grew up in."],
17613=>["Value"=>17613,"TextKey"=>"剧情ID30480401","TextValue"=>"A plus on that big front gate!"],
17614=>["Value"=>17614,"TextKey"=>"剧情ID30480402","TextValue"=>"It's semi finished. We promise we will give the nutcracker a big surprise."],
17615=>["Value"=>17615,"TextKey"=>"剧情ID30480501","TextValue"=>"That's wonderful! Watt and Wally, I'm so grateful. I just one more little favor to ask you… can you build it as solid as concrete?"],
17616=>["Value"=>17616,"TextKey"=>"剧情ID30480502","TextValue"=>"I know why you ask that -- you want to protect us against enemies. Am I right?"],
17617=>["Value"=>17617,"TextKey"=>"剧情ID30480503","TextValue"=>"Yes, Your Grace. Always on standby!"],
17618=>["Value"=>17618,"TextKey"=>"剧情ID30480601","TextValue"=>"Beautiful hut made of toy blocks. What if I "accidentally" fall on it…"],
17619=>["Value"=>17619,"TextKey"=>"剧情ID30480602","TextValue"=>"Nice try, Jack! You little prank doesn't work on my turf. The adhesive is a Wally-Patented technology, which means… it's too good for your pumpkin head to understand."],
17620=>["Value"=>17620,"TextKey"=>"剧情ID30480701","TextValue"=>"Next, let us move onto the lightings. Combat vision is especially vital at night!"],
17621=>["Value"=>17621,"TextKey"=>"剧情ID30480702","TextValue"=>"Roger that, pro!"],
17622=>["Value"=>17622,"TextKey"=>"剧情ID30480801","TextValue"=>"Thanks you for expanding my little house. Yes, it is necessary to have a spacious warehouse for military drills and weapon manufacturing."],
17623=>["Value"=>17623,"TextKey"=>"剧情ID30480802","TextValue"=>"I wonder what will it turns into next? Nevermind. I know one thing for certain that Watt and Wally will never let you down!"],
17624=>["Value"=>17624,"TextKey"=>"剧情ID30480901","TextValue"=>"Spectacular! Living here must feel very safe!"],
17625=>["Value"=>17625,"TextKey"=>"剧情ID30480902","TextValue"=>"We are moving onto external reinforcement next, making it wind-wate-and-fireproof."],
17626=>["Value"=>17626,"TextKey"=>"剧情ID30481001","TextValue"=>"Wow, it is impenetrable and indetructible just by looking at it!"],
17627=>["Value"=>17627,"TextKey"=>"剧情ID30481002","TextValue"=>"May I ask what's the next step will be? Castle construction?"],
17628=>["Value"=>17628,"TextKey"=>"剧情ID30481003","TextValue"=>"You're right, soldier! And we prepared a little surprise for you."],
17629=>["Value"=>17629,"TextKey"=>"剧情ID30481101","TextValue"=>"Wow, that's so nice of you two!"],
17630=>["Value"=>17630,"TextKey"=>"剧情ID30481102","TextValue"=>"Hah hah, don't be shy! We prepared you a 1:1 statue in the outpost location of the castle."],
17631=>["Value"=>17631,"TextKey"=>"剧情ID30481103","TextValue"=>"You are my heroes! This will be a safe and solid camp for everybody in the next adventure."],
17632=>["Value"=>17632,"TextKey"=>"剧情ID99991301","TextValue"=>"Welcome to the <color=#ef933d>Fairy Tale Town</color>, a wonderful world is waiting ahead of you!"],
17633=>["Value"=>17633,"TextKey"=>"剧情ID99991302","TextValue"=>"This Event prepares you tons of rewards, including <color=#ef933d>Brand-new Architecture</color> and <color=#ef933d>Fairy Creatures</color>. Don't miss out the fun experience!"],
17634=>["Value"=>17634,"TextKey"=>"剧情ID99991401","TextValue"=>"All the < color=#ef933d>Point Rewards</color> are listed here. The more points you reach, the more rewards you get."],
17635=>["Value"=>17635,"TextKey"=>"剧情ID99991501","TextValue"=>"Some objects cannot be merged. For example, Thorns can only be harvested by Fairy Creatures. Drag your <color=#ef933d>Fairy Creatures</color> onto <color=#ef933d>Thorns</color> to harvest for some extra rewards."],
17636=>["Value"=>17636,"TextKey"=>"剧情ID99991601","TextValue"=>"There are some mystical creatures living here in the Fairy Tale Town. They'll be your sweet little helpers to harvest Spirit Flowers."],
17637=>["Value"=>17637,"TextKey"=>"剧情ID99991602","TextValue"=>"They are scattered all over the place. Merge certain items to make them appear."],
17638=>["Value"=>17638,"TextKey"=>"剧情ID99991701","TextValue"=>"<color=#ef933d>Wild Rune Orb</color> contains rather powerful magic. Tap it to awake <color=#ef933d>Dormant Lands</color>."],
17639=>["Value"=>17639,"TextKey"=>"剧情ID99991702","TextValue"=>"Wild Rune Orbs can be merged into <color=#ef933d>higher levels</color>, and the higher the level, the stronger the healing power."],
17640=>["Value"=>17640,"TextKey"=>"剧情ID99991801","TextValue"=>"Hey! You made it to the Petting Zoo! I would like to walk you through the "species diversity" here first…"],
17641=>["Value"=>17641,"TextKey"=>"剧情ID99991802","TextValue"=>"It will, I dare say, blow your mind!"],
17642=>["Value"=>17642,"TextKey"=>"剧情ID99991803","TextValue"=>"Let's take a look at the special creatures kept here!"],
17643=>["Value"=>17643,"TextKey"=>"剧情ID99991901","TextValue"=>"According to the sign, this might be a legendary… Ummm… dragon egg!"],
17644=>["Value"=>17644,"TextKey"=>"剧情ID99991902","TextValue"=>"Calm down, dear, calm down. I know it's a lot to digest. "],
17645=>["Value"=>17645,"TextKey"=>"剧情ID99991903","TextValue"=>"Let's cut straight to the chase. This is actually a magical zoo for all fantastic creatures. The dragon egg is nothing compared to what you are about to witness!"],
17646=>["Value"=>17646,"TextKey"=>"剧情ID99992601","TextValue"=>"Abracadabra! This is the first top dragon we've encountered!"],
17647=>["Value"=>17647,"TextKey"=>"剧情ID99992602","TextValue"=>"Ohhh, what is the cutie doing by gripping my top with her teeth… oh no! Where is she dragging me to —"],
17648=>["Value"=>17648,"TextKey"=>"剧情ID99992603","TextValue"=>"Dragon Lair. Oh, I see. Only the top creature in its own colony can stay in a private habitat."],
17649=>["Value"=>17649,"TextKey"=>"剧情ID99992604","TextValue"=>"Helping a friend out makes me feel soul good! HAHAHA!"],
17650=>["Value"=>17650,"TextKey"=>"剧情ID99992101","TextValue"=>"This petting zoo is indeed an adventurous island! There are more secrets await you to explore."],
17651=>["Value"=>17651,"TextKey"=>"剧情ID99992201","TextValue"=>"Is it an apple? Smell so good! The sweet fruity aroma is overflowing in the air!"],
17652=>["Value"=>17652,"TextKey"=>"剧情ID99992202","TextValue"=>"Not to mention the dragon cubs, even those dragon eggs jiggled a bit after smelt the scent of apple."],
17653=>["Value"=>17653,"TextKey"=>"剧情ID99992301","TextValue"=>"Fortunately, I've saved some apple tree seeds for an emergency. Shall be enough for feeding our magical pets."],
17654=>["Value"=>17654,"TextKey"=>"剧情ID99992302","TextValue"=>"Let's merge the seeds into more apple trees. Remember there will be free seeds in stock in the shop every single day. Don't forget to collect!"],
17655=>["Value"=>17655,"TextKey"=>"剧情ID99992401","TextValue"=>"Look! The dragon cubs just brought something back to the lair…"],
17656=>["Value"=>17656,"TextKey"=>"剧情ID99992402","TextValue"=>"A gift for me? Hehe, thank you guys!"],
17657=>["Value"=>17657,"TextKey"=>"剧情ID99992403","TextValue"=>"Rest assured! I'll feed you guys more, more and more apples!"],
17658=>["Value"=>17658,"TextKey"=>"剧情ID99992501","TextValue"=>"Oh oh… where am I? It's completely dark out here but…"],
17659=>["Value"=>17659,"TextKey"=>"剧情ID99992502","TextValue"=>"Somehow, I think I just touched a key-shaped item."],
17660=>["Value"=>17660,"TextKey"=>"剧情ID99992503","TextValue"=>"Alright… a key in the void… where is it leading us to?"],
17661=>["Value"=>17661,"TextKey"=>"剧情ID99992701","TextValue"=>"Tap on any pet in your zoo, then click the <color=#ef933d>Store</color>button to put it in the storage. "],
17662=>["Value"=>17662,"TextKey"=>"剧情ID99992702","TextValue"=>"Tap on any pet in your zoo, then click the <color=#ef933d>Remove</color>button to move it out of the storage."],
17663=>["Value"=>17663,"TextKey"=>"剧情ID99992801","TextValue"=>"This is a <color=#ef933d>Lucky Clover</color> which will only appear while making this special flowers. <color=#ef933d>Clover</color> can be used in Home Design tasks. Let's go take a look."],
17664=>["Value"=>17664,"TextKey"=>"剧情ID99992901","TextValue"=>"</color>Long press chair<color=#ef933d>, then you can change its style. Long press any house furnishing, change it into the style you like."],
17665=>["Value"=>17665,"TextKey"=>"剧情ID13220101","TextValue"=>"What a beautiful egg!"],
17666=>["Value"=>17666,"TextKey"=>"剧情ID13220102","TextValue"=>"I bet it will hatch a beautiful baby too!"],
17667=>["Value"=>17667,"TextKey"=>"剧情ID13220501","TextValue"=>"She's… Pixie Bloom! I can sense a distinct aroma of sweetness when her wings press down against the air."],
17668=>["Value"=>17668,"TextKey"=>"剧情ID13220502","TextValue"=>"We've found a private habitat for pixies. Now they can rest and sleep soundly at home."],
17669=>["Value"=>17669,"TextKey"=>"剧情ID13220503","TextValue"=>"They are all once poor souls displaced in the evil fog. Now wish them good luck with everything!"],
17670=>["Value"=>17670,"TextKey"=>"剧情ID13230101","TextValue"=>"This egg looks very strong and burly!"],
17671=>["Value"=>17671,"TextKey"=>"剧情ID13230102","TextValue"=>"Not sure what species it is, but it feels like a healthy kid."],
17672=>["Value"=>17672,"TextKey"=>"剧情ID13230501","TextValue"=>"It's you, Valley Spirit! Can I visit your place, please?"],
17673=>["Value"=>17673,"TextKey"=>"剧情ID13230502","TextValue"=>"I knew you would like vibrant green!"],
17674=>["Value"=>17674,"TextKey"=>"剧情ID13240101","TextValue"=>"You look so cute as a baby!"],
17675=>["Value"=>17675,"TextKey"=>"剧情ID13240102","TextValue"=>"I'm curious what you'll look like when you grow up."],
17676=>["Value"=>17676,"TextKey"=>"剧情ID13240103","TextValue"=>"Please be patient! I'll do my best at merging!"],
17677=>["Value"=>17677,"TextKey"=>"剧情ID13240501","TextValue"=>"Finally meeting you! Your ancient beauty is beyond my imagination as a divine flower that befell the earth."],
17678=>["Value"=>17678,"TextKey"=>"剧情ID13240502","TextValue"=>"Despite the language barriers… you feel so close."],
17679=>["Value"=>17679,"TextKey"=>"剧情ID13240503","TextValue"=>"Let me show you the way to your private habitat!"],
17680=>["Value"=>17680,"TextKey"=>"剧情ID13250101","TextValue"=>"Ummm. I can't tell who it is."],
17681=>["Value"=>17681,"TextKey"=>"剧情ID13250102","TextValue"=>"It's still too small. That's hard to spot any distinct features."],
17682=>["Value"=>17682,"TextKey"=>"剧情ID13250501","TextValue"=>"Ohhh, the Priest! Nice meeting you!"],
17683=>["Value"=>17683,"TextKey"=>"剧情ID13250502","TextValue"=>"Seriously? You can communicate with the gods. Can I make a wish then?"],
17684=>["Value"=>17684,"TextKey"=>"剧情ID13250503","TextValue"=>"Wait, what? Psychic costs! C'mon, I thought we were friends."],
17685=>["Value"=>17685,"TextKey"=>"剧情ID13260101","TextValue"=>"Are those horns of a goat or a cow?"],
17686=>["Value"=>17686,"TextKey"=>"剧情ID13260102","TextValue"=>"I milked at my aunt's farm when I was a kid, but it turns out…"],
17687=>["Value"=>17687,"TextKey"=>"剧情ID13260103","TextValue"=>"I still couldn't tell farm animals apart…"],
17688=>["Value"=>17688,"TextKey"=>"剧情ID13260501","TextValue"=>"Oh, it turns out to be the Prophet!"],
17689=>["Value"=>17689,"TextKey"=>"剧情ID13260502","TextValue"=>"Everything is possible in this miraculous Petting Zoo."],
17690=>["Value"=>17690,"TextKey"=>"剧情ID13260503","TextValue"=>"Hiya, could I stop by your lovely place for a vanilla iced tea... It's steaming hot out here. Of course, only if it's convenient for you."],
17691=>["Value"=>17691,"TextKey"=>"剧情ID13270101","TextValue"=>"I can hear some fang roaring inside that egg. Better not to mess with it!"],
17692=>["Value"=>17692,"TextKey"=>"剧情ID13270102","TextValue"=>"I'm not afraid of it! In fact, I believe we'll be good friends in the end."],
17693=>["Value"=>17693,"TextKey"=>"剧情ID13270103","TextValue"=>"I don't think we've met before… but you certainly look familiar."],
17694=>["Value"=>17694,"TextKey"=>"剧情ID13270501","TextValue"=>"Wow, a Mega Dragon! Welcome welcome! I have another dragon friend I would like to introduce to you."],
17695=>["Value"=>17695,"TextKey"=>"剧情ID13270502","TextValue"=>"Hope you two won't fight over "shiny rocks"! "],
17696=>["Value"=>17696,"TextKey"=>"剧情ID13280101","TextValue"=>"Finally! Some good primitive style over here!"],
17697=>["Value"=>17697,"TextKey"=>"剧情ID13280102","TextValue"=>"Hear that? A beautiful female voice, calm and resonant."],
17698=>["Value"=>17698,"TextKey"=>"剧情ID13280501","TextValue"=>"Hum… have not we met before? Ohh, I see. You are a Valkyrie, the queen of battles. Am I right?"],
17699=>["Value"=>17699,"TextKey"=>"剧情ID13280502","TextValue"=>"Welcome! I think the world will be seeing a lot more of Valkyrie."],
17700=>["Value"=>17700,"TextKey"=>"剧情ID13280503","TextValue"=>"Can you teach me how to fight? I want to be as cool as you!"],
17701=>["Value"=>17701,"TextKey"=>"剧情ID13290101","TextValue"=>"It's hard to picture what it will look like…"],
17702=>["Value"=>17702,"TextKey"=>"剧情ID13290102","TextValue"=>"Wait… a dart target? Alright, I think our friend is pretty easy to tell then."],
17703=>["Value"=>17703,"TextKey"=>"剧情ID13290103","TextValue"=>"And don't worry, there will be plenty of room for you to practice dart skills."],
17704=>["Value"=>17704,"TextKey"=>"剧情ID13290501","TextValue"=>"Wowww, you never miss!"],
17705=>["Value"=>17705,"TextKey"=>"剧情ID13290502","TextValue"=>"Your bow and arrow look really fun! Hahaha, thank you for lending it to me!"],
17706=>["Value"=>17706,"TextKey"=>"剧情ID13300101","TextValue"=>"The green color of the egg is an eye-catching beauty."],
17707=>["Value"=>17707,"TextKey"=>"剧情ID13300102","TextValue"=>"Have you noticed that the egg looks very botanic?"],
17708=>["Value"=>17708,"TextKey"=>"剧情ID13300501","TextValue"=>"Wow, what a stunning Forest Fairy! "],
17709=>["Value"=>17709,"TextKey"=>"剧情ID13300502","TextValue"=>"To be honest, I really enjoy watching your beautiful wings beating in the moonshine."],
17710=>["Value"=>17710,"TextKey"=>"剧情ID13310101","TextValue"=>"Ok, I hear you. You're a mountain spirit egg. You know what? I believe you! Cause you look invincibly hard!"],
17711=>["Value"=>17711,"TextKey"=>"剧情ID13310102","TextValue"=>"Can I get the yellow flower off the top of your head?"],
17712=>["Value"=>17712,"TextKey"=>"剧情ID13310103","TextValue"=>"Oh, no worries… I was only asking. I'll leave it be."],
17713=>["Value"=>17713,"TextKey"=>"剧情ID13310501","TextValue"=>"You're so adorable… but it might be a good idea if we don't walk side by side…"],
17714=>["Value"=>17714,"TextKey"=>"剧情ID13310502","TextValue"=>"Well, buddy… You're really big and tall. And it kinda hurts my neck every time I look up and talk to you."],
17715=>["Value"=>17715,"TextKey"=>"剧情ID13310503","TextValue"=>"But don't worry. I know a perfect spot where we can talk face to face!"],
17716=>["Value"=>17716,"TextKey"=>"剧情ID13320101","TextValue"=>"That looks so cute! According to my experience, it definitely relates to plants."],
17717=>["Value"=>17717,"TextKey"=>"剧情ID13320102","TextValue"=>"If you don't believe that, I will prove it by merging!"],
17718=>["Value"=>17718,"TextKey"=>"剧情ID13320501","TextValue"=>"Ahem, a sniper?"],
17719=>["Value"=>17719,"TextKey"=>"剧情ID13320502","TextValue"=>"Look at his clothing… it's made of raffia straw. Guess I wasn't 100 percent wrong."],
17720=>["Value"=>17720,"TextKey"=>"剧情ID13710101","TextValue"=>"Wow, a cute snail. It's a regular snail, am I right? Or it also has some sort of magic power?"],
17721=>["Value"=>17721,"TextKey"=>"剧情ID13710102","TextValue"=>"Look at the sprout on its head! That's not so normal."],
17722=>["Value"=>17722,"TextKey"=>"剧情ID13710103","TextValue"=>"In fact, it is the first RARE pet we came across on this island."],
17723=>["Value"=>17723,"TextKey"=>"剧情ID13710601","TextValue"=>"Ooo, you're so adorable! I knew we would like each other the first sight. And you are a big fruit fan!"],
17724=>["Value"=>17724,"TextKey"=>"剧情ID13710602","TextValue"=>"I've got apples in my backpack. Do you want some?"],
17725=>["Value"=>17725,"TextKey"=>"剧情ID13720101","TextValue"=>"OMG! A kitten!!! I can't believe there're fluffy cats that live on this island."],
17726=>["Value"=>17726,"TextKey"=>"剧情ID13720102","TextValue"=>"I guess no one in the world doesn't like cats, right? Cat's purring is so curing!"],
17727=>["Value"=>17727,"TextKey"=>"剧情ID13720103","TextValue"=>"Poor little thing, I'll send you home. Don't worry. Do you wanna play a game together? "],
17728=>["Value"=>17728,"TextKey"=>"剧情ID13720601","TextValue"=>"Wow, you look so beautiful now! Let me take you to where you're from!"],
17729=>["Value"=>17729,"TextKey"=>"剧情ID13720602","TextValue"=>"Since you're back home, let's hang out more often. That's the deal"],
17730=>["Value"=>17730,"TextKey"=>"剧情ID13730101","TextValue"=>"A diadem of classical beauty!"],
17731=>["Value"=>17731,"TextKey"=>"剧情ID13730102","TextValue"=>"I wonder who it belongs to… Must be someone with great power."],
17732=>["Value"=>17732,"TextKey"=>"剧情ID13730601","TextValue"=>"Wow, the legendary Cleopatra who's renowned for her intellect and beauty!"],
17733=>["Value"=>17733,"TextKey"=>"剧情ID13730602","TextValue"=>"Incredible! I didn't expect to meet someone so famous on the island."],
17734=>["Value"=>17734,"TextKey"=>"剧情ID13730603","TextValue"=>"Alright! Let me show you the way to your Palace."],
17735=>["Value"=>17735,"TextKey"=>"剧情ID13740101","TextValue"=>"Ohhh, it's a little fluffy ball."],
17736=>["Value"=>17736,"TextKey"=>"剧情ID13740102","TextValue"=>"Well, never judge a book by its cover. It eats like a beast."],
17737=>["Value"=>17737,"TextKey"=>"剧情ID13740601","TextValue"=>"Who would've known that a cute little fluff ball would grow so fearsome?"],
17738=>["Value"=>17738,"TextKey"=>"剧情ID13740602","TextValue"=>"Take me to your habitat. It should be nice and cozy."],
17739=>["Value"=>17739,"TextKey"=>"剧情ID13740603","TextValue"=>"I'll bring over more apples."],
17740=>["Value"=>17740,"TextKey"=>"剧情ID13750101","TextValue"=>"I like the gentle green on you that reminds me of livelihood and spring."],
17741=>["Value"=>17741,"TextKey"=>"剧情ID13750102","TextValue"=>"The fresh smell of grass reminds me of playing in the backyard at my mom's house when I was little, where I used to play all day long."],
17742=>["Value"=>17742,"TextKey"=>"剧情ID13750103","TextValue"=>"There's always beauty and hope on this island."],
17743=>["Value"=>17743,"TextKey"=>"剧情ID13750601","TextValue"=>"There was always a fresh smell of woods and weeds around the dryads."],
17744=>["Value"=>17744,"TextKey"=>"剧情ID13750602","TextValue"=>"What's your hometown like? It must be a beautiful place to raise such a spirit!"],
17745=>["Value"=>17745,"TextKey"=>"剧情ID13750603","TextValue"=>"What did you say? You have some flower cakes for me. Oh yes!"],
17746=>["Value"=>17746,"TextKey"=>"剧情ID13760101","TextValue"=>"It's a small chubby bird. I remeber there were often birds visiting our garden when I was little, because my mom always fed them their favorite grains."],
17747=>["Value"=>17747,"TextKey"=>"剧情ID13760102","TextValue"=>"In other words, all I need to do to attract magical creatures is prepare enough apples they like."],
17748=>["Value"=>17748,"TextKey"=>"剧情ID13760601","TextValue"=>"You like living on land instead of flying in the sky. Haha, that's a peculiar hobby!"],
17749=>["Value"=>17749,"TextKey"=>"剧情ID13760602","TextValue"=>"Is it because flying is too much work? Are you a lazy birdie?"],
17750=>["Value"=>17750,"TextKey"=>"剧情ID13760603","TextValue"=>"Hahaha, I'm sorry! Please stop pecking me!"],
17751=>["Value"=>17751,"TextKey"=>"剧情ID13770101","TextValue"=>"It's a cute bowknot! I liked it so much when I was a little girl."],
17752=>["Value"=>17752,"TextKey"=>"剧情ID13770102","TextValue"=>"Hem… Benjamin once told me that his mom used to dress him with pink bowknots."],
17753=>["Value"=>17753,"TextKey"=>"剧情ID13770103","TextValue"=>"Oopsy! That was supposed to be a secret! Please don't tell him you know that…"],
17754=>["Value"=>17754,"TextKey"=>"剧情ID13770601","TextValue"=>"Who doesn't like a girl with a lot of energy!"],
17755=>["Value"=>17755,"TextKey"=>"剧情ID13770602","TextValue"=>"You should open a concert on the Petting Zoo island! I will gather all my friends here to support you!"],
17756=>["Value"=>17756,"TextKey"=>"剧情ID13780101","TextValue"=>"Is that a little crocodile egg? Interesting…"],
17757=>["Value"=>17757,"TextKey"=>"剧情ID13780102","TextValue"=>"That's way too cute! Very different from the ones I saw in the textbook."],
17758=>["Value"=>17758,"TextKey"=>"剧情ID13780103","TextValue"=>"I can't really imagine when I feed apples to them. But I'm so excited, anyway!"],
17759=>["Value"=>17759,"TextKey"=>"剧情ID13780601","TextValue"=>"Looking good! Mr. Crocodile! Do you prefer puddles or ponds?"],
17760=>["Value"=>17760,"TextKey"=>"剧情ID13780602","TextValue"=>"Alrighty! Honestly, I'm curious to see what your home looks like. Can you show me, please?"],
17761=>["Value"=>17761,"TextKey"=>"剧情ID13780603","TextValue"=>"Haha, thank you! Let's go."],
17762=>["Value"=>17762,"TextKey"=>"剧情ID13790101","TextValue"=>"I don't know what kind of creature this is"],
17763=>["Value"=>17763,"TextKey"=>"剧情ID13790102","TextValue"=>"Ahhh, is it a mouse? Really? I'm a bit scared…"],
17764=>["Value"=>17764,"TextKey"=>"剧情ID13790103","TextValue"=>"But looking closely, it's different from the mice we see in our world. Alright, I'll be your helper no matter what."],
17765=>["Value"=>17765,"TextKey"=>"剧情ID13790601","TextValue"=>"Mr. Mouse? That's a cool name!"],
17766=>["Value"=>17766,"TextKey"=>"剧情ID13790602","TextValue"=>"Do you like apples? Yes? Great to hear! Because I got nothing but apples here."],
17767=>["Value"=>17767,"TextKey"=>"剧情ID13800101","TextValue"=>"Another type of rare creature…"],
17768=>["Value"=>17768,"TextKey"=>"剧情ID13800102","TextValue"=>"Help me merge! I'm sure we'll see its final stage soon!"],
17769=>["Value"=>17769,"TextKey"=>"剧情ID13800601","TextValue"=>"Hercules! Looking at your massive frame… Respect!"],
17770=>["Value"=>17770,"TextKey"=>"剧情ID13800602","TextValue"=>"You have some treasures for me, really? Awww, thank you. You know obedience is better than politeness. I'll take them all!"],
17771=>["Value"=>17771,"TextKey"=>"剧情ID13810101","TextValue"=>"Hmmm, look like some fish bones."],
17772=>["Value"=>17772,"TextKey"=>"剧情ID13810102","TextValue"=>"But this island is mostly land. Can fish survive here?"],
17773=>["Value"=>17773,"TextKey"=>"剧情ID13810103","TextValue"=>"Oh, I almost forget that there is no place for regular animals. "],
17774=>["Value"=>17774,"TextKey"=>"剧情ID13810601","TextValue"=>"Wow, a giant fish! Kind of ugly but cute?"],
17775=>["Value"=>17775,"TextKey"=>"剧情ID13810602","TextValue"=>"I bet even experienced fishermen would be surprised to see you."],
17776=>["Value"=>17776,"TextKey"=>"剧情ID13810603","TextValue"=>"Let's go have a look at your private habitat!"],
17777=>["Value"=>17777,"TextKey"=>"剧情ID14210101","TextValue"=>"I bet it will hatch a cute girl!"],
17778=>["Value"=>17778,"TextKey"=>"剧情ID14210102","TextValue"=>"Wowww, this is the first EPIC creature we encountered on the island. Merging is going to be even more difficult."],
17779=>["Value"=>17779,"TextKey"=>"剧情ID14210103","TextValue"=>"No worries! I'll try my best to find your way home despite the pressure!"],
17780=>["Value"=>17780,"TextKey"=>"剧情ID14210701","TextValue"=>"Wow, it's a princess from a fairy tale! Are you coming from a castle far, far away?"],
17781=>["Value"=>17781,"TextKey"=>"剧情ID14210702","TextValue"=>"What! You snuck out of the castle at night?? Do you wanna go back?"],
17782=>["Value"=>17782,"TextKey"=>"剧情ID14210703","TextValue"=>"Okay, I know. I'll find you a nice place to live here."],
17783=>["Value"=>17783,"TextKey"=>"剧情ID14220101","TextValue"=>"It seems like something made of snowflakes. My fingertips felt pretty chill and cold when I touched its surface."],
17784=>["Value"=>17784,"TextKey"=>"剧情ID14220102","TextValue"=>"Will it melt in the summer?"],
17785=>["Value"=>17785,"TextKey"=>"剧情ID14220701","TextValue"=>"Can you play outdoor in the summer? This island is warm as spring all year round. I'm afraid that you'll be in danger…"],
17786=>["Value"=>17786,"TextKey"=>"剧情ID14220702","TextValue"=>"Wow, you are a snowman with an automatic cooling system. That's cool to hear!"],
17787=>["Value"=>17787,"TextKey"=>"剧情ID14230101","TextValue"=>"It looks like a cute fox!"],
17788=>["Value"=>17788,"TextKey"=>"剧情ID14230102","TextValue"=>"I've encountered one in a town where the ecological system is well protected."],
17789=>["Value"=>17789,"TextKey"=>"剧情ID14230701","TextValue"=>"Wow, look at you now! So glamourous! No wonder everyone adores you!"],
17790=>["Value"=>17790,"TextKey"=>"剧情ID14230702","TextValue"=>"No need to hurry. I'm the one who's gonna bring you home. Come with me!"],
17791=>["Value"=>17791,"TextKey"=>"剧情ID14240101","TextValue"=>"That's a cute creature. It's hard to tell what species it is tho."],
17792=>["Value"=>17792,"TextKey"=>"剧情ID14240102","TextValue"=>"I hope I can collect more of you, then I'll merge you into the final stage. Can't wait to see it!"],
17793=>["Value"=>17793,"TextKey"=>"剧情ID14240701","TextValue"=>"Hah hah hah! Did you say your name is Dumb-dumb Dragon? That suits you well."],
17794=>["Value"=>17794,"TextKey"=>"剧情ID14240702","TextValue"=>"Don't leave me alone, please. I saved you an apple! Can we be friends now?"],
17795=>["Value"=>17795,"TextKey"=>"剧情ID14240703","TextValue"=>"Oh yeah, I always keep my promise!"],
17796=>["Value"=>17796,"TextKey"=>"剧情ID14250101","TextValue"=>"Another epic creature! Can't wait to see what it will look like when it grows up."],
17797=>["Value"=>17797,"TextKey"=>"剧情ID14250102","TextValue"=>"I have to find more apples. I don't want to let you starve."],
17798=>["Value"=>17798,"TextKey"=>"剧情ID14250701","TextValue"=>"Where do hippos live? In the river or lake?"],
17799=>["Value"=>17799,"TextKey"=>"剧情ID14250702","TextValue"=>"I've got apples for you. See? I'm a good friend! "],
17800=>["Value"=>17800,"TextKey"=>"剧情ID14250703","TextValue"=>"Hah hah, slow down! I'll bring over more apples to your habitat later."],
17801=>["Value"=>17801,"TextKey"=>"剧情ID14260101","TextValue"=>"A pretty cowboy hat! Will it be a cowboy?"],
17802=>["Value"=>17802,"TextKey"=>"剧情ID14260102","TextValue"=>"Anyway, I'll have to find out more about your kind to know the answer."],
17803=>["Value"=>17803,"TextKey"=>"剧情ID14260701","TextValue"=>"Got it! Your home is a desert, and a face mask is a must-have for breathing in sandy weather."],
17804=>["Value"=>17804,"TextKey"=>"剧情ID14260702","TextValue"=>"Thanks for inviting me. I sure do want to visit your habitat!"],
17805=>["Value"=>17805,"TextKey"=>"剧情ID14270101","TextValue"=>"It certainly is a long way to take helping all magical creatures to find their way home."],
17806=>["Value"=>17806,"TextKey"=>"剧情ID14270102","TextValue"=>"See? Another companion! Look at its trunk!"],
17807=>["Value"=>17807,"TextKey"=>"剧情ID14270103","TextValue"=>"I'm thinking this might be a baby elephant. "],
17808=>["Value"=>17808,"TextKey"=>"剧情ID14270701","TextValue"=>"Wow, a giant mammoth!"],
17809=>["Value"=>17809,"TextKey"=>"剧情ID14270702","TextValue"=>"Am I having a delusion? Or the ground seemed to tremble with every step you take."],
17810=>["Value"=>17810,"TextKey"=>"剧情ID14270703","TextValue"=>"Woohoo! Petting Zoo is a vast, vast land. There are many places we've never set our foot in."],
17811=>["Value"=>17811,"TextKey"=>"剧情ID14280101","TextValue"=>"Look at this little pumpkin. It's growing so fast!"],
17812=>["Value"=>17812,"TextKey"=>"剧情ID14280102","TextValue"=>"Wow, there are eyes on it! Will it be jack-o-lantern who's always scaring people around during the Halloween season?"],
17813=>["Value"=>17813,"TextKey"=>"剧情ID14280103","TextValue"=>"Hem, you know what —— I'm ready! I will not be scared! Bring it on!"],
17814=>["Value"=>17814,"TextKey"=>"剧情ID14280701","TextValue"=>"Pumpkin fairy! The skirt exudes the sweet smell of pumpkin…"],
17815=>["Value"=>17815,"TextKey"=>"剧情ID14280702","TextValue"=>"You're fabulous! Do you live inside a pumpkin?"],
17816=>["Value"=>17816,"TextKey"=>"剧情ID14280703","TextValue"=>"Ha, I guessed it right! Can I stop by your place, please?"],
17817=>["Value"=>17817,"TextKey"=>"剧情ID14290101","TextValue"=>"A new creature at the EPIC level!"],
17818=>["Value"=>17818,"TextKey"=>"剧情ID14290102","TextValue"=>"It has a teenage look but a very sophisticated personality!"],
17819=>["Value"=>17819,"TextKey"=>"剧情ID14290701","TextValue"=>"I believe you've got strong power since you're armored from head to toe."],
17820=>["Value"=>17820,"TextKey"=>"剧情ID14290702","TextValue"=>"Am I scared? No way! I'm just a little curious do you feel hot inside the armor."],
17821=>["Value"=>17821,"TextKey"=>"剧情ID14290703","TextValue"=>"Hah! How about going back to your habitat and getting a change!"],
17822=>["Value"=>17822,"TextKey"=>"剧情ID14300101","TextValue"=>"A monkey baby! Adorable!"],
17823=>["Value"=>17823,"TextKey"=>"剧情ID14300102","TextValue"=>"When I was little, I used to cry and beg my mother to get a little monkey as a pet. Of course, she said no."],
17824=>["Value"=>17824,"TextKey"=>"剧情ID14300103","TextValue"=>"But now I have a monkey friend who's willing to play with me."],
17825=>["Value"=>17825,"TextKey"=>"剧情ID14300701","TextValue"=>"Looking good! Like a professional chef!"],
17826=>["Value"=>17826,"TextKey"=>"剧情ID14300702","TextValue"=>"I would be happy to try out your recipes if possible."],
17827=>["Value"=>17827,"TextKey"=>"剧情ID14300703","TextValue"=>"Of course, I'll bring apples as a gift."],
17828=>["Value"=>17828,"TextKey"=>"剧情ID14310101","TextValue"=>"I thought I'd already become a senior member of the Petting Zoo."],
17829=>["Value"=>17829,"TextKey"=>"剧情ID14310102","TextValue"=>"But it turns out there's still a creature I don't really recognize."],
17830=>["Value"=>17830,"TextKey"=>"剧情ID14310103","TextValue"=>"I have to update my island atlas now!"],
17831=>["Value"=>17831,"TextKey"=>"剧情ID14310701","TextValue"=>"Greetings! You look much more mature than me."],
17832=>["Value"=>17832,"TextKey"=>"剧情ID14310702","TextValue"=>"Sorry, I don't quite get what you said. Honestly, I wasn't a straight-A-student back in school."],
17833=>["Value"=>17833,"TextKey"=>"剧情ID14310703","TextValue"=>"Alright, I'll be happy to stop by your place. Please explain those topics slowly to me this time."],
17834=>["Value"=>17834,"TextKey"=>"剧情ID99970201","TextValue"=>"Wow, more fog cleared! Let's make the most of the lands!"],
17835=>["Value"=>17835,"TextKey"=>"剧情ID99970202","TextValue"=>"We found more dragon eggs!"],
17836=>["Value"=>17836,"TextKey"=>"剧情ID99970301","TextValue"=>"There's a lot of good stuff hidden in the fog."],
17837=>["Value"=>17837,"TextKey"=>"剧情ID99970302","TextValue"=>"Such an adventure! Not to mention all those treasures we just discovered!"],
17838=>["Value"=>17838,"TextKey"=>"剧情ID99970401","TextValue"=>"It's fun to stay in the fog at first…"],
17839=>["Value"=>17839,"TextKey"=>"剧情ID99970402","TextValue"=>"But the fog can be evil sometimes… it can make people go missing…"],
17840=>["Value"=>17840,"TextKey"=>"剧情ID99970501","TextValue"=>"Another magical creature was discovered! Hooray!"],
17841=>["Value"=>17841,"TextKey"=>"剧情ID99970502","TextValue"=>"Rest assured! I'll find you guys a sweet home!"],
17842=>["Value"=>17842,"TextKey"=>"剧情ID99970601","TextValue"=>"This island, especially the Petting Zoo, is so miraculous!"],
17843=>["Value"=>17843,"TextKey"=>"剧情ID99970602","TextValue"=>"Wow, more fog cleared! Let's make the most of the lands!"],
17844=>["Value"=>17844,"TextKey"=>"剧情ID99970701","TextValue"=>"A sense of freshness is something that will never be lacking over here."],
17845=>["Value"=>17845,"TextKey"=>"剧情ID99970702","TextValue"=>"There are always surprises hidden in the fog."],
17846=>["Value"=>17846,"TextKey"=>"剧情ID99970801","TextValue"=>"Wow, more fog cleared! Let's make the most of the lands!"],
17847=>["Value"=>17847,"TextKey"=>"剧情ID99970802","TextValue"=>"Hah hah, another cutie by my side! "],
17848=>["Value"=>17848,"TextKey"=>"剧情ID99970901","TextValue"=>"Look, there are treasure chests and golds!"],
17849=>["Value"=>17849,"TextKey"=>"剧情ID99970902","TextValue"=>"There will be so many more rewards waiting for us."],
17850=>["Value"=>17850,"TextKey"=>"剧情ID99971001","TextValue"=>"I miss Benjamin. He'll be so thrilled seeing all these surprises we discovered!"],
17851=>["Value"=>17851,"TextKey"=>"剧情ID99971101","TextValue"=>"Oh, more apples! It's never too much to feed our magical pets!"],
17852=>["Value"=>17852,"TextKey"=>"剧情ID99971102","TextValue"=>"Continue to work! Oh right, there are free apple seeds in Shop every single day!"],
17853=>["Value"=>17853,"TextKey"=>"剧情ID99971201","TextValue"=>"Magical creatures who find their way home will gain infinite power!"],
17854=>["Value"=>17854,"TextKey"=>"剧情ID99971202","TextValue"=>"The infinite power will help them to clear the fog."],
17855=>["Value"=>17855,"TextKey"=>"剧情ID99971301","TextValue"=>"Look, a new friend! You're so adorable!"],
17856=>["Value"=>17856,"TextKey"=>"剧情ID99971302","TextValue"=>"Now we have more spaces for them to sleep!"],
17857=>["Value"=>17857,"TextKey"=>"剧情ID99971401","TextValue"=>"In a word, we should build a positive routine."],
17858=>["Value"=>17858,"TextKey"=>"剧情ID99971402","TextValue"=>"Discover more pets and open up more lands."],
17859=>["Value"=>17859,"TextKey"=>"剧情ID99971501","TextValue"=>"Delicious apples! Let's feed them to our cute pet friends!"],
17860=>["Value"=>17860,"TextKey"=>"剧情ID99971502","TextValue"=>"Wow, more fog cleared! Let's make the most of the lands!"],
17861=>["Value"=>17861,"TextKey"=>"剧情ID99971601","TextValue"=>"Golds are scattered all over the place. Be my guest!"],
17862=>["Value"=>17862,"TextKey"=>"剧情ID99971602","TextValue"=>"If we keep accumulating the golds, I think I'll be retired soon!"],
17863=>["Value"=>17863,"TextKey"=>"剧情ID99971701","TextValue"=>"Wow, more fog cleared! Let's make the most of the lands!"],
17864=>["Value"=>17864,"TextKey"=>"剧情ID99971702","TextValue"=>"More treasures! Oh yeah!"],
17865=>["Value"=>17865,"TextKey"=>"剧情ID99971801","TextValue"=>"There are more lands under the fog this time."],
17866=>["Value"=>17866,"TextKey"=>"剧情ID99971802","TextValue"=>"If you're short of land, don't forget to use your storage for pets."],
17867=>["Value"=>17867,"TextKey"=>"剧情ID99971901","TextValue"=>"Wow, there are more lands under the fog this time."],
17868=>["Value"=>17868,"TextKey"=>"剧情ID99971902","TextValue"=>"And more apples! Like the pets like to say: "the more, the merrier!""],
17869=>["Value"=>17869,"TextKey"=>"剧情ID99972001","TextValue"=>"Look, a new face we've never seen before!"],
17870=>["Value"=>17870,"TextKey"=>"剧情ID99972002","TextValue"=>"Let me get a closer look!"],
17871=>["Value"=>17871,"TextKey"=>"剧情ID99972101","TextValue"=>"Pick up the gold. We can still use it when we get back to the town."],
