17876=>["Value"=>17876,"TextKey"=>"剧情ID99972401","TextValue"=>"Look, a new friend! You're so adorable!"],
17877=>["Value"=>17877,"TextKey"=>"剧情ID99972501","TextValue"=>"Shiny rocks… I mean Rubies! We can still use it when we get back to the town."],
17878=>["Value"=>17878,"TextKey"=>"剧情ID99972502","TextValue"=>"Just like golds! The more, the merrier!"],
