17880=>["Value"=>17880,"TextKey"=>"剧情ID99972602","TextValue"=>"Let's make habitats for our new pet friends!"],
17881=>["Value"=>17881,"TextKey"=>"剧情ID99972701","TextValue"=>"Use lands for growing apple trees or keeping more pets? This is a question."],
17882=>["Value"=>17882,"TextKey"=>"剧情ID99972702","TextValue"=>"Finally, more lands!"],
17883=>["Value"=>17883,"TextKey"=>"剧情ID99972801","TextValue"=>"Wow, more fog cleared! Let's make the most of the lands!"],
17884=>["Value"=>17884,"TextKey"=>"剧情ID99972802","TextValue"=>"Rest assured! We'll make the pets feel like home."],
17885=>["Value"=>17885,"TextKey"=>"剧情ID99972901","TextValue"=>"New pets are coming! And more Rubies!"],
17886=>["Value"=>17886,"TextKey"=>"剧情ID99972902","TextValue"=>"Rest assured! You'll feel like at home in our zoo."],
17887=>["Value"=>17887,"TextKey"=>"剧情ID99973001","TextValue"=>"Rubies can be collected or merged into higher levels!"],
17888=>["Value"=>17888,"TextKey"=>"剧情ID99973002","TextValue"=>"As for lands… all I want to say is the more, the merrier!"],
17889=>["Value"=>17889,"TextKey"=>"剧情ID99973101","TextValue"=>"I smell sweet apples!"],
17890=>["Value"=>17890,"TextKey"=>"剧情ID99973102","TextValue"=>"Hah hah, pets are jiggles because of apples."],
17891=>["Value"=>17891,"TextKey"=>"剧情ID99973201","TextValue"=>"Golds and new pets are all hidden in the fog."],
17892=>["Value"=>17892,"TextKey"=>"剧情ID99973202","TextValue"=>"Nobody will hate a big surprise. Nobody."],
17893=>["Value"=>17893,"TextKey"=>"剧情ID99973301","TextValue"=>"Groovy! I'm in dire need of more Rubies and Golds."],
