17923=>["Value"=>17923,"TextKey"=>"剧情ID101000101","TextValue"=>"Okay... This is the so-called mansion newly purchased by my young master as an "investment"!?"],
17924=>["Value"=>17924,"TextKey"=>"剧情ID101000201","TextValue"=>"Ahem! Ahem! It is so dusty..."],
17925=>["Value"=>17925,"TextKey"=>"剧情ID101000202","TextValue"=>"Everything looks so deserted. Even the floor is squeaking."],
17926=>["Value"=>17926,"TextKey"=>"剧情ID101000301","TextValue"=>"Looking at its layout and furnishing, I think this house must be hundreds of years old."],
17927=>["Value"=>17927,"TextKey"=>"剧情ID101000401","TextValue"=>"Renovation is going to be some big job."],
17928=>["Value"=>17928,"TextKey"=>"剧情ID101000402","TextValue"=>"Graduated valedictorian from the Royal Butler College, I'll be in charge of the house renovation and another undercover mission — to help him win Miss Aurora over!"],
17929=>["Value"=>17929,"TextKey"=>"剧情ID101000403","TextValue"=>"If things go well, there'll be a grand wedding for me to plan in the future. "],
17930=>["Value"=>17930,"TextKey"=>"剧情ID101000501","TextValue"=>"So, our primary task now is to invite Miss Aurora over from Greenville Town."],
17931=>["Value"=>17931,"TextKey"=>"剧情ID101010101","TextValue"=>"Excuse me. Here is???"],
17932=>["Value"=>17932,"TextKey"=>"剧情ID101010102","TextValue"=>"Hi, Miss Aurora. I hope you just had a wonderful trip."],
17933=>["Value"=>17933,"TextKey"=>"剧情ID101010103","TextValue"=>"Please allow me to introduce myself: My name is Merlin. And I'll be in charge of this old house's furnishing till it's done."],
17934=>["Value"=>17934,"TextKey"=>"剧情ID101010104","TextValue"=>"Hi, Mr. Merlin… "],
17935=>["Value"=>17935,"TextKey"=>"剧情ID101010201","TextValue"=>"Wait for a second. What? Why did you take me to my auntie's house?"],
17936=>["Value"=>17936,"TextKey"=>"剧情ID101010202","TextValue"=>"She'd told me that she sold it cause she couldn't afford all the furnishing and management fees."],
17937=>["Value"=>17937,"TextKey"=>"剧情ID101010203","TextValue"=>"You're right. My young master happens to be the buyer."],
17938=>["Value"=>17938,"TextKey"=>"剧情ID101010204","TextValue"=>"And I, as assigned, will renovate and redecorate the house you grew up in according to your taste and requests."],
17939=>["Value"=>17939,"TextKey"=>"剧情ID101010301","TextValue"=>"Moreover, I beg your pardon for my underprepared invitation. It's a big surprise to me too."],
17940=>["Value"=>17940,"TextKey"=>"剧情ID101010302","TextValue"=>"As the only hotel nearby is fully occupied, I may have to ask you to stay here for the night."],
17941=>["Value"=>17941,"TextKey"=>"剧情ID101010303","TextValue"=>"But please trust me, I will prepare you a clean and cozy room by the end of the sun setting."],
17942=>["Value"=>17942,"TextKey"=>"剧情ID101010401","TextValue"=>"I'm totally lost…"],
17943=>["Value"=>17943,"TextKey"=>"剧情ID101010402","TextValue"=>"Sorry, who are you? And your young master? Is this a prank? "],
17944=>["Value"=>17944,"TextKey"=>"剧情ID101010403","TextValue"=>"And wait, how did you know about my childhood?"],
17945=>["Value"=>17945,"TextKey"=>"剧情ID101010501","TextValue"=>"Gosh, I got no time for your riddles——"],
17946=>["Value"=>17946,"TextKey"=>"剧情ID101010502","TextValue"=>"Watch out!!"],
17947=>["Value"=>17947,"TextKey"=>"剧情ID101010601","TextValue"=>"Miss Aurora, please be careful of those broken glasses on the floor."],
17948=>["Value"=>17948,"TextKey"=>"剧情ID101010602","TextValue"=>"I promise I'll explain every detail later. Just give me a few seconds to sweep the floor first."],
17949=>["Value"=>17949,"TextKey"=>"剧情ID101010603","TextValue"=>"My young master will be very upset if you get hurt under my watch."],
17950=>["Value"=>17950,"TextKey"=>"剧情ID101020201","TextValue"=>"Phew! I'm glad that's cleaned up."],
17951=>["Value"=>17951,"TextKey"=>"剧情ID101020301","TextValue"=>"Why are you doing all this?"],
17952=>["Value"=>17952,"TextKey"=>"剧情ID101020302","TextValue"=>"Yes, of course I don't want to say goodbye to my childhood home, but it's auntie's property afterall. This house has nothing to do with me after she sold it."],
17953=>["Value"=>17953,"TextKey"=>"剧情ID101020303","TextValue"=>"Why do you take me back here?"],
17954=>["Value"=>17954,"TextKey"=>"剧情ID101020304","TextValue"=>"Well… I'll explain everything. Here are the files."],
17955=>["Value"=>17955,"TextKey"=>"剧情ID101020401","TextValue"=>"Oh no, they're scattered all over."],
17956=>["Value"=>17956,"TextKey"=>"剧情ID101020402","TextValue"=>"It must be the wind. I just opened the window to air the room."],
17957=>["Value"=>17957,"TextKey"=>"剧情ID101020501","TextValue"=>"My bad. Please let me sort out the orders before reading."],
17958=>["Value"=>17958,"TextKey"=>"剧情ID101030201","TextValue"=>"Here they are. All sorted out."],
17959=>["Value"=>17959,"TextKey"=>"剧情ID101030202","TextValue"=>"You'll understand everything after reading."],
17960=>["Value"=>17960,"TextKey"=>"剧情ID101030301","TextValue"=>"Wow… look at the piles."],
17961=>["Value"=>17961,"TextKey"=>"剧情ID101030401","TextValue"=>"Yeah, I know. Why don't you sit down here on the sofa? Just give me one minute for a quick clean."],
17962=>["Value"=>17962,"TextKey"=>"剧情ID101040201","TextValue"=>"Wow, you're really good at your job. I'm impressed."],
17963=>["Value"=>17963,"TextKey"=>"剧情ID101040202","TextValue"=>"I'm more than flattered. Organizing things in the right way is my expertise."],
17964=>["Value"=>17964,"TextKey"=>"剧情ID101040203","TextValue"=>"I also brought the property archives. Please have a look."],
17965=>["Value"=>17965,"TextKey"=>"剧情ID101040301","TextValue"=>"Merlin presented property archives to Aurora…"],
17966=>["Value"=>17966,"TextKey"=>"剧情ID101040401","TextValue"=>"Sighhh. I'm even more confused. Why is my name written on these archives?"],
17967=>["Value"=>17967,"TextKey"=>"剧情ID101040402","TextValue"=>"That's a good question. As soon as you sign it, the house will legally be yours, Miss Aurora."],
17968=>["Value"=>17968,"TextKey"=>"剧情ID101040403","TextValue"=>"Am I dreaming?! Who is your master? Tell me at once."],
17969=>["Value"=>17969,"TextKey"=>"剧情ID101040404","TextValue"=>"Sorry, young lady. I can't say much without his permission."],
17970=>["Value"=>17970,"TextKey"=>"剧情ID101040405","TextValue"=>"But he's on his way to meet you. And that'll be tomorrow if everything goes well."],
17971=>["Value"=>17971,"TextKey"=>"剧情ID101040406","TextValue"=>"Alright, listen. You look like a decent person, but I will not accept anything, okay? There is no free lunch."],
17972=>["Value"=>17972,"TextKey"=>"剧情ID101040407","TextValue"=>"I appreciate your rationality, but it's more than just a free lunch. Instead, it's more like a job offer from my perspective."],
17973=>["Value"=>17973,"TextKey"=>"剧情ID101040408","TextValue"=>"Or rather a challenge... to you. "],
17974=>["Value"=>17974,"TextKey"=>"剧情ID101040409","TextValue"=>"What does that suppose to mean?"],
17975=>["Value"=>17975,"TextKey"=>"剧情ID101040501","TextValue"=>"Here are the things your auntie didn't take away when she moved out."],
17976=>["Value"=>17976,"TextKey"=>"剧情ID101040502","TextValue"=>"Well… where did I put it? The blueprint…"],
17977=>["Value"=>17977,"TextKey"=>"剧情ID101050201","TextValue"=>"Ahhh, here it is!"],
17978=>["Value"=>17978,"TextKey"=>"剧情ID101050301","TextValue"=>"Oh, that's the bakery my auntie wanted to open. You know, she's literally the best baker in the world. I learned everything from her."],
17979=>["Value"=>17979,"TextKey"=>"剧情ID101050302","TextValue"=>"But now… the whole town is about to collapse. Don't even mention a small bakery."],
17980=>["Value"=>17980,"TextKey"=>"剧情ID101050303","TextValue"=>"Touche. Due to the long-term corruption of Greenville officials, the town is in a state of severe deficit and is mired in a financial crisis."],
17981=>["Value"=>17981,"TextKey"=>"剧情ID101050304","TextValue"=>"At the same time, you quit your well-paid job in the city and came here to reconstruct the town."],
17982=>["Value"=>17982,"TextKey"=>"剧情ID101050401","TextValue"=>"How did you learn about all this? That seriously creeps me out."],
17983=>["Value"=>17983,"TextKey"=>"剧情ID101050402","TextValue"=>"That's not the case, Miss Aurora."],
17984=>["Value"=>17984,"TextKey"=>"剧情ID101050403","TextValue"=>"Please have a look at this."],
17985=>["Value"=>17985,"TextKey"=>"剧情ID101050501","TextValue"=>"Merlin presented a piece of paper to Aurora"],
17986=>["Value"=>17986,"TextKey"=>"剧情ID101050601","TextValue"=>"…Greenville Reconstruction Fund? Intriging..."],
17987=>["Value"=>17987,"TextKey"=>"剧情ID101050602","TextValue"=>"As you know, Greenville has a very long history and excellent culture and customs. All it lacks is a great person in charge."],
17988=>["Value"=>17988,"TextKey"=>"剧情ID101050603","TextValue"=>"After the recent board meeting of Greenville Fund, we think you'll be the right person to take the role."],
17989=>["Value"=>17989,"TextKey"=>"剧情ID101050604","TextValue"=>"The fund will be providing financial support in every possible way for the town's reconstruction. As for this house… it will be your pre-paid salary. We sincerely hope you can make contributions worthy of this house."],
17990=>["Value"=>17990,"TextKey"=>"剧情ID101050605","TextValue"=>"…"],
17991=>["Value"=>17991,"TextKey"=>"剧情ID101050606","TextValue"=>"I see your point now. This is so not a free lunch."],
17992=>["Value"=>17992,"TextKey"=>"剧情ID101050607","TextValue"=>"Well… I'm not so sure if I'm good enough to accept this house and… the offer."],
17993=>["Value"=>17993,"TextKey"=>"剧情ID101050608","TextValue"=>"You're being too nervous, Miss. I believe once you get it started, everything else will just flow."],
17994=>["Value"=>17994,"TextKey"=>"剧情ID101050609","TextValue"=>"An email was sent to you by the Greenville Fund couple of days ago. I guess you didn't read it."],
17995=>["Value"=>17995,"TextKey"=>"剧情ID101050610","TextValue"=>"Oh oops… I did read that one, but I thought it was spam…"],
17996=>["Value"=>17996,"TextKey"=>"剧情ID101050611","TextValue"=>"That's totally logical. I can resend it to you if you want to read again."],
17997=>["Value"=>17997,"TextKey"=>"剧情ID101050701","TextValue"=>"This computer looks like an antique. Are you sure it's still working?"],
17998=>["Value"=>17998,"TextKey"=>"剧情ID101050702","TextValue"=>"Let's sort it out first..."],
17999=>["Value"=>17999,"TextKey"=>"剧情ID101060201","TextValue"=>"Umm… well…"],
18000=>["Value"=>18000,"TextKey"=>"剧情ID101060202","TextValue"=>"What's wrong, Merlin?"],
18001=>["Value"=>18001,"TextKey"=>"剧情ID101060301","TextValue"=>"To be honest, I'm not so good at using electronics… "],
18002=>["Value"=>18002,"TextKey"=>"剧情ID101060302","TextValue"=>"Oh, no worries. Let me do it."],
18003=>["Value"=>18003,"TextKey"=>"剧情ID101060401","TextValue"=>"It's working, slowly, but good enough to read the email."],
18004=>["Value"=>18004,"TextKey"=>"剧情ID101060402","TextValue"=>"You mean this one, right?"],
18005=>["Value"=>18005,"TextKey"=>"剧情ID101060403","TextValue"=>"Yes, it is!"],
18006=>["Value"=>18006,"TextKey"=>"剧情ID101060404","TextValue"=>"About the foundation and rebuilding the town and some of your responsibilities, it's all in there. Please have a look and revise it at your discretion"],
18007=>["Value"=>18007,"TextKey"=>"剧情ID101060405","TextValue"=>"Good, thank you."],
18008=>["Value"=>18008,"TextKey"=>"剧情ID101060406","TextValue"=>"I'll take advantage of this time to tidy up the room."],
18009=>["Value"=>18009,"TextKey"=>"剧情ID101060501","TextValue"=>"There are still broken glasses on the rug. Well, I'll just replace it with a new one."],
18010=>["Value"=>18010,"TextKey"=>"剧情ID101070201","TextValue"=>"Merlin, I am almost finished here."],
18011=>["Value"=>18011,"TextKey"=>"剧情ID101070301","TextValue"=>"Watch out!"],
18012=>["Value"=>18012,"TextKey"=>"剧情ID101070401","TextValue"=>"Ouch…"],
18013=>["Value"=>18013,"TextKey"=>"剧情ID101070402","TextValue"=>"It's the ancient floor, fragile and full of holes."],
18014=>["Value"=>18014,"TextKey"=>"剧情ID101070403","TextValue"=>"Are you hurt? Let me see."],
18015=>["Value"=>18015,"TextKey"=>"剧情ID101070501","TextValue"=>"Merlin helped Aurora with the bruise…"],
18016=>["Value"=>18016,"TextKey"=>"剧情ID101070502","TextValue"=>"I'm so sorry, Miss. It's all my fault."],
18017=>["Value"=>18017,"TextKey"=>"剧情ID101070601","TextValue"=>"Please give me a chance to amend it. "],
18018=>["Value"=>18018,"TextKey"=>"剧情ID101070602","TextValue"=>"You'll just go sit and relax. I'll fix the floor right away."],
18019=>["Value"=>18019,"TextKey"=>"剧情ID101080201","TextValue"=>"Phew, so glad I ordered those floors in advance."],
18020=>["Value"=>18020,"TextKey"=>"剧情ID101080301","TextValue"=>"After reading the email, what do you think about the offer now?"],
18021=>["Value"=>18021,"TextKey"=>"剧情ID101080302","TextValue"=>"…"],
18022=>["Value"=>18022,"TextKey"=>"剧情ID101080401","TextValue"=>"I'm still not sure about that. But I'm so sure about another thing..."],
18023=>["Value"=>18023,"TextKey"=>"剧情ID101080402","TextValue"=>"The young master of yours knows me so well… I think I know who he is."],
18024=>["Value"=>18024,"TextKey"=>"剧情ID101080403","TextValue"=>"It's him! Benjamin!"],
18025=>["Value"=>18025,"TextKey"=>"剧情ID101080404","TextValue"=>"I didn't say anything. You guessed it… "],
18026=>["Value"=>18026,"TextKey"=>"剧情ID101080405","TextValue"=>"I told him all these riddles is pointless cause you are too smart to fall for that."],
18027=>["Value"=>18027,"TextKey"=>"剧情ID101080501","TextValue"=>"You know what? I don't like this."],
18028=>["Value"=>18028,"TextKey"=>"剧情ID101080502","TextValue"=>"He always makes arrangements for me, as if I couldn't do anything without him, you know. "],
18029=>["Value"=>18029,"TextKey"=>"剧情ID101080503","TextValue"=>"And now he's still intervening my life after we broke up?!"],
18030=>["Value"=>18030,"TextKey"=>"剧情ID101080504","TextValue"=>"Ohh, he is in big big big trouble cause I'm crossed."],
18031=>["Value"=>18031,"TextKey"=>"剧情ID101080601","TextValue"=>"…"],
18032=>["Value"=>18032,"TextKey"=>"剧情ID101080602","TextValue"=>"It's out of my hands now. I'll go finish my work as a butler."],
18033=>["Value"=>18033,"TextKey"=>"剧情ID101080603","TextValue"=>"See? That wallpaper needs to be changed immediately!"],
18034=>["Value"=>18034,"TextKey"=>"剧情ID101090201","TextValue"=>"He didn't pick up the phone. Humph!"],
18035=>["Value"=>18035,"TextKey"=>"剧情ID101090301","TextValue"=>"Please stop cleaning. It's over between us! I will never accept anything from him."],
18036=>["Value"=>18036,"TextKey"=>"剧情ID101090401","TextValue"=>"Miss Aurora, I'm getting paid to do this. You are putting me in a really tough position."],
18037=>["Value"=>18037,"TextKey"=>"剧情ID101090402","TextValue"=>"Well… no matter what's going on I shouldn't let it out on you. I'm sorry."],
18038=>["Value"=>18038,"TextKey"=>"剧情ID101090403","TextValue"=>"It's alright."],
18039=>["Value"=>18039,"TextKey"=>"剧情ID101090404","TextValue"=>"Well… you know what. Benjamin was really sad after you left without saying goodbye. He regretted it every day about what he had done wrong to you."],
18040=>["Value"=>18040,"TextKey"=>"剧情ID101090405","TextValue"=>"That's why he made this decision. He wants to support you. I hope you can calm down and give him another chance to explain."],
18041=>["Value"=>18041,"TextKey"=>"剧情ID101090406","TextValue"=>"He should be on the plane. That's why he didn't pick up the phone."],
18042=>["Value"=>18042,"TextKey"=>"剧情ID101090407","TextValue"=>"…"],
18043=>["Value"=>18043,"TextKey"=>"剧情ID101090408","TextValue"=>"In fact, I know that it is not all his fault, he is just trying to take care of me in the way he thinks is right..."],
18044=>["Value"=>18044,"TextKey"=>"剧情ID101090409","TextValue"=>"But he really makes me feel…"],
18045=>["Value"=>18045,"TextKey"=>"剧情ID101090501","TextValue"=>"Damn it! I swore I will never ever cry over him again."],
18046=>["Value"=>18046,"TextKey"=>"剧情ID101090502","TextValue"=>"…"],
18047=>["Value"=>18047,"TextKey"=>"剧情ID101090601","TextValue"=>"About the issues between you and my young master, you can ask him face to face tomorrow."],
18048=>["Value"=>18048,"TextKey"=>"剧情ID101090602","TextValue"=>"And please think about the property contract clearly tonight. Remember you are in the driver's seat."],
18049=>["Value"=>18049,"TextKey"=>"剧情ID101090603","TextValue"=>"I'll go make the bed for you. It's very late now."],
18050=>["Value"=>18050,"TextKey"=>"剧情ID101090604","TextValue"=>"Thank you, Merlin."],
18051=>["Value"=>18051,"TextKey"=>"剧情ID101100201","TextValue"=>"Oh, I forget to tell you that I've brought all your luggage here."],
18052=>["Value"=>18052,"TextKey"=>"剧情ID101100202","TextValue"=>"Do you need a hand with clothes organizing?"],
18053=>["Value"=>18053,"TextKey"=>"剧情ID101100203","TextValue"=>"Thanks. I'll just do it myself."],
18054=>["Value"=>18054,"TextKey"=>"剧情ID101100301","TextValue"=>"Ummm, this closet…"],
18055=>["Value"=>18055,"TextKey"=>"剧情ID101100401","TextValue"=>"Give me a second. I think your closet should be upgraded."],
18056=>["Value"=>18056,"TextKey"=>"剧情ID101110201","TextValue"=>"Aright. That's enough for today. "],
18057=>["Value"=>18057,"TextKey"=>"剧情ID101110301","TextValue"=>"My God, Merlin, this is the first time I've seen a butler or housekeeper like you. This place has undergone a complete makeover in just one day."],
18058=>["Value"=>18058,"TextKey"=>"剧情ID101110302","TextValue"=>"I can't believe my eyes. It's like magic, you know. "],
18059=>["Value"=>18059,"TextKey"=>"剧情ID101110401","TextValue"=>"Awww, that's very flattering. It's just what I'm good at."],
18060=>["Value"=>18060,"TextKey"=>"剧情ID101110402","TextValue"=>"The new closet is ready. Is there anything more I can do for you?"],
18061=>["Value"=>18061,"TextKey"=>"剧情ID101110403","TextValue"=>"Leave all the rest to me."],
18062=>["Value"=>18062,"TextKey"=>"剧情ID101110404","TextValue"=>"Anyways, thanks a lot for today. And the contract…"],
18063=>["Value"=>18063,"TextKey"=>"剧情ID101110405","TextValue"=>"I will think thoroughly about the contract… and Benjamin."],
18064=>["Value"=>18064,"TextKey"=>"剧情ID101110406","TextValue"=>"No need to hurry. You have plenty of time. "],
18065=>["Value"=>18065,"TextKey"=>"剧情ID101110407","TextValue"=>"Please take a good rest tonight. Good night, Miss."],
18066=>["Value"=>18066,"TextKey"=>"剧情ID101110408","TextValue"=>"Good night! Merlin."],
18067=>["Value"=>18067,"TextKey"=>"剧情ID101120101","TextValue"=>"Ooo, such a long day. I'm so tired."],
18068=>["Value"=>18068,"TextKey"=>"剧情ID101120102","TextValue"=>"Time to catch some zzzzzzz."],
18069=>["Value"=>18069,"TextKey"=>"剧情ID101120301","TextValue"=>"The next morning…"],
18070=>["Value"=>18070,"TextKey"=>"剧情ID102010101","TextValue"=>"Doorbell's ringing."],
18071=>["Value"=>18071,"TextKey"=>"剧情ID102010102","TextValue"=>"Hey, Merlin! It's me, my old pal."],
18072=>["Value"=>18072,"TextKey"=>"剧情ID102010201","TextValue"=>"Morning, Sir. I was waiting for you! Miss Aurora is busy cleaning the living room."],
18073=>["Value"=>18073,"TextKey"=>"剧情ID102010202","TextValue"=>"Don't worry, Sir. She won't be running away from you without saying goodbye this time."],
18074=>["Value"=>18074,"TextKey"=>"剧情ID102020101","TextValue"=>"Ahem! Ouch, Merlin, ouch... Whoa, look around, what a mess!"],
18075=>["Value"=>18075,"TextKey"=>"剧情ID102020102","TextValue"=>"Hey Aurora, long time no see. So, this is the hometown you've always wanted to return to, isn't it?"],
18076=>["Value"=>18076,"TextKey"=>"剧情ID102020103","TextValue"=>"So what? I'm doing my part to change it better. It doesn't matter what it looks like now. Just wait and see."],
18077=>["Value"=>18077,"TextKey"=>"剧情ID102020104","TextValue"=>"Whateve… I'm so tired of talking with you about this matter."],
18078=>["Value"=>18078,"TextKey"=>"剧情ID102020105","TextValue"=>"We'd argued so many times in the past. But nothing really worked, wasn't it?"],
18079=>["Value"=>18079,"TextKey"=>"剧情ID102020106","TextValue"=>"Hey, take it easy, the young man and young lady. No need to be feisty here. Why don't we all sit down and have a calm conversation?"],
18080=>["Value"=>18080,"TextKey"=>"剧情ID102020107","TextValue"=>"Ben, why don't you start by explaining all the files first?"],
18081=>["Value"=>18081,"TextKey"=>"剧情ID102030101","TextValue"=>"The parlor is crowded with miscellaneous boxes and trash. Well——"],
18082=>["Value"=>18082,"TextKey"=>"剧情ID102030102","TextValue"=>"Your cleanliness is killing you, am I right? Haha, go ahead and clean. We'll have a calm talk, I promise."],
18083=>["Value"=>18083,"TextKey"=>"剧情ID102030103","TextValue"=>"Thanks for your understanding. I'll let you two be alone."],
18084=>["Value"=>18084,"TextKey"=>"剧情ID102040101","TextValue"=>"A new floor is necessary, um... The list of suppliers on the island I prepared, comes in handy now."],
18085=>["Value"=>18085,"TextKey"=>"剧情ID102040201","TextValue"=>"Very good! It will be delivered within today. "],
18086=>["Value"=>18086,"TextKey"=>"剧情ID102050201","TextValue"=>"Moreover, I ordered new carpets in advance."],
18087=>["Value"=>18087,"TextKey"=>"剧情ID102050202","TextValue"=>"The new floor is really out of place for this ragged carpet."],
18088=>["Value"=>18088,"TextKey"=>"剧情ID102050203","TextValue"=>"Old things deserve to be treasured, but this long-overdue item is not one of them."],
18089=>["Value"=>18089,"TextKey"=>"剧情ID102060101","TextValue"=>"Look, sofa springs are saying hi!"],
18090=>["Value"=>18090,"TextKey"=>"剧情ID102060102","TextValue"=>"Let me change it in a twinkling."],
18091=>["Value"=>18091,"TextKey"=>"剧情ID102060103","TextValue"=>"Alrighty! I'll help."],
18092=>["Value"=>18092,"TextKey"=>"剧情ID102070101","TextValue"=>"Why did Merlin show me all the files?"],
18093=>["Value"=>18093,"TextKey"=>"剧情ID102070102","TextValue"=>"Why are you giving me the house for free?"],
18094=>["Value"=>18094,"TextKey"=>"剧情ID102070103","TextValue"=>"Have you signed it?"],
18095=>["Value"=>18095,"TextKey"=>"剧情ID102070104","TextValue"=>"Not a chance. I think we are over. "],
18096=>["Value"=>18096,"TextKey"=>"剧情ID102070105","TextValue"=>"What a shame… You know that's never what we wanted."],
18097=>["Value"=>18097,"TextKey"=>"剧情ID102070106","TextValue"=>"Well… It seems like you are not aware of some important information about Greenville."],
18098=>["Value"=>18098,"TextKey"=>"剧情ID102070107","TextValue"=>"The reconstruction works in the town weren't going so well due to a lack of investments."],
18099=>["Value"=>18099,"TextKey"=>"剧情ID102070108","TextValue"=>"But I have already made a deal with the mayor that I'll establish a special fund and donate part of my assets for the sake of you——"],
18100=>["Value"=>18100,"TextKey"=>"剧情ID102070109","TextValue"=>"I mean, youth and children cause they are the future of our society."],
18101=>["Value"=>18101,"TextKey"=>"剧情ID102070110","TextValue"=>"And the premise of all this is that I have full authority to supervise and manage the reconstruction of this house, which means I'll be here, in Greenville, for a long time."],
18102=>["Value"=>18102,"TextKey"=>"剧情ID102070111","TextValue"=>"What?! *bang on the tea table*"],
18103=>["Value"=>18103,"TextKey"=>"剧情ID102070112","TextValue"=>"Oh, relax. This fragile tea table can't handle another pat. How about a new one?"],
18104=>["Value"=>18104,"TextKey"=>"剧情ID102080101","TextValue"=>"Thanks, man. Cool, speaking of who's the owner of this house, without a doubt, it has always been you."],
18105=>["Value"=>18105,"TextKey"=>"剧情ID102080102","TextValue"=>"I don't understand. What about your design company? How can you pursue your design dream here?"],
18106=>["Value"=>18106,"TextKey"=>"剧情ID102080103","TextValue"=>"You said we are over. Why do you care about me so much?"],
18107=>["Value"=>18107,"TextKey"=>"剧情ID102080104","TextValue"=>"Come on. You know I'm not."],
18108=>["Value"=>18108,"TextKey"=>"剧情ID102080105","TextValue"=>"Roro, isn't this what you always wanted? My support. Now you have it, emotionally and physically."],
18109=>["Value"=>18109,"TextKey"=>"剧情ID102080106","TextValue"=>"Ben…"],
18110=>["Value"=>18110,"TextKey"=>"剧情ID102080107","TextValue"=>"Sir and Madam, it seems like there's someone at the door."],
18111=>["Value"=>18111,"TextKey"=>"剧情ID102090201","TextValue"=>"Oh, new floor! It arrives much faster than I imagine."],
18112=>["Value"=>18112,"TextKey"=>"剧情ID102090202","TextValue"=>"But the vendor left without giving me the bill. So hasty."],
18113=>["Value"=>18113,"TextKey"=>"剧情ID102090203","TextValue"=>"Oh yes, I got an idea. Why don't I ask the couple to help me change the floor to divert their attention from arguing? "],
18114=>["Value"=>18114,"TextKey"=>"剧情ID102100101","TextValue"=>"Hey, the floor's here!"],
18115=>["Value"=>18115,"TextKey"=>"剧情ID102100102","TextValue"=>"Sigh…my backache is getting worse. Someone help me lay the floor, please?"],
18116=>["Value"=>18116,"TextKey"=>"剧情ID102100103","TextValue"=>"Please pardon me for failing in my duty."],
18117=>["Value"=>18117,"TextKey"=>"剧情ID102100104","TextValue"=>"What happened? Aren't you always the healthiest person among all the staff?"],
18118=>["Value"=>18118,"TextKey"=>"剧情ID102100105","TextValue"=>"Ahem ahem! Yeah, I'm just feeling a little bit tired recently. No biggie."],
18119=>["Value"=>18119,"TextKey"=>"剧情ID102100106","TextValue"=>"Don't worry, Merlin. Please go take a rest. Hand it to me."],
18120=>["Value"=>18120,"TextKey"=>"剧情ID102110101","TextValue"=>"Thank you so much, kind girl. And Benjamin will be your great helper. What do you think?"],
18121=>["Value"=>18121,"TextKey"=>"剧情ID102110102","TextValue"=>"(Merlin's right. I do need some help...)"],
18122=>["Value"=>18122,"TextKey"=>"剧情ID102110103","TextValue"=>"(But he'll stay in the town if I say yes. Oh no, what should I do…)"],
18123=>["Value"=>18123,"TextKey"=>"剧情ID102110104","TextValue"=>"Well, cool. Benjamin can stay to help. But I still need time to think about the contract."],
18124=>["Value"=>18124,"TextKey"=>"剧情ID102110105","TextValue"=>"Anyways, you will change your mind and leave here in a while."],
18125=>["Value"=>18125,"TextKey"=>"剧情ID102110106","TextValue"=>"No, I've made up my mind about staying here."],
18126=>["Value"=>18126,"TextKey"=>"剧情ID102110201","TextValue"=>"Alright. Let's just put the focus on fixing the house first."],
18127=>["Value"=>18127,"TextKey"=>"剧情ID102120101","TextValue"=>"Here's pretty spacious but filled with clutter and trash."],
18128=>["Value"=>18128,"TextKey"=>"剧情ID102120102","TextValue"=>"Let's start from the area next to Miss Aurora's room. How's that sound?"],
18129=>["Value"=>18129,"TextKey"=>"剧情ID102120103","TextValue"=>"Sound good. Let me do the cleaning myself, please."],
18130=>["Value"=>18130,"TextKey"=>"剧情ID102120104","TextValue"=>"These boxes look pretty heavy. Best to leave it to me."],
18131=>["Value"=>18131,"TextKey"=>"剧情ID102130101","TextValue"=>"How about we design a small leisure room here."],
18132=>["Value"=>18132,"TextKey"=>"剧情ID102130102","TextValue"=>"Good call. The size is perfect."],
18133=>["Value"=>18133,"TextKey"=>"剧情ID102130103","TextValue"=>"We can lay a carpet here first. It'll be very soothing to step on it barefoot when we relax."],
18134=>["Value"=>18134,"TextKey"=>"剧情ID102130104","TextValue"=>"You remember…"],
18135=>["Value"=>18135,"TextKey"=>"剧情ID102130105","TextValue"=>"Sorry?"],
18136=>["Value"=>18136,"TextKey"=>"剧情ID102130106","TextValue"=>"Nothing."],
18137=>["Value"=>18137,"TextKey"=>"剧情ID102140101","TextValue"=>"With only a floor mat, it still looks quite empty here."],
18138=>["Value"=>18138,"TextKey"=>"剧情ID102140102","TextValue"=>"Let's put a couch here. It will be nice to read on a sunny afternoon."],
18139=>["Value"=>18139,"TextKey"=>"剧情ID102140103","TextValue"=>"Good idea. I like that."],
18140=>["Value"=>18140,"TextKey"=>"剧情ID102140104","TextValue"=>"Fine, you can use it as well."],
18141=>["Value"=>18141,"TextKey"=>"剧情ID102150101","TextValue"=>"We can still make good use of the empty space here. How about a shelf?"],
18142=>["Value"=>18142,"TextKey"=>"剧情ID102150102","TextValue"=>"We can put all your cooking and my designing trophies here on the wall."],
18143=>["Value"=>18143,"TextKey"=>"剧情ID102150103","TextValue"=>"Great idea. I almost forgot about all those trophies."],
18144=>["Value"=>18144,"TextKey"=>"剧情ID102150104","TextValue"=>"I knew it."],
18145=>["Value"=>18145,"TextKey"=>"剧情ID102160101","TextValue"=>"The wallpapers here look super old here…"],
18146=>["Value"=>18146,"TextKey"=>"剧情ID102160102","TextValue"=>"But thanks to god, there are no cracks on the walls."],
18147=>["Value"=>18147,"TextKey"=>"剧情ID102160103","TextValue"=>"Aurora, why don't you choose the wallpaper?"],
18148=>["Value"=>18148,"TextKey"=>"剧情ID102170101","TextValue"=>"I didn't notice that it was so late now."],
18149=>["Value"=>18149,"TextKey"=>"剧情ID102170102","TextValue"=>"Indeed. Why don't we call it a day and go the bed?"],
18150=>["Value"=>18150,"TextKey"=>"剧情ID102170103","TextValue"=>"Cool. I'll sleep in Roro's room."],
18151=>["Value"=>18151,"TextKey"=>"剧情ID102170104","TextValue"=>"No way!"],
18152=>["Value"=>18152,"TextKey"=>"剧情ID102170105","TextValue"=>"I'm kidding, please?"],
18153=>["Value"=>18153,"TextKey"=>"剧情ID102170106","TextValue"=>"A gentleman should respect a lady's will. Come with me. I prepared a Harry Potter room for you."],
18154=>["Value"=>18154,"TextKey"=>"剧情ID102170301","TextValue"=>"The next morning…"],
18155=>["Value"=>18155,"TextKey"=>"剧情ID103010101","TextValue"=>"HEY, BENJAMIN! YOUR GOOD FRIENDS ARE ALL HERE!"],
18156=>["Value"=>18156,"TextKey"=>"剧情ID103010102","TextValue"=>"Shush! Be quiet, please. Roro's still in bed."],
18157=>["Value"=>18157,"TextKey"=>"剧情ID103010201","TextValue"=>"Oh my god! Cheese and Hatchi! How did you two get here?"],
18158=>["Value"=>18158,"TextKey"=>"剧情ID103010202","TextValue"=>"Did you take them from the Greenville Hotel, Merlin?"],
18159=>["Value"=>18159,"TextKey"=>"剧情ID103010203","TextValue"=>"No, I didn't. They were waiting outside the house when I arrived."],
18160=>["Value"=>18160,"TextKey"=>"剧情ID103010204","TextValue"=>"They must sneak out of the hotel when the nanny was not paying attention."],
18161=>["Value"=>18161,"TextKey"=>"剧情ID103010205","TextValue"=>"That's all right. I don't think there's any need to send them back."],
18162=>["Value"=>18162,"TextKey"=>"剧情ID103010206","TextValue"=>"Roger that!"],
18163=>["Value"=>18163,"TextKey"=>"剧情ID103020101","TextValue"=>"Let me show you around our new home! Whoo whoo!"],
18164=>["Value"=>18164,"TextKey"=>"剧情ID103020102","TextValue"=>"Ruff ruff! Ruff! ^^ (New home's great! Ben Ben's great! Hahahaha)"],
18165=>["Value"=>18165,"TextKey"=>"剧情ID103020103","TextValue"=>"Meow meow! Meow meow！（Oh noooo! Benjamin's broke!)"],
18166=>["Value"=>18166,"TextKey"=>"剧情ID103020201","TextValue"=>"It's so noisy in the morning."],
18167=>["Value"=>18167,"TextKey"=>"剧情ID103020202","TextValue"=>"OMG! Cheese and Hatchi! I miss you two so much!"],
18168=>["Value"=>18168,"TextKey"=>"剧情ID103020203","TextValue"=>"Ummm, I asked Merlin to bring them over here with us. I know you'll be thrilled to see them."],
18169=>["Value"=>18169,"TextKey"=>"剧情ID103020204","TextValue"=>"Awesome. Thanks for that. It's sweet."],
18170=>["Value"=>18170,"TextKey"=>"剧情ID103020205","TextValue"=>"Ruff ruff! Ruff! ^^ (Roro's great! Ben Ben's great! Hahahaha)"],
18171=>["Value"=>18171,"TextKey"=>"剧情ID103020206","TextValue"=>"Meow! Meow meow！（Oh, trust me. He's up for no good.)"],
18172=>["Value"=>18172,"TextKey"=>"剧情ID103030101","TextValue"=>"Merlin purchased some new homes for your beloved cat. Come to have a look."],
18173=>["Value"=>18173,"TextKey"=>"剧情ID103030102","TextValue"=>"Um, please say thanks to him for me. Thank you too…"],
18174=>["Value"=>18174,"TextKey"=>"剧情ID103040101","TextValue"=>"The new cat home's ready, but I don't feel it goes well with the old living room."],
18175=>["Value"=>18175,"TextKey"=>"剧情ID103040102","TextValue"=>"Don't you know how to arrange flowers? Why don't we fill these vases with flowers?"],
18176=>["Value"=>18176,"TextKey"=>"剧情ID103040103","TextValue"=>"Good idea. I like that."],
18177=>["Value"=>18177,"TextKey"=>"剧情ID103050101","TextValue"=>"Meow! Meow meow！（Hey, for real, are you guys really broke??)"],
18178=>["Value"=>18178,"TextKey"=>"剧情ID103050102","TextValue"=>"Meow, awww！（Oh man… does that means no imported cat cans for Cheese?)"],
18179=>["Value"=>18179,"TextKey"=>"剧情ID103050103","TextValue"=>"Wow, Chees is so vocal this morning. So cute!"],
18180=>["Value"=>18180,"TextKey"=>"剧情ID103050104","TextValue"=>"Meowww! (Are you serious? Listen to me, hooman!)"],
18181=>["Value"=>18181,"TextKey"=>"剧情ID103050105","TextValue"=>"You haven't had your brekkie, did you? Don't worry, I'll feed your little round belly right away."],
18182=>["Value"=>18182,"TextKey"=>"剧情ID103050106","TextValue"=>"Meow~ (Oh! That sounds not bad. I'm starving.)"],
18183=>["Value"=>18183,"TextKey"=>"剧情ID103060101","TextValue"=>"Ruff ruff! Ruff! ^^ (You still busy? Come play with me!)"],
18184=>["Value"=>18184,"TextKey"=>"剧情ID103060102","TextValue"=>"Oh gosh. Almost forgot about you! Hatchi, come with me! You need a little hut to sleep in."],
18185=>["Value"=>18185,"TextKey"=>"剧情ID103060103","TextValue"=>"A moment later…"],
18186=>["Value"=>18186,"TextKey"=>"剧情ID103060201","TextValue"=>"Look at the fancy dog villa I built for you! What do you think?"],
18187=>["Value"=>18187,"TextKey"=>"剧情ID103060202","TextValue"=>"Ruff ruff! Ruff! ^^ (Ben excellent! Me like! Me like!)"],
18188=>["Value"=>18188,"TextKey"=>"剧情ID103060203","TextValue"=>"I think I hear your belly rumbling… I'll call the vendor to send over some dog food!"],
18189=>["Value"=>18189,"TextKey"=>"剧情ID103070101","TextValue"=>"Weird… Why there's no signal? Need to figure out a solution quickly."],
18190=>["Value"=>18190,"TextKey"=>"剧情ID103070201","TextValue"=>"Why the signal out here is so bad, Merlin?"],
18191=>["Value"=>18191,"TextKey"=>"剧情ID103070202","TextValue"=>"Well, Sir. The wind cut off the cable last night, and we are rushing to repair it. It is expected to take two days to recover."],
18192=>["Value"=>18192,"TextKey"=>"剧情ID103070203","TextValue"=>"Let me install a landline for an emergency while I'm doing repairs."],
18193=>["Value"=>18193,"TextKey"=>"剧情ID103080101","TextValue"=>"Wow, good job! My old pal."],
18194=>["Value"=>18194,"TextKey"=>"剧情ID103080102","TextValue"=>"Come to the bar to take a break. I'll make you my special cocktail!"],
18195=>["Value"=>18195,"TextKey"=>"剧情ID103080103","TextValue"=>"Thanks, but no can do, Sir. It's only 1 pm. Still early for alcohol."],
18196=>["Value"=>18196,"TextKey"=>"剧情ID103080104","TextValue"=>"Relax! I'll make it virgin for you. Won't hold you too long from doing your job."],
18197=>["Value"=>18197,"TextKey"=>"剧情ID103080105","TextValue"=>"Alright then… just one."],
18198=>["Value"=>18198,"TextKey"=>"剧情ID103090101","TextValue"=>"Umm, why do I feel something is missing here? Ahh, got it. A rug will be perfect."],
18199=>["Value"=>18199,"TextKey"=>"剧情ID103090102","TextValue"=>"In the future, the young couple will be having more romantic drinks over here."],
18200=>["Value"=>18200,"TextKey"=>"剧情ID103100101","TextValue"=>"Since I just laid a new carpet, a little upgrade of the tables and chairs will be great."],
18201=>["Value"=>18201,"TextKey"=>"剧情ID103100102","TextValue"=>"Then I'll be able to arrange for them to have fine dining here. And a nightcap after…"],
18202=>["Value"=>18202,"TextKey"=>"剧情ID103100103","TextValue"=>"Tipsy in the night exchanging glances… they'd be sharing love before the night was through!"],
18203=>["Value"=>18203,"TextKey"=>"剧情ID103110101","TextValue"=>"Oh my God, it's afternoon already? I am so hungry."],
18204=>["Value"=>18204,"TextKey"=>"剧情ID103110102","TextValue"=>"I'm gonna go to the kitchen and make a simple peanut butter and jelly sandwich."],
18205=>["Value"=>18205,"TextKey"=>"剧情ID103110103","TextValue"=>"Benjamin came to the kitchen...   "],
18206=>["Value"=>18206,"TextKey"=>"剧情ID103110201","TextValue"=>"Is this… the shabby chic décor? Aurora's aunt indeed has a "refreshing" taste in art."],
18207=>["Value"=>18207,"TextKey"=>"剧情ID103110202","TextValue"=>"Look, our home designer, the spider family, is demonstrating the life hacks of soft furnishings made of spider thread."],
18208=>["Value"=>18208,"TextKey"=>"剧情ID103110203","TextValue"=>"I'm so sorry, my spider friends. But I may have to ask you to leave my house, cause Aurora's scared to death of you guys."],
18209=>["Value"=>18209,"TextKey"=>"剧情ID103120101","TextValue"=>"Phew! They are gone. Finally, I can make my favorite PB&J."],
18210=>["Value"=>18210,"TextKey"=>"剧情ID103120102","TextValue"=>"Where are the jars hiding in these cabinets? Let me search. Ahhhh——"],
18211=>["Value"=>18211,"TextKey"=>"剧情ID103120103","TextValue"=>"Cabinet door falling when Benjamin's searching for jam..."],
18212=>["Value"=>18212,"TextKey"=>"剧情ID103120201","TextValue"=>"It seems like I have to wait more time for my delicious sandwich…"],
18213=>["Value"=>18213,"TextKey"=>"剧情ID103120202","TextValue"=>"The hinges on the cabinet are loose. It'll be terrible if one of those doors falls and hit Aurora."],
18214=>["Value"=>18214,"TextKey"=>"剧情ID103130101","TextValue"=>"Benjamin finally had his sandwich…"],
18215=>["Value"=>18215,"TextKey"=>"剧情ID103130102","TextValue"=>"Burp…I can't believe I just had one meal today."],
18216=>["Value"=>18216,"TextKey"=>"剧情ID103130103","TextValue"=>"I'll wake up early tomorrow, make a full breakfast, and have a double espresso… yum! "],
18217=>["Value"=>18217,"TextKey"=>"剧情ID103130104","TextValue"=>"Oh no… I packed some arabica beans but forgot the moka pot. And there's no coffee machine in the kitchen…"],
18218=>["Value"=>18218,"TextKey"=>"剧情ID103140101","TextValue"=>"I see you managed to do a lot of things today. Woo, and even installed a nice coffee machine. Attaboy!"],
18219=>["Value"=>18219,"TextKey"=>"剧情ID103140102","TextValue"=>"Ha, easy peasy. Can I invite you for breakfast tomorrow morning?"],
18220=>["Value"=>18220,"TextKey"=>"剧情ID103140103","TextValue"=>"I… Fine. But I've got one request. I'll do the cooking cause your cooking skills are so primitive."],
18221=>["Value"=>18221,"TextKey"=>"剧情ID103140104","TextValue"=>"What do you want to eat for breakfast? Bacon and eggs or salmon bagels?"],
18222=>["Value"=>18222,"TextKey"=>"剧情ID103140105","TextValue"=>"You are the chef. You pick. I like every dish you make."],
18223=>["Value"=>18223,"TextKey"=>"剧情ID103140106","TextValue"=>"*Blush* Well… It's quite late now. I'm going to bed. Good night!"],
18224=>["Value"=>18224,"TextKey"=>"剧情ID103140107","TextValue"=>"Good night! Can't wait for tomorrow!"],
18225=>["Value"=>18225,"TextKey"=>"剧情ID104010101","TextValue"=>"Ohhhh nooo! What did you do, Hatchi! My laptop!"],
18226=>["Value"=>18226,"TextKey"=>"剧情ID104010201","TextValue"=>"What's wrong?"],
18227=>["Value"=>18227,"TextKey"=>"剧情ID104010202","TextValue"=>"Hatchi was running around and knocked over my coffee onto my laptop. Oh, hope it's still working…"],
18228=>["Value"=>18228,"TextKey"=>"剧情ID104010203","TextValue"=>"I think I saw something in Hatchi's mouth when she ran off."],
18229=>["Value"=>18229,"TextKey"=>"剧情ID104010204","TextValue"=>"In her mouth? Wait, no way!"],
18230=>["Value"=>18230,"TextKey"=>"剧情ID104020101","TextValue"=>"My CHOCOLATE MOUSSE!"],
18231=>["Value"=>18231,"TextKey"=>"剧情ID104020102","TextValue"=>"Come here, good girl! Spit it out! Right! You can't eat that, okay?"],
18232=>["Value"=>18232,"TextKey"=>"剧情ID104020103","TextValue"=>"*Whimper*"],
18233=>["Value"=>18233,"TextKey"=>"剧情ID104030101","TextValue"=>"Hatchi, you scared the shit out of me!"],
18234=>["Value"=>18234,"TextKey"=>"剧情ID104030102","TextValue"=>"You were almost dead! Do you know that?"],
18235=>["Value"=>18235,"TextKey"=>"剧情ID104030103","TextValue"=>"*Whimper*"],
18236=>["Value"=>18236,"TextKey"=>"剧情ID104030104","TextValue"=>"Don't be too hard on her. We were lucky it wasn't too late."],
18237=>["Value"=>18237,"TextKey"=>"剧情ID104030105","TextValue"=>"Silly girl, come here and have some doggie food."],
18238=>["Value"=>18238,"TextKey"=>"剧情ID104040101","TextValue"=>"Ahem… It's so dusty out here."],
18239=>["Value"=>18239,"TextKey"=>"剧情ID104040102","TextValue"=>"Sorry, I noticed that some of these boxes belong to Aurora's auntie. I didn't dare open them without your permission."],
18240=>["Value"=>18240,"TextKey"=>"剧情ID104040103","TextValue"=>"Thanks, Merlin. You're very thoughtful."],
18241=>["Value"=>18241,"TextKey"=>"剧情ID104040104","TextValue"=>"I'll do the unpacking and cleaning myself. It feels great to put everything in order."],
18242=>["Value"=>18242,"TextKey"=>"剧情ID104040105","TextValue"=>"Right? I feel the same!"],
18243=>["Value"=>18243,"TextKey"=>"剧情ID104050101","TextValue"=>"There're plenty of books over here."],
18244=>["Value"=>18244,"TextKey"=>"剧情ID104050102","TextValue"=>"Auntie is a big literature fan. Every time I saw her in her own room, she had a book in hand."],
18245=>["Value"=>18245,"TextKey"=>"剧情ID104050103","TextValue"=>"Wow, I can't believe she kept all the children's books I read when I was little."],
18246=>["Value"=>18246,"TextKey"=>"剧情ID104050104","TextValue"=>"Let's put a nice bookshelf over here. We can keep all the books organized."],
18247=>["Value"=>18247,"TextKey"=>"剧情ID104060101","TextValue"=>"Good call. The fireplace next to it needs a little touch-up."],
18248=>["Value"=>18248,"TextKey"=>"剧情ID104060102","TextValue"=>"We should put this area on top of our renovation list. Then it wouldn't be disrespectful to our guests in the future."],
18249=>["Value"=>18249,"TextKey"=>"剧情ID104060103","TextValue"=>"You're right, Merlin."],
18250=>["Value"=>18250,"TextKey"=>"剧情ID104060104","TextValue"=>"Alright then, what are your requirements for the fireplace?"],
18251=>["Value"=>18251,"TextKey"=>"剧情ID104070101","TextValue"=>"I always feel something is missing in this room."],
18252=>["Value"=>18252,"TextKey"=>"剧情ID104070102","TextValue"=>"Yeah, I feel the same. Umm… maybe some plants?"],
18253=>["Value"=>18253,"TextKey"=>"剧情ID104070103","TextValue"=>"Correct! That's exactly what the room needs now. And we should be cautious in case the little two knock them over."],
18254=>["Value"=>18254,"TextKey"=>"剧情ID104080101","TextValue"=>"There are so many small ornaments besides the book."],
18255=>["Value"=>18255,"TextKey"=>"剧情ID104080102","TextValue"=>"They look cute but don't really go well with current décor."],
18256=>["Value"=>18256,"TextKey"=>"剧情ID104080103","TextValue"=>"How about I put them in the attic for now? Trust me, I'll handle it from here."],
18257=>["Value"=>18257,"TextKey"=>"剧情ID104090101","TextValue"=>"Watch out!"],
18258=>["Value"=>18258,"TextKey"=>"剧情ID104090102","TextValue"=>"Watch out!"],
18259=>["Value"=>18259,"TextKey"=>"剧情ID104090103","TextValue"=>"Phew! That was a close call. "],
18260=>["Value"=>18260,"TextKey"=>"剧情ID104090104","TextValue"=>"The stairs are so aged…"],
18261=>["Value"=>18261,"TextKey"=>"剧情ID104090105","TextValue"=>"I need to fix them soon. Otherwise, they will be a safety hazard."],
18262=>["Value"=>18262,"TextKey"=>"剧情ID104100101","TextValue"=>"Don't forget to fix the banisters."],
18263=>["Value"=>18263,"TextKey"=>"剧情ID104100102","TextValue"=>"I'll help!"],
18264=>["Value"=>18264,"TextKey"=>"剧情ID104110101","TextValue"=>"I just got a call from the mayor."],
18265=>["Value"=>18265,"TextKey"=>"剧情ID104110102","TextValue"=>"Aurora, do you know there's a small tailor store in the south-eastern part of the town?"],
18266=>["Value"=>18266,"TextKey"=>"剧情ID104110103","TextValue"=>"Yes, I do. I've been there with my auntie."],
18267=>["Value"=>18267,"TextKey"=>"剧情ID104110104","TextValue"=>"Last night, there was a fire in the tailor shop."],
18268=>["Value"=>18268,"TextKey"=>"剧情ID104110105","TextValue"=>"What!? Was anybody hurt?"],
18269=>["Value"=>18269,"TextKey"=>"剧情ID104110106","TextValue"=>"Luckily there was no one in the shop when the fire broke out. But the fire resulted in substantial property damage. Some neighboring houses were burnt down as well."],
18270=>["Value"=>18270,"TextKey"=>"剧情ID104120101","TextValue"=>"The town workers have already relocated the people. However, the tricky thing is the government has no money for further rebuilding after the accident."],
18271=>["Value"=>18271,"TextKey"=>"剧情ID104120102","TextValue"=>"Well…the money…"],
18272=>["Value"=>18272,"TextKey"=>"剧情ID104120103","TextValue"=>"Yes, I know what you are thinking. As soon as you sign the contract, the Greenville Fund will transfer out its first donation."],
18273=>["Value"=>18273,"TextKey"=>"剧情ID104120104","TextValue"=>"…"],
18274=>["Value"=>18274,"TextKey"=>"剧情ID104120105","TextValue"=>"I still can't believe you would do all this for me."],
18275=>["Value"=>18275,"TextKey"=>"剧情ID104120106","TextValue"=>"It's easy for me to do that. But I know it means a lot to you. So, what's your decision."],
18276=>["Value"=>18276,"TextKey"=>"剧情ID104120107","TextValue"=>"I'm glad to do business with you. I hope we'll work well together from now on."],
18277=>["Value"=>18277,"TextKey"=>"剧情ID104130101","TextValue"=>"Groovy! Let me bring out the contract."],
18278=>["Value"=>18278,"TextKey"=>"剧情ID104130102","TextValue"=>"All done! Miss Aurora signed it, and Benjamin will be relieved."],
18279=>["Value"=>18279,"TextKey"=>"剧情ID104130103","TextValue"=>"No worries, once I made my decision, I will never regret it."],
18280=>["Value"=>18280,"TextKey"=>"剧情ID104140101","TextValue"=>"Now the living room is fully renovated!"],
18281=>["Value"=>18281,"TextKey"=>"剧情ID104140102","TextValue"=>"Oh, except this hidden door. This door looks like an ancient relic in this modern room."],
18282=>["Value"=>18282,"TextKey"=>"剧情ID104140103","TextValue"=>"And it's also falling apart… would be horrible if it hit the little ones. Let me change it!"],
18283=>["Value"=>18283,"TextKey"=>"剧情ID104150101","TextValue"=>"Look at your bedroom, nice and cozy!"],
18284=>["Value"=>18284,"TextKey"=>"剧情ID104150102","TextValue"=>"Forget it! It's not gonna happen, clear? I won't let you sleep here."],
18285=>["Value"=>18285,"TextKey"=>"剧情ID104150103","TextValue"=>"Hehehe, what are you talking about? I just want to put some more plants in your room."],
18286=>["Value"=>18286,"TextKey"=>"剧情ID104150104","TextValue"=>"Merlin has purchased dozens of pots of plants. Don't you need extra oxygen?"],
18287=>["Value"=>18287,"TextKey"=>"剧情ID104160101","TextValue"=>"Fine, thanks. What a busy day! Anyways, the house finally looks pleasing to the eyes."],
